INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (15.0, 0, 0.0, 0, "どこでも手に入る安価な剣。\n剣を学ぶ者の多くが\n初めて手にする大事な一振り。", 0.0, 0.0, 0.0, 0, 60, 0.0, 0.0, 1, 101011, 0.0, 0.0, 0.0, 1, "アイアンブレード", 0.0, 0.0, 0.0, 101011, 0.0, 0.0, 0.0, 1, 0, 1, 1, 6.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ペンの形をした短剣。\n攻撃力は低いが、\n携帯性に優れている。", 0.0, 0.0, 25.0, 0, 60, 0.0, 0.0, 1, 101071, 0.0, 0.0, 0.0, 1, "キラーペンシル", 0.0, 0.0, 0.0, 101071, 0.0, 0.0, 0.0, 1, 0, 7, 1, 6.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "拳を強化する木製の武器。\n簡素な作りではあるが、素手で\n攻撃するよりも、拳にかかる\n負担を軽くすることができる。", 0.0, 0.0, 0.0, 0, 60, 0.0, 5.0, 1, 101101, 0.0, 0.0, 0.0, 1, "ウッドグリップ", 0.0, 0.0, 0.0, 101101, 0.0, 0.0, 0.0, 1, 0, 10, 1, 4.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "スタンダードな木製の弓。\n主に狩人が愛用しており、\n射程、威力共に、\n動物を狩るには申し分ない。", 0.0, 1.0, 0.0, 0, 60, 0.0, 0.0, 1, 101131, 0.0, 0.0, 0.0, 1, "狩人の弓", 0.0, 0.0, 0.0, 101131, 0.0, 0.0, 0.0, 1, 0, 13, 1, 3.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "兵士がよく使用する槍。\nリーチが長く、扱いやすいため、\n戦での採用率が高い。", 0.0, 0.0, 0.0, 0, 60, 0.0, 0.0, 1, 101161, 0.0, 0.0, 0.0, 1, "鋼の槍", 0.0, 0.0, 0.0, 101161, 1.0, 0.0, 0.0, 1, 0, 16, 1, 4.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "小型の片手斧。\n本来は投げ斧として作られたが、\n取り回しやすさ故に、\n近接武器としても使われている。", 0.0, 0.0, 0.0, 0, 60, 0.0, 0.0, 1, 101191, 0.0, 0.0, 0.0, 1, "片手斧", 0.0, 0.0, 0.0, 101191, 0.0, 0.0, 0.0, 1, 0, 19, 1, 8.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ミステリオン森林に群生している\nアストライアヒノキという\n香木から削り出した杖。\n香りが怪我人の気持ちを和らげる。", 0.0, 0.0, 0.0, 0, 60, 0.0, 0.0, 1, 101251, 0.0, 8.0, 0.0, 1, "香木の杖", 0.0, 0.0, 0.0, 101251, 0.0, 0.0, 0.0, 1, 0, 25, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (50.0, 0, 0.0, 0, "もともとは職人のエプロン。\n大きなポケットがその名残。\n冒険初心者は持ち物が多いので\nこのポケットはとても重宝する。", 0.0, 0.0, 0.0, 0, 60, 0.0, 0.0, 2, 101281, 0.0, 0.0, 0.0, 2, "革のサロペット", 0.0, 0.0, 0.0, 101281, 0.0, 0.0, 0.0, 1, 0, 28, 1, 2.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (55.0, 0, 0.0, 0, "冒険者が最初に選ぶ一着。\n初めの一歩を踏み出すことへの\n祝福を込めて\nこの名で売られるようになった。", 0.0, 0.0, 0.0, 0, 60, 0.0, 0.0, 2, 101371, 0.0, 1.0, 0.0, 2, "旅立ちのローブ", 0.0, 0.0, 0.0, 101371, 0.0, 0.0, 0.0, 1, 0, 37, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (15.0, 0, 0.0, 0, "アストライアンシダーという\n針葉樹で作られた盾。\n加工しやすく安価なので\n学生の模擬戦によく用いられる。", 0.0, 0.0, 0.0, 0, 60, 0.0, 0.0, 2, 101401, 0.0, 0.0, 0.0, 2, "木の盾", 0.0, 0.0, 0.0, 101401, 1.0, 0.0, 0.0, 1, 0, 40, 1, 2.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (15.0, 0, 1.0, 0, "冒険者以外にも愛される定番の品。\n軽くて歩きやすく\n長く履くほどに足に馴染む。", 0.0, 0.0, 0.0, 0, 60, 0.0, 0.0, 2, 101431, 0.0, 0.0, 0.0, 2, "革のブーツ", 0.0, 0.0, 0.0, 101431, 0.0, 0.0, 0.0, 1, 0, 43, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "もとは絵描きが愛用していた帽子。\n日よけや風よけに手頃なため\n駆け出しの冒険者にも人気の品。", 0.0, 1.0, 0.0, 0, 60, 0.0, 0.0, 2, 101521, 0.0, 3.0, 0.0, 2, "おしゃれなベレー", 0.0, 0.0, 0.0, 101521, 0.0, 0.0, 0.0, 1, 0, 52, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "装備すると、どこからかやる気が\n漲ってくる不思議なブレスレット。\n攻撃力を上げる効果がある。", 0.0, 0.0, 25.0, 0, 60, 0.0, 0.0, 3, 101551, 0.0, 0.0, 0.0, 2, "やる気のブレスレット", 0.0, 0.0, 0.0, 101551, 1.0, 0.0, 0.0, 1, 0, 55, 1, 3.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "四つ葉のクローバーを\nあしらった御守り。\n幸運を呼び込み、持つ者の\n身を守ってくれると言われている。", 0.0, 0.0, 50.0, 0, 60, 0.0, 0.0, 3, 101581, 0.0, 0.0, 0.0, 2, "御守りペンダント", 0.0, 0.0, 0.0, 101581, 1.0, 0.0, 0.0, 1, 0, 58, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔力を帯びたブレスレット。\nつけると気合いが漲り、\n装備者の魔法攻撃力を\n上げる効果がある。", 0.0, 1.0, 25.0, 0, 60, 0.0, 0.0, 3, 101611, 0.0, 3.0, 0.0, 2, "気合のブレスレット", 0.0, 0.0, 0.0, 101611, 0.0, 0.0, 0.0, 1, 0, 61, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (30.0, 0, 0.0, 0, "刃と柄を歯車が繋ぐ珍しい剣。\n時計屋と鍛冶屋が\nコラボして開発した武器。", 0.0, 0.0, 0.0, 0, 160, 0.0, 0.0, 6, 102011, 0.0, 0.0, 0.0, 6, "ギアブレード", 0.0, 0.0, 0.0, 102011, 0.0, 0.0, 0.0, 2, 0, 1, 1, 13.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "とある貴族に献上された名剣を\n模して作られた一品。\n見た目の美しさもさることながら、\n切れ味も良く、実用性も高い。", 0.0, 0.0, 0.0, 0, 320, 0.0, 0.0, 9, 102013, 0.0, 0.0, 0.0, 14, "ブルーブラッド", 0.0, 0.0, 0.0, 102013, 0.0, 0.0, 0.0, 2, 0, 1, 1, 27.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "七色に光る美しい剣。\n刀身は振るう度に発光し、\nその軌道は、まるで空中に\n光が舞うように見える。", 0.0, 1.0, 0.0, 0, 320, 0.0, 0.0, 9, 102014, 0.0, 0.0, 0.0, 14, "オーロラの剣", 0.0, 0.0, 0.0, 102014, 1.0, 0.0, 0.0, 2, 0, 1, 1, 27.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (35.0, 0, 0.0, 0, "美しい曲線を描く刀。\n勇猛で知られた将軍をして\n血に濡らすのは惜しいと言わしめた\n美術品としても一級の一振り。", 0.0, 0.0, 0.0, 0, 320, 0.0, 0.0, 9, 102041, 0.0, 0.0, 0.0, 14, "クレセントソード", 0.0, 0.0, 0.0, 102041, 0.0, 0.0, 0.0, 2, 0, 4, 1, 30.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "戦いより、森や山で遭難した時に\n真価を発揮するナイフ。\n生き残るための様々なギミックが\n詰め込まれている。", 0.0, 0.0, 0.0, 0, 160, 0.0, 5.0, 6, 102071, 0.0, 0.0, 0.0, 6, "コマンドナイフ", 0.0, 0.0, 0.0, 102071, 0.0, 0.0, 0.0, 2, 0, 7, 1, 13.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "革に鉄を埋め込んだ、\n拳を強化するための武器。\n己の体一つで戦おうとする\n武芸者の為の装備。", 0.0, 0.0, 0.0, 0, 320, 0.0, 10.0, 9, 102101, 0.0, 0.0, 0.0, 14, "レザーナックル", 0.0, 0.0, 0.0, 102101, 0.0, 0.0, 0.0, 2, 0, 10, 1, 27.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "クリスタルマウンテンで採れる\n素材を使って作られた弓。\n水晶が魔法の触媒にもなるため、\n魔力を帯びた矢を放つことが可能。", 0.0, 1.0, 0.0, 0, 320, 0.0, 0.0, 9, 102131, 0.0, 0.0, 0.0, 14, "クリスタルボウ", 0.0, 0.0, 0.0, 102131, 0.0, 0.0, 0.0, 2, 0, 13, 1, 27.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "大陸を沈めるほどの力を持つ、\n海神ポセイドンの三叉鉾に\nあやかった槍。", 0.0, 0.0, 0.0, 0, 160, 0.0, 0.0, 7, 102162, 0.0, 0.0, 0.0, 6, "トライデント", 0.0, 0.0, 0.0, 102162, 1.0, 0.0, 0.0, 2, 0, 16, 1, 12.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "火の精霊の力を注いだ槍。\n揺らめく炎のような穂先は\n魔物を倒せば倒すほど\nますます激しく燃え盛っていく。", 0.0, 0.0, 0.0, 0, 320, 0.0, 0.0, 9, 102163, 0.0, 0.0, 0.0, 14, "フレイムスピア", 0.0, 0.0, 0.0, 102163, 3.0, 0.0, 0.0, 2, 0, 16, 1, 20.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "鋼の戦斧。\n木こり用の物と違い、\n武器として作られたそれは、\n確かな殺傷能力を持っている。", 0.0, 0.0, 0.0, 0, 160, 0.0, 0.0, 6, 102191, 0.0, 0.0, 0.0, 6, "メタルアックス", 0.0, 0.0, 0.0, 102191, 0.0, 0.0, 0.0, 2, 0, 19, 1, 16.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "高度な鋳造技術を用いて\n作り出された戦斧。\nその重量を活かした攻撃で、\n敵を殲滅する。", 0.0, 0.0, 0.0, 0, 320, 0.0, 0.0, 9, 102192, 0.0, 0.0, 0.0, 14, "ハイメタルアックス", 0.0, 0.0, 0.0, 102192, 0.0, 0.0, 0.0, 2, 0, 19, 1, 34.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "自然と密接な繋がりを持つ\nエルフが作り上げた杖。\n武器としてだけではなく、\n豊穣への祈りにも使われる。", 0.0, 0.0, 0.0, 0, 160, 0.0, 0.0, 7, 102221, 0.0, 16.0, 0.0, 6, "グリーンロッド", 0.0, 0.0, 0.0, 102221, 0.0, 0.0, 0.0, 2, 0, 22, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "宝玉を抱くドラゴンの\n姿をかたどった杖。\nわずかではあるが竜の力が\n込められている。", 0.0, 0.0, 0.0, 0, 320, 0.0, 0.0, 9, 102222, 0.0, 34.0, 0.0, 14, "リトルドラゴンロッド", 0.0, 0.0, 0.0, 102222, 0.0, 0.0, 0.0, 2, 0, 22, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "回復魔法との相性が良い杖。\nヒーラーの魔法使いが\n好んで使用する。", 0.0, 1.0, 0.0, 0, 160, 0.0, 0.0, 6, 102251, 0.0, 13.0, 0.0, 6, "医者いらずの杖", 0.0, 0.0, 0.0, 102251, 0.0, 0.0, 0.0, 2, 0, 25, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "貴重なユニコーンの角を使った杖。\n角には傷を癒す力があり、\n回復魔法の効果が上がる。", 0.0, 1.0, 0.0, 0, 320, 0.0, 0.0, 9, 102252, 0.0, 27.0, 0.0, 14, "ユニコーンの慈愛", 0.0, 0.0, 0.0, 102252, 0.0, 0.0, 0.0, 2, 0, 25, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (90.0, 0, 0.0, 0, "かつて、僧侶が信仰を広めるため\n大陸各地を旅する時に着た衣。\n動きやすく丈夫なため、\n多くの魔法使いが愛用している。", 0.0, 0.0, 0.0, 0, 160, 0.0, 0.0, 8, 102281, 0.0, 0.0, 0.0, 8, "智慧の衣", 0.0, 0.0, 0.0, 102281, 0.0, 0.0, 0.0, 2, 0, 28, 1, 5.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (150.0, 0, 0.0, 0, "薄板で作られた鎧。\n確かな防御力と、軽さ故の\n動きやすさが特徴。", 0.0, 1.0, 0.0, 0, 320, 0.0, 0.0, 14, 102282, 0.0, 0.0, 0.0, 12, "ライトプレート", 0.0, 0.0, 0.0, 102282, 1.0, 0.0, 0.0, 2, 1, 28, 0, 7.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (95.0, 0, 0.0, 0, "金属や革を鱗状に貼り付けた鎧。\n普通の鎧よりも動きやすく、\n斬撃や刺突に強い反面、\n鈍器などの打撃には弱い。", 0.0, 0.0, 0.0, 0, 160, 0.0, 0.0, 9, 102311, 0.0, 0.0, 0.0, 6, "スケイルメイル", 0.0, 0.0, 0.0, 102311, 1.0, 0.0, 0.0, 2, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (180.0, 0, 0.0, 0, "高度な鋳造技術を用いて\n作り出された強固な鎧。\n並みの攻撃では、装備者に傷一つ\n負わせることはできない。", 0.0, 1.0, 0.0, 0, 320, 0.0, 0.0, 14, 102312, 0.0, 0.0, 0.0, 10, "ハイメタルプレート", 0.0, 0.0, 0.0, 102312, 2.0, 0.0, 0.0, 2, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (90.0, 0, 0.0, 0, "アストライアの伝統的な模様が\n織り込まれた服。\n購入には相応の身分や家格が必要。", 0.0, 0.0, 0.0, 0, 160, 0.0, 0.0, 9, 102341, 0.0, 0.0, 0.0, 6, "フォークロアクロース", 0.0, 0.0, 0.0, 102341, 0.0, 0.0, 0.0, 2, 1, 34, 0, 6.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (120.0, 0, 0.0, 0, "闇に紛れて行動するのに\nこれほど優れた衣装はない。\nどこかの国では、プロのスパイが\n愛用していたといわれている。", 0.0, 1.0, 110.0, 0, 320, 0.0, 0.0, 14, 102342, 0.0, 0.0, 0.0, 10, "忍び装束", 0.0, 0.0, 0.0, 102342, 1.0, 0.0, 0.0, 2, 1, 34, 0, 7.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (65.0, 0, 0.0, 0, "春を連想させる可愛らしいローブ。\n丈夫な作りで旅路にも向いており、\nそのデザインと実用性から\n愛用者は多い。", 0.0, 1.0, 0.0, 0, 160, 0.0, 0.0, 8, 102371, 0.0, 4.0, 0.0, 6, "春色ローブ", 0.0, 0.0, 0.0, 102371, 0.0, 0.0, 0.0, 2, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (120.0, 0, 0.0, 0, "寒い北の国で愛用されていた。\n羊の毛から紡がれた糸は暖かく\nそれで織ったケープは肩や腕を\n厳しい風土から守ってくれる。", 0.0, 2.0, 0.0, 0, 320, 0.0, 0.0, 14, 102372, 0.0, 7.0, 0.0, 10, "ノルディックローブ", 0.0, 0.0, 0.0, 102372, 1.0, 0.0, 0.0, 2, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (135.0, 0, 0.0, 0, "身の丈ほどの金属の大盾。\n圧倒的な防御力を持つ反面、\nその重量故に、移動が困難となる。", 0.0, 0.0, 0.0, 0, 320, 0.0, 0.0, 15, 102401, 0.0, 0.0, 0.0, 6, "タワーシールド", 0.0, 0.0, 0.0, 102401, 3.0, 0.0, 0.0, 2, 1, 40, 0, 7.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (30.0, 0, 1.0, 0, "道化師をイメージして作られた\nおしゃれなブーツ。\n履くとどこか陽気な気分になる。", 0.0, 0.0, 0.0, 0, 160, 0.0, 0.0, 8, 102431, 0.0, 0.0, 0.0, 6, "クラウンブーツ", 0.0, 0.0, 0.0, 102431, 1.0, 0.0, 0.0, 2, 1, 43, 0, 2.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 2.0, 0, "高山に生息する魔物の骨を使って\n作り上げられたブーツ。\nワイルドなデザインが、\n野生の心を呼び覚ます！", 0.0, 1.0, 0.0, 0, 320, 0.0, 0.0, 15, 102432, 0.0, 0.0, 0.0, 10, "ハンティングブーツ", 0.0, 0.0, 0.0, 102432, 2.0, 0.0, 0.0, 2, 1, 43, 0, 3.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (30.0, 0, 0.0, 0, "魔法薬の素材採取のために、\n各地を旅する魔法使いが履く靴。\n過酷な環境にも耐えられるように、\nとても丈夫に作られている。", 0.0, 1.0, 0.0, 0, 160, 0.0, 0.0, 9, 102461, 0.0, 8.0, 0.0, 8, "ウィッチブーツ", 0.0, 0.0, 0.0, 102461, 0.0, 0.0, 0.0, 2, 0, 46, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (90.0, 0, 0.0, 0, "ゴーグルがついたキャスケット。\n風船のようなシルエットが可愛いと\nランドソルのローティーン\n注目のアイテム。", 0.0, 0.0, 0.0, 0, 160, 0.0, 0.0, 8, 102491, 0.0, 0.0, 0.0, 6, "かわいいキャスケット", 0.0, 0.0, 0.0, 102491, 1.0, 0.0, 0.0, 2, 1, 49, 0, 3.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (90.0, 0, 0.0, 0, "古代の戦士たちが使用していた兜。\nとても頑丈に作られており、\n現代でも十分に使うことができる。", 0.0, 1.0, 0.0, 0, 160, 0.0, 0.0, 9, 102493, 0.0, 0.0, 0.0, 10, "レギオンヘルム", 0.0, 0.0, 0.0, 102493, 1.0, 0.0, 0.0, 2, 1, 49, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "修道女が使用するフード。\n彼女たちは、傷ついた人々の\n身も心も癒したという。", 0.0, 3.0, 0.0, 0, 320, 0.0, 0.0, 9, 102521, 0.0, 7.0, 10.0, 10, "修道女のフード", 0.0, 0.0, 0.0, 102521, 1.0, 0.0, 0.0, 2, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "戦いに必要な『仁・智・勇』の\n勇を与えてくれる珠。\nどんな敵にもひるまず向かっていく\n勇気の御守り。", 0.0, 0.0, 30.0, 0, 160, 0.0, 5.0, 9, 102551, 0.0, 0.0, 0.0, 12, "勇気の宝珠", 0.0, 0.0, 0.0, 102551, 0.0, 0.0, 0.0, 2, 0, 55, 1, 11.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔物の持つ棘状の鱗がついた腕輪。\n装備者の力を上げる効果がある。\n凶暴な魔物の鱗で作られているため\nあまり市場には出回らない装備。", 0.0, 0.0, 0.0, 0, 320, 0.0, 10.0, 18, 102552, 0.0, 0.0, 5.0, 20, "スパイクバングル", 0.0, 0.0, 0.0, 102552, 1.0, 0.0, 0.0, 2, 0, 55, 1, 20.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (55.0, 0, 0.0, 0, "戦いに必要な『仁・智・勇』の\n仁を与えてくれる珠。\n自分や仲間を守りたいと願う\n愛の心の御守り。", 0.0, 1.0, 25.0, 0, 160, 0.0, 0.0, 9, 102581, 0.0, 0.0, 0.0, 12, "仁愛の宝珠", 0.0, 0.0, 0.0, 102581, 1.0, 0.0, 0.0, 2, 0, 58, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (120.0, 0, 0.0, 0, "騎士が無事に帰還できるようにと、\n祈りを込めて作られたミサンガ。\nその思いが装備者を守り、\n防御力を上げてくれる。", 0.0, 2.0, 0.0, 0, 320, 0.0, 0.0, 17, 102582, 0.0, 0.0, 0.0, 20, "勝利のミサンガ", 0.0, 0.0, 0.0, 102582, 2.0, 0.0, 0.0, 2, 0, 58, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "装備者の魔法攻撃力を\n上げてくれる特殊なメガネ。\n魔法石が素材として\n使われている。", 0.0, 1.0, 0.0, 0, 160, 0.0, 0.0, 9, 102611, 0.0, 11.0, 0.0, 12, "マジックグラス", 0.0, 0.0, 0.0, 102611, 0.0, 0.0, 0.0, 2, 0, 61, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "戦いに必要な『仁・智・勇』の\n智を与えてくれる珠。\n頭が冴え渡って魔法の効果が上がる\n知力の御守り。", 0.0, 0.0, 25.0, 0, 160, 0.0, 5.0, 10, 102612, 0.0, 10.0, 0.0, 12, "智慧の宝珠", 0.0, 0.0, 0.0, 102612, 0.0, 0.0, 0.0, 2, 0, 61, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "高貴な魔法使いが使用する片眼鏡。\n金属部分にはルーン文字が\n刻まれており、\n装備者の魔力を上げる力がある。", 0.0, 2.0, 0.0, 0, 320, 0.0, 0.0, 17, 102613, 0.0, 24.0, 0.0, 6, "マジックモノクル", 0.0, 0.0, 0.0, 102613, 0.0, 0.0, 0.0, 2, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "銀の腕輪に、魔法石をあしらい、\n特殊な刻印を掘ったアクセサリー。\n魔法の流れをより活性化させ、\n装備者の魔力を上げる効果がある。", 0.0, 1.0, 0.0, 0, 320, 0.0, 10.0, 18, 102614, 0.0, 20.0, 0.0, 16, "文様の腕輪", 0.0, 0.0, 0.0, 102614, 0.0, 0.0, 0.0, 2, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (90.0, 0, 0.0, 0, "隕石の欠片を使用した片刃の曲刀。\n刀身は光を浴びることで\n星屑のように煌めく。", 0.0, 0.0, 0.0, 0, 1400, 0.0, 0.0, 19, 103011, 0.0, 0.0, 0.0, 12, "煌めきの剣", 0.0, 0.0, 0.0, 103011, 0.0, 0.0, 0.0, 3, 1, 1, 0, 40.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (115.0, 0, 0.0, 0, "竜の息吹が描かれた剣。\n幅広の刃は、突くことよりも\n斬ることに優れており、振るう姿は\n天を舞う竜のように見えるだろう。", 0.0, 0.0, 0.0, 0, 3000, 0.0, 0.0, 29, 103012, 0.0, 0.0, 0.0, 20, "竜紋剣", 0.0, 0.0, 0.0, 103012, 0.0, 0.0, 0.0, 3, 1, 1, 0, 53.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (135.0, 0, 0.0, 0, "ある魔法使いが近接戦のために\n使用した剣。非力だった彼は、\n大きな鳥の羽に魔法をかけて、\nこの極めて軽量な剣を作り出した。", 0.0, 0.0, 0.0, 0, 4000, 0.0, 0.0, 37, 103013, 0.0, 0.0, 0.0, 20, "フェザーブレード", 0.0, 0.0, 0.0, 103013, 0.0, 0.0, 0.0, 3, 1, 1, 0, 61.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (65.0, 0, 0.0, 0, "東国に存在するある剣術流派の\n免許皆伝者に与えられる刀剣。\n月光の力が宿っており、装備者の\n五感と霊感を研ぎ澄ませる。", 0.0, 0.0, 0.0, 0, 3000, 0.0, 0.0, 29, 103041, 0.0, 0.0, 0.0, 32, "月光刀", 0.0, 0.0, 0.0, 103041, 0.0, 0.0, 0.0, 3, 1, 4, 0, 58.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (75.0, 0, 0.0, 0, "ある凄腕の侍が、雷獣を退治\nしたとされている刀。\n雷獣を斬った刀身には、\n稲妻の力が宿っている。", 0.0, 0.0, 0.0, 0, 4000, 0.0, 0.0, 37, 103042, 0.0, 0.0, 0.0, 40, "雷神刀", 0.0, 0.0, 0.0, 103042, 0.0, 0.0, 0.0, 3, 1, 4, 0, 68.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "とても高価なプラチナを\n使用して作られた短剣。\n護身用に懐に忍ばせる貴族も多い。", 0.0, 0.0, 0.0, 0, 1400, 0.0, 15.0, 19, 103071, 0.0, 0.0, 0.0, 12, "プラチナナイフ", 0.0, 0.0, 0.0, 103071, 0.0, 0.0, 0.0, 3, 1, 7, 0, 40.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "意思を持ち、血を求め続ける\n恐ろしい短剣。\n血を浴びると、錆びるどころか、\nより一層妖しく輝く。", 0.0, 0.0, 0.0, 0, 4000, 0.0, 0.0, 37, 103072, 0.0, 0.0, 0.0, 45, "ヴァンパイアダガー", 0.0, 0.0, 0.0, 103072, 0.0, 0.0, 3.0, 3, 1, 7, 0, 61.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "凶悪な黒竜の顎をかたどった鉤爪。\n暗器の一種で、かつてこの鉤爪を\n使用していた暗殺者は、爪に毒を\n塗り、殺傷能力を高めたという。", 0.0, 0.0, 0.0, 0, 3000, 0.0, 15.0, 29, 103101, 0.0, 0.0, 0.0, 20, "ドラゴンズクロー", 0.0, 0.0, 0.0, 103101, 0.0, 0.0, 0.0, 3, 1, 10, 0, 53.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "かつてこの弓で仕留めた獲物を\n想い人に贈り恋を叶えた男がいた。\n彼はその出来事にあやかり、\n愛の神の名をこの弓につけた。", 0.0, 3.0, 0.0, 0, 3000, 0.0, 0.0, 29, 103131, 0.0, 0.0, 0.0, 20, "キューピッドの弓", 0.0, 0.0, 0.0, 103131, 0.0, 0.0, 0.0, 3, 1, 13, 0, 53.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "人から迫害され、地下深くに\n追いやられた魔族の制作した弓。\n彼らは自分たちの領域に立ち入る\n人間を、この弓で葬ってきた。", 0.0, 3.0, 0.0, 0, 4000, 0.0, 0.0, 37, 103132, 0.0, 0.0, 0.0, 40, "デビルズボウ", 0.0, 0.0, 0.0, 103132, 0.0, 0.0, 0.0, 3, 1, 13, 0, 61.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "名誉ある騎士に贈られる斧槍。\nその刃は、折れることなく、\n国と民の為に戦う騎士の誇りを\n体現している。", 0.0, 0.0, 0.0, 0, 1400, 0.0, 0.0, 19, 103161, 0.0, 0.0, 0.0, 18, "騎士の誇り", 0.0, 0.0, 0.0, 103161, 3.0, 0.0, 0.0, 3, 1, 16, 0, 35.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "一突一殺の槍。\nその殺傷能力は、\n強固な鎧をいとも簡単に貫き、\n一突きで敵の息の根を止める。", 0.0, 0.0, 0.0, 0, 3000, 0.0, 0.0, 29, 103162, 0.0, 0.0, 0.0, 20, "アブソリュートスピア", 0.0, 0.0, 0.0, 103162, 5.0, 0.0, 0.0, 3, 1, 16, 0, 46.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "青き天体をあしらった戦斧。\n世界そのものを象徴する天体は、\n大地のエネルギーを吸収し、\n装備者に力を与える。", 0.0, 0.0, 0.0, 0, 1400, 0.0, 0.0, 19, 103191, 0.0, 0.0, 0.0, 12, "ブルースフィアアックス", 0.0, 0.0, 0.0, 103191, 0.0, 0.0, 0.0, 3, 1, 19, 0, 50.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "華麗な花を施された\nその斧が振るわれるたびに、\n新たな鮮血の大輪が咲く。", 0.0, 0.0, 0.0, 0, 3000, 0.0, 0.0, 29, 103192, 0.0, 0.0, 0.0, 46, "麗花の戦斧", 0.0, 0.0, 0.0, 103192, 0.0, 0.0, 0.0, 3, 1, 19, 0, 66.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "高度な武器の製造を研究する、\nある工房で制作された一挺。\n斧の内部に雷を貯蓄し、\n攻撃に際して放出することが可能。", 0.0, 0.0, 0.0, 0, 4000, 0.0, 0.0, 37, 103193, 0.0, 0.0, 0.0, 66, "稲妻の斧", 0.0, 0.0, 0.0, 103193, 0.0, 0.0, 0.0, 3, 1, 19, 0, 77.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ある残忍な魔法使いの一団が\n使用していた杖。\nこの杖は、彼らの犠牲となった\n者たちの血で紅く染め上げられた。", 0.0, 0.0, 0.0, 0, 1400, 0.0, 0.0, 19, 103221, 0.0, 50.0, 0.0, 12, "ソーンブラッドロッド", 0.0, 0.0, 0.0, 103221, 0.0, 0.0, 0.0, 3, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ある魔法使いが、悪魔との取引で\n手に入れたとされる曰く付きの品。\n倒した敵の魂は、この杖を通して\n悪魔に献上されるという。", 0.0, 0.0, 0.0, 0, 4000, 0.0, 0.0, 37, 103222, 0.0, 77.0, 0.0, 20, "デビルズホーン", 0.0, 0.0, 0.0, 103222, 0.0, 0.0, 0.0, 3, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "占星術を生業とする、ある魔法使い\n一族が使用していた杖。\n彼らは星を観測し、\n未来を予知したという。", 0.0, 2.0, 0.0, 0, 1400, 0.0, 0.0, 19, 103251, 0.0, 40.0, 0.0, 12, "天球の見守り", 0.0, 0.0, 0.0, 103251, 0.0, 0.0, 0.0, 3, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "人を救いたいという想いが\nこの蕾を花開かせ、\nその清浄なエネルギーは、\n治癒の力となる。", 0.0, 3.0, 0.0, 0, 3000, 0.0, 0.0, 29, 103252, 0.0, 53.0, 0.0, 20, "花蕾の杖", 0.0, 0.0, 0.0, 103252, 0.0, 0.0, 0.0, 3, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (245.0, 0, 0.0, 0, "強くてオシャレな騎士をテーマに\n作られた鎧。ただし、どんなに\nオシャレをしても、実力が伴って\nいなければ魅力は半減してしまう。", 0.0, 1.0, 0.0, 0, 1400, 0.0, 0.0, 21, 103281, 0.0, 0.0, 0.0, 32, "ファッションアーマー", 0.0, 0.0, 0.0, 103281, 1.0, 0.0, 0.0, 3, 1, 28, 0, 11.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (325.0, 0, 0.0, 0, "屈強な男たちを次々と倒し、\n闘技場の女王となった女戦士の鎧。\n対戦相手は彼女の獣のような眼光を\n見ただけで戦意を喪失したという。", 0.0, 2.0, 0.0, 0, 3000, 0.0, 0.0, 32, 103282, 0.0, 0.0, 0.0, 42, "バトリングドレス", 0.0, 0.0, 0.0, 103282, 2.0, 0.0, 0.0, 3, 1, 28, 0, 15.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (380.0, 0, 0.0, 0, "厚めの鉄板を組み合わせた鎧。\n軽快さを捨てて、防御力に\n特化させており、斧や大剣を使う\n戦士たちが好んで使用している。", 0.0, 2.0, 0.0, 0, 4000, 0.0, 0.0, 43, 103283, 0.0, 0.0, 0.0, 25, "ヘビーメタルアーマー", 0.0, 0.0, 0.0, 103283, 2.0, 0.0, 0.0, 3, 1, 28, 0, 17.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (245.0, 0, 0.0, 0, "派手好きの騎士が、デザイナーに\n頼んで作らせた鎧。\n派手さ故に戦場で目立った彼は、\n敵にとっては恰好の的となった。", 0.0, 2.0, 0.0, 0, 1400, 0.0, 0.0, 21, 103311, 0.0, 0.0, 0.0, 30, "ゴージャスアーマー", 0.0, 0.0, 0.0, 103311, 3.0, 0.0, 0.0, 3, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (180.0, 0, 0.0, 0, "布地の上に革のローブを重ねた服。\n防寒対策に優れ、寒冷地での\n素材採取などに適している。", 0.0, 1.0, 160.0, 0, 1400, 0.0, 0.0, 21, 103341, 0.0, 0.0, 0.0, 30, "ミルフィーユクロース", 0.0, 0.0, 0.0, 103341, 1.0, 0.0, 0.0, 3, 1, 34, 0, 10.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (235.0, 0, 0.0, 0, "王城内に務める女性騎士の服。\n上質な革と、黒金を使用し、\n胸にはナイトの地位を示す装飾。\n気品ある意匠に仕上がっている。", 0.0, 1.0, 210.0, 0, 3000, 0.0, 0.0, 32, 103342, 0.0, 0.0, 0.0, 25, "パレスクロース", 0.0, 0.0, 0.0, 103342, 2.0, 0.0, 0.0, 3, 1, 34, 0, 13.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (205.0, 0, 0.0, 0, "エルフの女王が、他種族との\n和平協定会議の際に着ていた服。\nエルフ族は万が一に備え、女王の\n服に強力な魔法のベールを張った。", 0.0, 2.0, 370.0, 0, 4000, 0.0, 0.0, 37, 103343, 0.0, 0.0, 0.0, 75, "コスモスクロース", 0.0, 0.0, 0.0, 103343, 2.0, 0.0, 0.0, 3, 1, 34, 0, 15.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (235.0, 0, 0.0, 0, "逸話に登場する愛の神の衣装を\nかたどって作られたローブ。\n背面の羽は、魔法で浮いており、\n本物と見間違えるほどの出来栄え。", 0.0, 4.0, 0.0, 0, 3000, 0.0, 0.0, 32, 103371, 0.0, 13.0, 0.0, 30, "キューピッドのローブ", 0.0, 0.0, 0.0, 103371, 2.0, 0.0, 0.0, 3, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (245.0, 0, 0.0, 0, "幼くして皇帝の座についた少年を、\n生涯支え続けた哲学者の服。\n彼は皇帝に正しき道と教えを説き、\n国をより良い未来へと導いた。", 0.0, 4.0, 0.0, 0, 4000, 0.0, 0.0, 43, 103372, 0.0, 14.0, 5.0, 25, "哲学者のローブ", 0.0, 0.0, 0.0, 103372, 2.0, 0.0, 0.0, 3, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (290.0, 0, 0.0, 0, "勇猛果敢な将軍の盾。\n彼は前線に立つと、\n自ら敵陣に切り込み、\n軍を勝利に導いた。", 0.0, 0.0, 0.0, 0, 3000, 0.0, 0.0, 29, 103401, 0.0, 0.0, 0.0, 25, "ガーネットシールド", 0.0, 0.0, 0.0, 103401, 6.0, 0.0, 0.0, 3, 1, 40, 0, 8.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (90.0, 0, 3.0, 0, "履くと足音が消える特殊なブーツ。\n東国のスパイが履いていたらしいが\n彼らにまつわる情報は\nそのほとんどが謎のままだ。", 0.0, 1.0, 0.0, 0, 1400, 0.0, 0.0, 23, 103431, 0.0, 0.0, 0.0, 25, "忍び足", 0.0, 0.0, 0.0, 103431, 2.0, 0.0, 0.0, 3, 1, 43, 0, 5.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (115.0, 0, 4.0, 0, "レイピアなどの細剣を使用する\n剣士のために作られたブーツ。\nとても軽く、力よりも機動性を\n重視する細剣士には最適の装備。", 0.0, 0.0, 0.0, 0, 3000, 0.0, 0.0, 35, 103432, 0.0, 0.0, 0.0, 45, "フェンサーブーツ", 0.0, 0.0, 0.0, 103432, 0.0, 0.0, 0.0, 3, 1, 43, 0, 26.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (115.0, 0, 0.0, 0, "魔法使いが正装として履くブーツ。\nどんな場所を歩こうとも、決して\n汚れない魔法がかかっている。", 0.0, 4.0, 0.0, 0, 3000, 0.0, 0.0, 34, 103461, 0.0, 20.0, 0.0, 46, "ウィッチパレスブーツ", 0.0, 0.0, 0.0, 103461, 3.0, 0.0, 0.0, 3, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (235.0, 0, 0.0, 0, "かつて存在した黒龍を信仰する\n騎士団が使用していた兜。\n彼らは龍に捧げる生贄のために、\n罪もない人々の命を奪い続けた。", 0.0, 4.0, 0.0, 0, 3000, 0.0, 0.0, 35, 103491, 0.0, 0.0, 0.0, 40, "ドラゴンヘッド", 0.0, 0.0, 0.0, 103491, 5.0, 0.0, 0.0, 3, 1, 49, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (90.0, 0, 0.0, 0, "魔法使いの一家が、修行のために\n家を出る娘に贈るカチューシャ。\n母親が自身の魔力を練り込み、\n愛をこめて作り上げる。", 0.0, 4.0, 0.0, 0, 1400, 0.0, 0.0, 23, 103521, 0.0, 20.0, 0.0, 20, "ウィッチカチューシャ", 0.0, 0.0, 0.0, 103521, 0.0, 0.0, 0.0, 3, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (115.0, 0, 0.0, 0, "伝統的な魔法使いの帽子を、\n魔力を補助するアクセサリーで\n飾ったもの。", 0.0, 6.0, 0.0, 0, 3000, 0.0, 0.0, 34, 103522, 0.0, 26.0, 0.0, 25, "ウィッチハット", 0.0, 0.0, 0.0, 103522, 0.0, 0.0, 0.0, 3, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔力の籠った\nオパールのイヤリング。\n装備者は体の内から活力が溢れ、\n攻撃力がアップする。", 0.0, 0.0, 90.0, 0, 1400, 0.0, 0.0, 25, 103551, 0.0, 0.0, 0.0, 25, "オパールイヤリング", 0.0, 0.0, 0.0, 103551, 3.0, 0.0, 0.0, 3, 1, 55, 0, 33.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "鷲の上半身と、獅子の下半身を持つ\nグリフォンの羽で作られた羽飾り。\n獰猛な獣の力が宿っている。", 0.0, 0.0, 235.0, 0, 3000, 0.0, 0.0, 36, 103552, 0.0, 0.0, 0.0, 25, "鷲獅子の羽飾り", 0.0, 0.0, 0.0, 103552, 2.0, 0.0, 0.0, 3, 1, 55, 0, 44.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (70.0, 0, 0.0, 0, "世にも珍しい緋色のダイヤ。\n竜の炎を封じ込めていると言われ、\n装備すると烈火の如き力を\n手に入れることができる。", 0.0, 0.0, 0.0, 0, 4000, 0.0, 0.0, 46, 103553, 0.0, 0.0, 0.0, 25, "スカーレットダイヤ", 0.0, 0.0, 0.0, 103553, 4.0, 0.0, 0.0, 3, 1, 55, 0, 54.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (180.0, 0, 0.0, 0, "魔力の籠った\nエメラルドのイヤリング。\n装備者は不屈の精神を得て、\n防御力がアップする。", 0.0, 3.0, 0.0, 0, 1400, 0.0, 0.0, 25, 103581, 0.0, 0.0, 0.0, 25, "エメラルドイヤリング", 0.0, 0.0, 0.0, 103581, 3.0, 0.0, 0.0, 3, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "八芒星は無限の循環を意味し、\n自然に存在する八つのエレメントを\n吸収し、装備者に\n絶え間なくその加護を授ける。", 0.0, 4.0, 0.0, 0, 3000, 0.0, 0.0, 37, 103582, 0.0, 0.0, 0.0, 40, "オクタグラムペンダント", 0.0, 0.0, 0.0, 103582, 5.0, 0.0, 0.0, 3, 1, 58, 0, 26.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (270.0, 0, 0.0, 0, "かつて獅子王と呼ばれた王の品。\n生涯の大半を戦の中で\n過ごした彼は、その勇猛さから\n多くの民衆に畏れ敬われた。", 0.0, 5.0, 0.0, 0, 4000, 0.0, 0.0, 46, 103583, 0.0, 0.0, 0.0, 45, "獅子王の守護", 0.0, 0.0, 0.0, 103583, 5.0, 0.0, 0.0, 3, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔力の籠った\nターコイズのイヤリング。\n装備者は叡智を得て、\n魔法攻撃力がアップする。", 0.0, 0.0, 0.0, 0, 1400, 0.0, 25.0, 25, 103611, 0.0, 30.0, 0.0, 25, "ターコイズイヤリング", 0.0, 0.0, 0.0, 103611, 0.0, 0.0, 0.0, 3, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔力の籠った\nパールのイヤリング。\n装備者は精神集中力が増し、\n魔力がアップする。", 0.0, 5.0, 0.0, 0, 1400, 0.0, 0.0, 25, 103612, 0.0, 10.0, 15.0, 36, "パールイヤリング", 0.0, 0.0, 0.0, 103612, 0.0, 0.0, 0.0, 3, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "賢人が龍脈の探索に使用する。\n大地に流れる気を研究し、\n大陸の環境や状態の調査に使う。", 0.0, 0.0, 0.0, 0, 3000, 0.0, 35.0, 36, 103613, 0.0, 39.0, 0.0, 41, "ソーサラーグラス", 0.0, 0.0, 0.0, 103613, 0.0, 0.0, 0.0, 3, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "精霊ダフネは自らの姿を月桂樹に\n変えた。彼女を愛したアポロンは\nその葉を永遠の愛の印として、\n身に着け続けたと言う。", 0.0, 3.0, 0.0, 0, 4000, 0.0, 0.0, 46, 103614, 0.0, 46.0, 15.0, 25, "月桂樹の哀しみ", 0.0, 0.0, 0.0, 103614, 0.0, 0.0, 0.0, 3, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (165.0, 0, 0.0, 0, "大天使が使っていたとされる\n白銀の剣。\n邪悪な存在を消し去る\n退魔の力を持っている。", 0.0, 0.0, 0.0, 0, 7200, 0.0, 0.0, 48, 104011, 0.0, 0.0, 0.0, 100, "エンジェルブレード", 0.0, 0.0, 0.0, 104011, 0.0, 0.0, 0.0, 4, 1, 1, 0, 73.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (70.0, 0, 0.0, 0, "太陽神・アポロンの加護を受けたと\nされる剣。その剣を手にした人物は\n太陽王と呼ばれ、歴史に名を刻むと\n共に永きに渡る繁栄をもたらした。", 0.0, 0.0, 0.0, 0, 10000, 0.0, 15.0, 52, 104012, 0.0, 0.0, 0.0, 80, "太陽剣", 0.0, 0.0, 0.0, 104012, 0.0, 0.0, 0.0, 4, 1, 1, 0, 80.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "斬撃と同時に氷の魔法が発動し\n敵を討つ魔法剣。\n氷の妖精の魔力を用いているため、\n常に冷気を帯びている。", 4.0, 0.0, 0.0, 0, 15000, 10.0, 0.0, 52, 104013, 0.0, 0.0, 0.0, 150, "アイスクレイモア", 0.0, 0.0, 0.0, 104013, 0.0, 0.0, 0.0, 4, 1, 1, 0, 95.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (140.0, 0, 0.0, 0, "幾万人の生き血を吸い続けた妖剣。\n呪われれば血を求める傀儡と\n化すが、制御できれば鋼のごとき\n力を得るといわれる。", 0.0, 0.0, 0.0, 0, 18000, 0.0, 0.0, 58, 104014, 0.0, 0.0, 0.0, 120, "カオスブレード", 0.0, 0.0, 0.0, 104014, 0.0, 0.0, 2.0, 4, 1, 1, 0, 95.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (80.0, 0, 0.0, 0, "深き森の遺跡に眠るという刀剣。\nこの剣に選ばれし者は、蝶に\n誘われることで、その場所に\n辿り着くことができるという。", 0.0, 0.0, 0.0, 0, 7200, 0.0, 0.0, 48, 104041, 0.0, 0.0, 0.0, 100, "妖蝶の刀", 0.0, 0.0, 0.0, 104041, 0.0, 0.0, 2.0, 4, 1, 4, 0, 73.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "光の女神・アグライアの神託を受け\nた刀鍛冶が生涯をかけて鍛え上げた\n光の剣。人類が魔神に対抗しうる武\n器として、高名な勇者が手にした。", 8.0, 0.0, 0.0, 0, 10000, 0.0, 0.0, 52, 104042, 0.0, 0.0, 0.0, 192, "光輝の剣", 0.0, 0.0, 0.0, 104042, 0.0, 0.0, 0.0, 4, 1, 4, 0, 104.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天空を支配する気高き鷹神の剣。\n振れば獲物を狙う鷹のごとく、\n魔力で加速した切っ先が\n的確に敵の急所をとらえる。", 0.0, 0.0, 0.0, 0, 15000, 15.0, 0.0, 52, 104043, 0.0, 0.0, 0.0, 120, "鷹神の煌剣", 0.0, 0.0, 0.0, 104043, 0.0, 0.0, 0.0, 4, 1, 4, 0, 105.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "日出処に現れる鳳凰神の力を\n宿した刀。意志の強さで纏う炎が\n変化し、強靭な意志を持つ者\nであれば鉄をも溶かす烈火となる。", 0.0, 0.0, 100.0, 0, 18000, 10.0, 0.0, 58, 104044, 0.0, 0.0, 0.0, 180, "鳳凰刀", 0.0, 0.0, 0.0, 104044, 0.0, 0.0, 0.0, 4, 1, 4, 0, 110.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "あるドワーフの名工が、人間の王に\n献上したと言われる短剣。\n使用された素材は、現存する\nどの鉱石とも一致しない未知の物。", 0.0, 0.0, 0.0, 0, 7200, 0.0, 25.0, 48, 104071, 0.0, 0.0, 0.0, 100, "プレシャスナイフ", 0.0, 0.0, 0.0, 104071, 0.0, 0.0, 0.0, 4, 1, 7, 0, 73.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (50.0, 0, 0.0, 0, "歴史上最も長く存続した小国の王家\nに伝わる短刀。その刀は代々王女へ\nと受け継がれ、彼女らに降りかかる\n魔を払い、国の安寧を守り続けた。", 0.0, 0.0, 300.0, 0, 10000, 0.0, 0.0, 52, 104072, 0.0, 0.0, 0.0, 80, "プリンセスの懐剣", 0.0, 0.0, 0.0, 104072, 0.0, 0.0, 0.0, 4, 1, 7, 0, 75.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "禁忌に手を染め、人の道を外れた\n悪しき魔法使いを粛清するために\n作られた短剣。魔法の発動を封じる\n術式が施されている。", 0.0, 5.0, 150.0, 0, 15000, 0.0, 0.0, 52, 104073, 0.0, 0.0, 0.0, 120, "ダークマターエッジ", 0.0, 0.0, 0.0, 104073, 0.0, 0.0, 0.0, 4, 1, 7, 0, 80.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "純真無垢な女性だけが扱える短剣。\nあらゆる穢れを拒絶するため、\n邪な意志を持つ者には触れる\nことすらできない。", 0.0, 0.0, 150.0, 0, 18000, 0.0, 0.0, 58, 104074, 0.0, 0.0, 0.0, 160, "ユニコーンナイフ", 0.0, 0.0, 5.0, 104074, 0.0, 0.0, 0.0, 4, 1, 7, 0, 84.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "煉獄の焔で鍛え上げられた\n深紅の篭手。\n拳から発する業火は、\n眼前の敵を跡形もなく焼き払う。", 0.0, 0.0, 0.0, 0, 7200, 0.0, 25.0, 48, 104101, 0.0, 0.0, 0.0, 125, "火焔のガントレット", 0.0, 0.0, 0.0, 104101, 0.0, 0.0, 0.0, 4, 1, 10, 0, 73.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "獅子王と呼ばれた名君が使用した\n黄金の篭手。その篭手は使用者に\n無限の力を与え、一騎当千の戦い\nを約束したといわれている。\n", 9.0, 0.0, 0.0, 0, 10000, 10.0, 0.0, 52, 104102, 0.0, 0.0, 0.0, 80, "獅子王のガントレット", 0.0, 0.0, 0.0, 104102, 0.0, 0.0, 0.0, 4, 1, 10, 0, 111.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "たった一人で万の軍勢を滅ぼした\n氷の女神の魔力を封じた鉤爪。\n切り裂く風は吹雪のように凍てつき\n敵の戦意を挫く。", 0.0, 0.0, 0.0, 0, 15000, 10.0, 0.0, 52, 104103, 5.0, 0.0, 0.0, 230, "ブリザードクロー", 0.0, 0.0, 0.0, 104103, 0.0, 0.0, 0.0, 4, 1, 10, 0, 90.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "猛き雷神の加護を受けた籠手。\n放たれる蒼き雷撃は一瞬で敵を\n焦がし、雷雲さえも\n呼び寄せるという。", 0.0, 4.0, 0.0, 0, 18000, 10.0, 0.0, 58, 104104, 0.0, 0.0, 0.0, 120, "蒼雷拳", 0.0, 0.0, 0.0, 104104, 0.0, 0.0, 0.0, 4, 1, 10, 0, 100.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "英雄は人を喰らう海竜を倒すために\nこの弓に雷の力を封じ込めた。\n電光纏いしその矢は、海竜を一撃で\n葬ったといわれている。", 0.0, 4.0, 0.0, 0, 7200, 0.0, 0.0, 48, 104131, 0.0, 0.0, 0.0, 145, "雷光弓", 0.0, 0.0, 0.0, 104131, 0.0, 0.0, 0.0, 4, 1, 13, 0, 73.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "旧時代の終末大戦で大天使が悪魔\nとの戦いに用いた大弓。この放た\nれた矢の一撃は、地獄の最下部コ\nキュートスにまで届いたという。", 4.0, 4.0, 120.0, 0, 10000, 0.0, 0.0, 52, 104132, 0.0, 0.0, 0.0, 80, "エンジェルボウ", 0.0, 0.0, 0.0, 104132, 0.0, 0.0, 0.0, 4, 1, 13, 0, 75.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "狩猟の女神の加護を宿した弓。\n獲物を逃さない百発百中の狙いと、\n破魔の効果を得た矢が\n一射で戦局を塗り替える。", 0.0, 6.0, 0.0, 0, 15000, 15.0, 0.0, 52, 104133, 0.0, 0.0, 0.0, 120, "アルテミスボウ", 0.0, 0.0, 0.0, 104133, 0.0, 0.0, 0.0, 4, 1, 13, 0, 75.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "精霊樹を素材にした弓。\n精霊界の神聖な魔力を内包\nしており、放たれる矢は\nあらゆる敵を貫く威力を持つ。", 0.0, 4.0, 60.0, 0, 18000, 0.0, 0.0, 58, 104134, 0.0, 0.0, 0.0, 120, "精霊樹の弓", 0.0, 0.0, 5.0, 104134, 0.0, 0.0, 0.0, 4, 1, 13, 0, 80.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "火山に生息する竜の背に、\n突き刺さっていた槍。\n穂先は長年竜の体内にあったことで\n炎の力を宿すこととなった。", 0.0, 0.0, 0.0, 0, 7200, 0.0, 0.0, 48, 104161, 0.0, 0.0, 0.0, 125, "緋竜槍", 0.0, 0.0, 0.0, 104161, 6.0, 0.0, 0.0, 4, 1, 16, 0, 64.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "大陸の全土を支配したといわれる伝\n説の女王が使用していた大槍。英知\nに優れ、戦にも長けていた彼女は、\nこの槍の力で大陸を手中に収めた。", 0.0, 2.0, 0.0, 0, 10000, 0.0, 0.0, 52, 104162, 0.0, 0.0, 0.0, 80, "クイーンビースピア", 0.0, 0.0, 0.0, 104162, 5.0, 0.0, 0.0, 4, 1, 16, 0, 68.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説の槍騎士が所有していた名槍。\n一振りすれば真空の刃が旋風となり\n刃に直接触れることなく\n周囲の敵を一網打尽にする。", 0.0, 2.0, 0.0, 0, 15000, 5.0, 0.0, 52, 104163, 0.0, 0.0, 0.0, 205, "ストームブリンガー", 0.0, 0.0, 0.0, 104163, 3.0, 0.0, 0.0, 4, 1, 16, 0, 85.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "大地母神の加護を受けた槍。\n決して折れず欠けず砕けない。\nその強靭さを所持者に宿し、膂力を\n飛躍的に向上させる。", 3.0, 2.0, 0.0, 0, 18000, 0.0, 0.0, 58, 104164, 0.0, 0.0, 0.0, 120, "ガイアバルディッシュ", 0.0, 0.0, 0.0, 104164, 3.0, 0.0, 0.0, 4, 1, 16, 0, 80.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "人の世を脅かした邪龍を、各地の\n英傑たちが集いこの斧に封印した。\n龍の魂が宿ったこの斧は、\n禍々しいエネルギーを発している。", 0.0, 0.0, 0.0, 0, 7200, 0.0, 0.0, 48, 104191, 0.0, 0.0, 0.0, 100, "紫龍斧", 0.0, 0.0, 0.0, 104191, 0.0, 0.0, 0.0, 4, 1, 19, 0, 91.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "地獄の業火が封じられた両刃斧。そ\nの身は血のように赤く、ひと振りす\nれば紅蓮の炎が敵に襲いかかり、骨\nまで焼き尽くすといわれている。", 0.0, 0.0, 0.0, 0, 10000, 0.0, 0.0, 52, 104192, 0.0, 0.0, 0.0, 105, "ヘルファイアアックス", 0.0, 0.0, 0.0, 104192, 0.0, 0.0, 0.0, 4, 1, 19, 0, 97.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "戦の最前線に立ち続けた女王の斧。\n想像を絶する重量だが、斧が認めた\n所有者には軽々と扱える。その刃は\n堅牢な城門すら一撃で打ち破る。", 0.0, 0.0, 0.0, 0, 15000, 0.0, 0.0, 52, 104193, 0.0, 0.0, 0.0, 150, "戦女王の烈斧", 0.0, 0.0, 0.0, 104193, 0.0, 0.0, 0.0, 4, 1, 19, 0, 114.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "水の精霊が精霊力を注いだ斧。\n軽量だが、切れ味は鋭く、\n触れるだけで鉱物を寸断することも\n可能。", 0.0, 0.0, 0.0, 0, 18000, 10.0, 0.0, 58, 104194, 0.0, 0.0, 0.0, 120, "アクアスラッシャー", 0.0, 0.0, 0.0, 104194, 0.0, 0.0, 0.0, 4, 1, 19, 0, 120.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "妻を殺され、復讐の鬼と化した\n魔法使いが所持していた杖。\n彼は自身の怒りをこの杖に籠め、\n妻の死に関わった全員を抹殺した。", 0.0, 0.0, 0.0, 0, 7200, 0.0, 0.0, 48, 104221, 0.0, 91.0, 0.0, 120, "フューリーロッド", 0.0, 0.0, 0.0, 104221, 0.0, 0.0, 0.0, 4, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "太古の賢人たちが太陽の欠片をより\n集めて作ったとされる神秘的な杖。\nその杖に選ばれた者は全知全能の力\nを身に宿すといわれている。", 0.0, 0.0, 0.0, 0, 10000, 0.0, 0.0, 52, 104222, 0.0, 92.0, 0.0, 80, "太陽のロッド", 0.0, 0.0, 0.0, 104222, 0.0, 0.0, 1.0, 4, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "正義と平和、そして真実を司った\n神が持っていたとされる錫杖。\nこれを手にした者は、神の託宣を\n授かるという。", 0.0, 0.0, 0.0, 0, 15000, 0.0, 0.0, 52, 104223, 0.0, 104.0, 0.0, 120, "司法神の錫杖", 5.0, 0.0, 0.0, 104223, 0.0, 0.0, 0.0, 4, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "高位な悪魔の魂を宿した杖。\n敵対者には容赦がなく、\n敵を倒す魔法を使用する\nことで真価を発揮する。", 0.0, 0.0, 100.0, 0, 18000, 0.0, 0.0, 58, 104224, 0.0, 108.0, 0.0, 280, "ハイデビルズワンド", 5.0, 0.0, 0.0, 104224, 0.0, 0.0, 1.0, 4, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "月の女神が、信仰深い信者の\n病を治す際に使用したとされる杖。\n彼女の力を恐れた死の神は、\n杖を下界に隠したといわれている。", 0.0, 4.0, 0.0, 0, 7200, 0.0, 0.0, 48, 104251, 0.0, 73.0, 0.0, 100, "月華杖", 0.0, 0.0, 0.0, 104251, 0.0, 0.0, 0.0, 4, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "生命の樹と呼ばれる巨大樹の枝で作\nられた奇跡の杖。振るえば枯れ木に\n新緑の葉が芽吹き、大地を突けば水\nが湧くといわれている。\n", 0.0, 4.0, 0.0, 0, 10000, 0.0, 0.0, 52, 104252, 0.0, 67.0, 15.0, 80, "生命のロッド", 0.0, 0.0, 0.0, 104252, 0.0, 0.0, 0.0, 4, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "不死鳥の加護をまとった聖なる杖。\n無尽蔵の魔力供給を得ることができ\n魔力切れを起こすことなく\n魔法を撃ち続けることができる。", 0.0, 4.0, 0.0, 0, 15000, 0.0, 0.0, 52, 104253, 5.0, 77.0, 0.0, 230, "フェニックスロッド", 0.0, 0.0, 0.0, 104253, 0.0, 0.0, 0.0, 4, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "慈愛溢れる天使の加護を受けた杖。\n他者を慈しむ思いに呼応するため、\n仲間を助ける魔法の効果が\n著しく向上する。", 0.0, 4.0, 100.0, 0, 18000, 0.0, 0.0, 58, 104254, 0.0, 86.0, 5.0, 120, "ハイエンジェルロッド", 0.0, 0.0, 0.0, 104254, 0.0, 0.0, 0.0, 4, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (450.0, 0, 0.0, 0, "姿を消す魔法がかかった特殊な鎧。\nある国の姫が許されざる恋をし、\n駆け落ちの際に使用したと\n言われている。", 0.0, 2.0, 0.0, 0, 7200, 0.0, 0.0, 51, 104281, 0.0, 0.0, 0.0, 120, "インビジブルドレス", 0.0, 0.0, 0.0, 104281, 2.0, 0.0, 0.0, 4, 1, 28, 0, 20.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (250.0, 0, 0.0, 0, "銀の輝きと鋼をしのぐ強さを\nあわせ持つ希少な金属と、\n当代随一の名工との出会いが生んだ\n美と強靭さを兼ね備えた至高の鎧。", 0.0, 2.0, 0.0, 0, 10000, 0.0, 25.0, 52, 104282, 0.0, 0.0, 0.0, 172, "ミスリルプレート", 0.0, 0.0, 0.0, 104282, 3.0, 0.0, 0.0, 4, 1, 28, 0, 25.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (150.0, 0, 0.0, 0, "神の名のもとに異教徒を打ち払った\n誇り高き勇者がまといし鎧。\n付与された神の加護の恩恵は\n穢れなき魂の者にのみ与えられる。", 0.0, 4.0, 0.0, 0, 15000, 10.0, 0.0, 54, 104283, 0.0, 0.0, 0.0, 200, "クルセイダープレート", 0.0, 0.0, 0.0, 104283, 5.0, 0.0, 0.0, 4, 1, 28, 0, 35.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (160.0, 0, 0.0, 0, "闇の女帝から、国を守る為に\n戦った騎士姫の紅き鎧。\nその神々しい輝きは敵を恐怖させ、\n民には勇気を与えた。", 0.0, 3.0, 0.0, 0, 18000, 10.0, 0.0, 58, 104284, 0.0, 0.0, 0.0, 280, "スカーレットメイル", 0.0, 0.0, 0.0, 104284, 4.0, 0.0, 0.0, 4, 1, 28, 0, 44.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (450.0, 0, 0.0, 0, "天使たちが戦で使用した鎧。\n低級な悪魔は鎧に近づくことすら\nできず、白銀に反射する光を\n浴びるだけで、消滅したという。", 0.0, 4.0, 0.0, 0, 7200, 0.0, 0.0, 51, 104311, 0.0, 0.0, 0.0, 155, "エンジェルアーマー", 0.0, 0.0, 0.0, 104311, 5.0, 0.0, 0.0, 4, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "一騎駆けにその身を捧げた\n狂戦士の魂が宿る鎧。\nこれを身に着けた者は\n戦鬼の力を得る。", 0.0, 4.0, 400.0, 0, 10000, 0.0, 0.0, 52, 104312, 0.0, 0.0, 0.0, 125, "バーミリオンメイル", 0.0, 0.0, 0.0, 104312, 4.0, 0.0, 0.0, 4, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "戦場の死神と恐れられた\n大将軍が身につけた美麗な鎧。\n敵兵はこの菫色の甲冑を見ただけで\n浮足立ち、混乱したという。", 0.0, 10.0, 0.0, 0, 15000, 0.0, 0.0, 54, 104313, 0.0, 0.0, 0.0, 252, "バイオレットアーマー", 0.0, 0.0, 0.0, 104313, 4.0, 0.0, 0.0, 4, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "竜殺しの英雄が愛用した重鎧。\n竜の意匠が施された分厚い装甲は、\n鉄をも引き裂く爪や、\n灼熱のブレスをも防いだという。", 0.0, 10.0, 0.0, 0, 18000, 0.0, 0.0, 58, 104314, 0.0, 0.0, 0.0, 330, "ドラゴニックアーマー", 0.0, 0.0, 0.0, 104314, 7.0, 0.0, 1.0, 4, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (360.0, 0, 0.0, 0, "王の密命を受けた神官が己の命を\n賭して作り上げた美しき法衣。\n月明かりの中で縫い上げたため、\n月光を受けると七色の輝きを放つ。", 0.0, 2.0, 325.0, 0, 7200, 0.0, 0.0, 51, 104341, 0.0, 0.0, 0.0, 190, "月下の法衣", 0.0, 0.0, 0.0, 104341, 2.0, 0.0, 0.0, 4, 1, 34, 0, 10.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (180.0, 0, 1.0, 0, "隠者と呼ばれる、魔道の深淵を\n覗かんとした者の服。\n魔力が練り込まれた糸で\n縫製されている。", 0.0, 3.0, 0.0, 0, 10000, 0.0, 0.0, 52, 104342, 0.0, 0.0, 0.0, 150, "ハーミットクロース", 0.0, 0.0, 0.0, 104342, 5.0, 0.0, 0.0, 4, 1, 34, 0, 35.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "民のためなら神々にすら刃向かう\n義侠の志に篤き術者のローブ。\n無上の輝きに包まれし天の加護が\n装備者に鋼の意志を与える。", 0.0, 2.0, 0.0, 0, 15000, 10.0, 0.0, 54, 104343, 0.0, 0.0, 0.0, 270, "蒼天のローブ", 0.0, 0.0, 0.0, 104343, 3.0, 0.0, 0.0, 4, 1, 34, 0, 45.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "闇の女帝が身に纏いしドレス。\n蠢く闇の如き漆黒の意匠は、\nあらゆる魔をも魅了し、\n人々には恐怖を与えたという。", 0.0, 0.0, 250.0, 0, 18000, 0.0, 0.0, 58, 104344, 0.0, 0.0, 0.0, 330, "ダークテラードレス", 0.0, 0.0, 0.0, 104344, 7.0, 0.0, 0.0, 4, 1, 34, 0, 30.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (165.0, 0, 0.0, 0, "人生を魔道に捧げた大魔導師が\nまとっていたローブ。\nかつての主の強大な力により、\n未だ妖しい魔力を放ち続けている。", 4.0, 4.0, 0.0, 0, 7200, 0.0, 0.0, 51, 104371, 0.0, 47.0, 0.0, 120, "大魔導師のローブ", 0.0, 0.0, 0.0, 104371, 2.0, 0.0, 0.0, 4, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (240.0, 0, 0.0, 0, "天使たちと共に、\n悪魔と対峙した聖者が\nまとったとされるローブ。\nその気高さは神話の領域。", 0.0, 4.0, 0.0, 0, 10000, 0.0, 0.0, 52, 104372, 0.0, 37.0, 5.0, 141, "聖者のローブ", 0.0, 0.0, 0.0, 104372, 2.0, 0.0, 0.0, 4, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "神樹の森に住まうという、偉大なる\n賢者が身につけたローブ。\n神霊の力を宿しており、\nあらゆる魔の力から装備者を守る。", 0.0, 6.0, 0.0, 0, 18000, 0.0, 0.0, 58, 104373, 0.0, 25.0, 3.0, 321, "翠緑の霊衣", 0.0, 0.0, 0.0, 104373, 4.0, 0.0, 0.0, 4, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (165.0, 0, 0.0, 0, "女王が絶対の信頼を置く\n近衛兵にのみ与えられる盾。\n絶対的な守護の力を宿しており、\n魔法や呪いすらも跳ね返す。", 0.0, 4.0, 0.0, 0, 7200, 0.0, 0.0, 52, 104401, 0.0, 0.0, 0.0, 166, "エンプレスシールド", 0.0, 0.0, 0.0, 104401, 4.0, 0.0, 4.0, 4, 1, 40, 0, 18.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "乱世の小国において、生涯をかけて\n王女の命を守り通した騎士の盾。\nのちに王女は女王として近隣を統べ\nその騎士を救国の英雄と讃えた。", 0.0, 4.0, 0.0, 0, 15000, 0.0, 0.0, 55, 104402, 0.0, 0.0, 0.0, 246, "ガーディアンシールド", 0.0, 0.0, 0.0, 104402, 4.0, 0.0, 3.0, 4, 1, 40, 0, 50.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (165.0, 0, 6.0, 0, "神聖な力による加護を受けた\n聖騎士の脚具。\n彼らは民の命を守るため、\n命を懸けて魔物と戦った。", 0.0, 2.0, 0.0, 0, 7200, 0.0, 0.0, 52, 104431, 0.0, 0.0, 0.0, 155, "パラディングリーブ", 0.0, 0.0, 0.0, 104431, 4.0, 0.0, 0.0, 4, 1, 43, 0, 9.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (220.0, 0, 5.0, 0, "神話に姿を現す聖なる脚具。\nあらゆる攻撃を寄せ付けず、\n炎の中すら涼しげに\n歩くことができる。", 0.0, 3.0, 0.0, 0, 10000, 0.0, 0.0, 52, 104432, 0.0, 0.0, 15.0, 140, "エンジェルブーツ", 0.0, 0.0, 0.0, 104432, 3.0, 0.0, 0.0, 4, 1, 43, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 5.0, 0, "太古の妖精が加護を与えた脚甲。\n巨大な霊力に加え魔除けの\nミスリルを随所に細工することで、\n破魔の力を増大させている。", 0.0, 3.0, 0.0, 0, 18000, 0.0, 0.0, 58, 104433, 0.0, 0.0, 10.0, 290, "フェアリアルブーツ", 0.0, 0.0, 0.0, 104433, 0.0, 0.0, 0.0, 4, 1, 43, 0, 38.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (165.0, 0, 0.0, 0, "王族に認められた魔法使いにのみ\n贈られる特別な品。\nその道百年のエルフの職人にしか、\nこの靴を作ることができない。", 0.0, 6.0, 0.0, 0, 7200, 0.0, 0.0, 52, 104461, 0.0, 27.0, 0.0, 120, "ウィザードブーツ", 0.0, 0.0, 0.0, 104461, 4.0, 0.0, 0.0, 4, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "黄泉を司る者として恐れられた\n稀代のネクロマンサー愛用の靴。\nその靴音を聞いた者は精気を奪われ\n装備者に隷属するという。", 0.0, 12.0, 200.0, 0, 15000, 0.0, 0.0, 55, 104462, 0.0, 15.0, 0.0, 220, "ネクロマンサーブーツ", 0.0, 0.0, 0.0, 104462, 1.0, 0.0, 0.0, 4, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (40.0, 0, 0.0, 0, "水を司る四大精霊の\n力を宿した美しいブーツ。\n偉大なる精霊の力により、\n装備者の魔力を引き出すという。", 0.0, 5.0, 0.0, 0, 18000, 0.0, 0.0, 58, 104463, 2.0, 50.0, 0.0, 280, "アクエリアスブーツ", 7.0, 0.0, 0.0, 104463, 0.0, 0.0, 0.0, 4, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (490.0, 0, 0.0, 0, "空の踊り手と呼ばれた半神半人の\n騎士が使用していた兜。\n彼は空を縦横無尽に舞い、\n敵を翻弄したと言われている。", 0.0, 0.0, 0.0, 0, 7200, 0.0, 0.0, 52, 104491, 0.0, 0.0, 0.0, 135, "フェザーワルツ", 0.0, 0.0, 0.0, 104491, 4.0, 0.0, 0.0, 4, 1, 49, 0, 18.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (165.0, 0, 0.0, 0, "国が認める最高位の魔法使いの証。\nこのフードを持つ者は、\n王の傍らに立つことを許される。", 0.0, 8.0, 0.0, 0, 7200, 0.0, 0.0, 52, 104521, 0.0, 37.0, 0.0, 105, "ウィザードフード", 0.0, 0.0, 0.0, 104521, 0.0, 0.0, 0.0, 4, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (90.0, 0, 0.0, 0, "歴代の法王が\n外征時に身につけた頭具。\n破魔の効果が付与されており、\n幻術を造作もなく見破る。", 0.0, 4.0, 0.0, 0, 10000, 0.0, 20.0, 52, 104522, 0.0, 45.0, 0.0, 180, "法王のフード", 5.0, 0.0, 0.0, 104522, 0.0, 0.0, 0.0, 4, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "とある魔法王国の女王が身につけた\n由緒正しき冠。自身の魔力を\n増大させるその力で、女王は長く\n王国に秩序をもたらした。", 0.0, 5.0, 0.0, 0, 15000, 0.0, 0.0, 55, 104523, 0.0, 45.0, 0.0, 246, "福音のティアラ", 5.0, 0.0, 0.0, 104523, 3.0, 0.0, 0.0, 4, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "四大精霊の魔力を統合し、\n封じ込めた特殊な鉱石。\n稀代の錬金術師が成し遂げた\n一大発明品。", 5.0, 0.0, 0.0, 0, 7200, 10.0, 0.0, 52, 104551, 0.0, 0.0, 0.0, 80, "エレメンタルハート", 0.0, 0.0, 0.0, 104551, 2.0, 0.0, 0.0, 4, 1, 55, 0, 66.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "太陽神の加護を受けた宝玉を用いた\n魔に抗う者たちのための首飾り。\n強大な敵と対峙しても怯むことなく\n自らを鼓舞して戦うことができる。", 0.0, 2.0, 0.0, 0, 15000, 10.0, 0.0, 57, 104552, 0.0, 0.0, 10.0, 120, "太陽のアミュレット", 0.0, 0.0, 0.0, 104552, 0.0, 0.0, 0.0, 4, 1, 55, 0, 70.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "創世の刻より燃え続いている炎を\n宿すルビーが嵌められた指輪。\n万物を焼き払うほどの炎を\n身に纏うことができるという。", 0.0, 0.0, 0.0, 0, 18000, 12.0, 0.0, 60, 104553, 0.0, 0.0, 0.0, 120, "焔帝の指輪", 0.0, 0.0, 0.0, 104553, 0.0, 0.0, 0.0, 4, 1, 55, 0, 74.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 2.0, 0, "猫神が生み出したとされる宝石。\n所持者は驚異的な視力と\n反射神経を得るため、\n何者も見落とさず、逃さない。", 0.0, 0.0, 0.0, 0, 18000, 8.0, 0.0, 60, 104554, 0.0, 0.0, 0.0, 120, "猫神のペンダント", 0.0, 0.0, 10.0, 104554, 0.0, 0.0, 0.0, 4, 1, 55, 0, 54.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (130.0, 0, 0.0, 0, "長きに渡り君臨した皇帝が\n作らせたという伝説の魔道具。\n装備者に降りかかる厄災を\n肩代わりするという。", 5.0, 6.0, 0.0, 0, 7200, 0.0, 0.0, 52, 104581, 0.0, 10.0, 0.0, 80, "身代わりのバングル", 0.0, 0.0, 0.0, 104581, 5.0, 0.0, 0.0, 4, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "月の魔力を閉じ込めたクリスタルを\nあしらったブレスレット。\n放ち続ける霊妙な光は加護となり、\nいかなる呪詛をも振り払う。", 0.0, 5.0, 0.0, 0, 15000, 0.0, 0.0, 57, 104582, 0.0, 0.0, 0.0, 120, "月のブレスレット", 0.0, 0.0, 0.0, 104582, 9.0, 0.0, 0.0, 4, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "聖霊に認められた者だけが所持を\n許される首飾り。\n聖霊の限りない慈愛により\n所持者は脅威から護られる。", 0.0, 6.0, 0.0, 0, 18000, 0.0, 0.0, 60, 104583, 0.0, 0.0, 10.0, 120, "聖信徒のペンダント", 0.0, 0.0, 0.0, 104583, 6.0, 0.0, 0.0, 4, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (50.0, 0, 0.0, 0, "謀略により愛する者を弓で害した\n月の女神のアミュレット。\n悲哀に満ちた下弦の月の魔力が\n飛矢を退ける。", 5.0, 0.0, 0.0, 0, 7200, 0.0, 15.0, 52, 104611, 0.0, 46.0, 0.0, 80, "三日月の嘆き", 6.0, 0.0, 0.0, 104611, 0.0, 0.0, 0.0, 4, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (120.0, 0, 0.0, 0, "竜の流した涙が悠久の時を超え\n結晶となった、希少極まる鉱石。\n装備者の魂を直接震わせ、\n竜の力を宿すと伝えられている。", 0.0, 0.0, 120.0, 0, 15000, 0.0, 0.0, 57, 104612, 0.0, 70.0, 0.0, 120, "竜の涙", 8.0, 0.0, 0.0, 104612, 0.0, 0.0, 0.0, 4, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "数多の戦を勝利に導いた大賢者が、\n持てる全ての魔力を注ぎ込んだ\n水晶玉。所持する者に、栄光へ導く\n才智を授けてくれるという。", 0.0, 0.0, 0.0, 0, 18000, 0.0, 16.0, 60, 104613, 0.0, 80.0, 0.0, 120, "大賢者の宝珠", 10.0, 0.0, 0.0, 104613, 0.0, 0.0, 0.0, 4, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (120.0, 0, 0.0, 0, "雷神が地上に落とした怒りの雷から\n生まれた大剣。その一振りは空を裂\nく稲妻を生み、あらゆる敵を薙ぎ払\nうことができるという。", 0.0, 0.0, 0.0, 0, 24000, 10.0, 0.0, 64, 105011, 0.0, 0.0, 0.0, 120, "ライトニングブレード", 0.0, 0.0, 3.0, 105011, 0.0, 0.0, 0.0, 5, 1, 1, 0, 105.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (120.0, 0, 0.0, 0, "聖域への鍵の役割を\n果たすとされる、神聖なる大剣。\n剣が纏う神気により、かざすだけで\n邪悪な存在はかき消されるという。", 0.0, 0.0, 0.0, 0, 27000, 0.0, 0.0, 72, 105012, 0.0, 0.0, 0.0, 380, "天開の聖剣", 0.0, 0.0, 3.0, 105012, 0.0, 0.0, 0.0, 5, 1, 1, 0, 115.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (140.0, 0, 0.0, 0, "人を斬らずに罪を斬り祓うとされる\n大剣。この剣で斬られた罪人は傷一\nつ負わないかわりに、その生涯を贖\n罪に捧げるようになるという。", 0.0, 0.0, 0.0, 0, 30000, 0.0, 8.0, 80, 105013, 0.0, 0.0, 0.0, 475, "罪過の大剣", 0.0, 0.0, 0.0, 105013, 0.0, 0.0, 0.0, 5, 1, 1, 0, 120.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (160.0, 0, 0.0, 0, "海神の住まう深海の神殿に祀られて\nいた水の神剣。水そのものの刃は千\n変万化、洪水や大渦、霧など多彩な\n形態で敵を圧倒する。", 0.0, 0.0, 0.0, 0, 32000, 4.0, 0.0, 88, 105014, 0.0, 0.0, 0.0, 590, "神湊剣アクアルーラー", 0.0, 0.0, 0.0, 105014, 0.0, 0.0, 0.0, 5, 1, 1, 0, 132.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "伝説の存在たる光龍の力を宿した大\n剣。あまりの斬れ味に手にしたもの\nさえ無事ではいられないため黄金の\n文様を刻みその力を制御している。", 0.0, 0.0, 0.0, 0, 32000, 10.0, 0.0, 94, 105015, 0.0, 0.0, 0.0, 565, "覇王光龍剣", 0.0, 0.0, 0.0, 105015, 0.0, 0.0, 0.0, 5, 1, 1, 0, 145.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (80.0, 0, 0.0, 0, "大地を統べる母なる神が、正しき心\nの戦王に与えし鉱石の剣。地に突き\n立てれば硬く鋭い鉱柱が地の果てま\nで屹立し、敵の軍勢を討ち払う。", 0.0, 0.0, 0.0, 0, 32000, 14.0, 0.0, 100, 105016, 0.0, 0.0, 0.0, 465, "星核剣エルツシュナイド", 0.0, 0.0, 0.0, 105016, 0.0, 0.0, 0.0, 5, 1, 1, 0, 153.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "大地の遣いである神兎の力が宿りし\n霊剣。その愛らしい刀身から放たれ\nる、兎の群れの如き多重の斬撃は、\n敵を瞬時に葬り去るという。", 0.0, 0.0, 0.0, 0, 32000, 16.0, 0.0, 106, 105017, 0.0, 0.0, 0.0, 432, "神兎乃大剣", 0.0, 0.0, 0.0, 105017, 0.0, 0.0, 0.0, 5, 1, 1, 0, 167.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "白く輝き、咲き誇る桜の美麗さを備\nえた刀。柄に付けられた鈴が鳴る間\nに、花を散らすような軽やかさで、\n次々と敵を切り刻むことができる。", 0.0, 0.0, 0.0, 0, 24000, 12.0, 0.0, 64, 105041, 0.0, 0.0, 0.0, 120, "百華白桜刀", 0.0, 0.0, 3.0, 105041, 0.0, 0.0, 0.0, 5, 1, 4, 0, 118.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天変地異で水没した帝国の魔法剣。\n刃には国の歴史が刻まれている。\n水精霊の寵愛を受けた刀身は、\n流水の如き変幻自在の斬撃を生む。", 0.0, 0.0, 0.0, 0, 27000, 12.0, 0.0, 72, 105042, 0.0, 0.0, 6.0, 280, "流禍の蒼刃", 0.0, 0.0, 0.0, 105042, 0.0, 0.0, 0.0, 5, 1, 4, 0, 120.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "常に血を欲している呪われた刀。\n振るわれるに値しないと刀が判断し\nた使い手は呪い殺され、刀が纏う妖\n気の一部にされるという。", 0.0, 0.0, 0.0, 0, 30000, 14.0, 0.0, 80, 105043, 0.0, 0.0, 0.0, 592, "妖刀血鴉", 0.0, 0.0, 0.0, 105043, 0.0, 0.0, 2.0, 5, 1, 4, 0, 125.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (80.0, 0, 0.0, 0, "火神の炎を鍛え刃に変えた紅蓮の刀\n剣。超高熱の刀身はあらゆるものを\n焼き斬り、炎を解放すれば敵の大軍\nでさえ一瞬にして灰燼と化す。", 0.0, 0.0, 0.0, 0, 32000, 16.0, 0.0, 88, 105044, 0.0, 0.0, 0.0, 560, "焔神刀イグニース", 0.0, 0.0, 0.0, 105044, 0.0, 0.0, 0.0, 5, 1, 4, 0, 134.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "風神が縦横無尽にふるっていたとさ\nれる太刀。刀身に纏う無数の疾風が\n近づいた敵を触れることなく鋭利に\n切り刻む。", 0.0, 0.0, 0.0, 0, 32000, 10.0, 0.0, 94, 105045, 0.0, 0.0, 0.0, 741, "翠風神ノ太刀", 0.0, 0.0, 0.0, 105045, 4.0, 0.0, 0.0, 5, 1, 4, 0, 120.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "かつて神降ろしの儀式に使われてい\nた祭礼の剣。刃には今も神の光が宿\nり、一振りであらゆる邪を断ち祓う。", 0.0, 0.0, 0.0, 0, 32000, 25.0, 0.0, 100, 105046, 0.0, 0.0, 0.0, 544, "神降りの枝刃刀", 0.0, 0.0, 2.0, 105046, 0.0, 0.0, 0.0, 5, 1, 4, 0, 150.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "荒れ狂う水神を鎮めた巫女が振るい\nし霊刀。天を泳ぐ神魚の如き美しい\n刃と、神楽を舞っているかのような\n剣閃は、神をも魅了するという。", 0.0, 0.0, 0.0, 0, 32000, 20.0, 0.0, 106, 105047, 0.0, 0.0, 0.0, 560, "旺鯉乃神刀", 0.0, 0.0, 0.0, 105047, 0.0, 0.0, 0.0, 5, 1, 4, 0, 172.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (120.0, 0, 0.0, 0, "豊饒神の加護を受けたとされる\nダガー。その鮮やかな刃は大自然の\nエネルギーを吸収し、鮮烈な斬撃を\n放つことができるという。", 0.0, 0.0, 150.0, 0, 24000, 20.0, 0.0, 64, 105071, 0.0, 0.0, 0.0, 120, "エメラルドダガー", 0.0, 0.0, 0.0, 105071, 0.0, 0.0, 0.0, 5, 1, 7, 0, 100.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (40.0, 0, 0.0, 0, "火の精霊を宿した短剣。\n溶岩にも匹敵する灼熱の刀身より\n繰り出される一撃は、触れた敵を\n一瞬のうちに溶かしてしまう。", 2.0, 0.0, 0.0, 0, 27000, 20.0, 0.0, 72, 105072, 0.0, 0.0, 0.0, 405, "ラヴァエッジ", 0.0, 0.0, 0.0, 105072, 0.0, 0.0, 0.0, 5, 1, 7, 0, 115.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "妖精の王族に代々伝わる懐剣。\n刃には妖精族秘伝の魔術が刻まれて\nおり持ち主から邪なるものを遠ざけ\nる力を持つ。", 0.0, 0.0, 120.0, 0, 30000, 16.0, 0.0, 80, 105073, 0.0, 0.0, 0.0, 420, "ティルナノーグダガー", 0.0, 0.0, 0.0, 105073, 0.0, 0.0, 0.0, 5, 1, 7, 0, 120.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (110.0, 0, 0.0, 0, "雷を支配する神が常に帯刀していた\n短剣。双極の刃が無尽の稲妻を生み\n出し、天を覆いつくすほどの雷霆を\n撃ち放つ。", 0.0, 0.0, 0.0, 0, 32000, 20.0, 6.0, 88, 105074, 0.0, 0.0, 0.0, 560, "天雷の双神剣", 0.0, 0.0, 0.0, 105074, 0.0, 0.0, 0.0, 5, 1, 7, 0, 124.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "かつて堕天使が身に付けていたとさ\nれる短剣。使い手を取り巻く因果を\n思うが儘に歪め、天地を我が物とす\nるかの如く暴威をふるう。", 0.0, 0.0, 0.0, 0, 32000, 20.0, 0.0, 94, 105075, 0.0, 0.0, 0.0, 520, "天黒剣オブシウス", 0.0, 0.0, 0.0, 105075, 0.0, 0.0, 0.0, 5, 1, 7, 0, 146.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "神々さえ恐れ慄いた獄炎竜の爪で作\nられた短刀。三爪から生み出される\n無慈悲な爆炎は、天の頂すら灰に帰\nす。", 0.0, 0.0, 0.0, 0, 32000, 14.0, 0.0, 100, 105076, 0.0, 0.0, 0.0, 440, "ゲヘナドラグーン", 0.0, 0.0, 0.0, 105076, 0.0, 0.0, 0.0, 5, 1, 7, 0, 161.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "死を司る黒翼の霊鳥の魔力を宿した\n漆黒の魔剣。神をも葬る黒刃から、\n疾風の如き無慈悲な剣閃が疾走ると\nき、あらゆる生が冥府へと還る。", 0.0, 0.0, 0.0, 0, 32000, 30.0, 0.0, 106, 105077, 0.0, 0.0, 0.0, 560, "冥刃・鴉天狗", 0.0, 0.0, 4.0, 105077, 0.0, 0.0, 0.0, 5, 1, 7, 0, 153.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "神々しいオーラを放つ、\n月をかたどった格闘武器。月光の輝\nきを拳に纏い、強烈な一撃を敵に叩\nき込むことができるという。", 0.0, 0.0, 0.0, 0, 24000, 6.0, 0.0, 64, 105101, 0.0, 0.0, 0.0, 280, "ムーンセスタス", 0.0, 0.0, 3.0, 105101, 0.0, 0.0, 0.0, 5, 1, 10, 0, 120.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔を宿した真紅の鉤爪。\n苛烈極まる一撃はあらゆる生者に\n絶望を与え、対面した敵に\n絶対なる死を与えるという。", 0.0, 0.0, 0.0, 0, 27000, 16.0, 0.0, 72, 105102, 0.0, 0.0, 0.0, 280, "クリムゾンクロー", 0.0, 0.0, 0.0, 105102, 0.0, 0.0, 0.0, 5, 1, 10, 0, 130.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "冥府の氷を精錬して作られた氷爪。\nこの爪甲で切り裂かれた者は瞬く間\nに凍てつき、物言わぬ氷像として冥\n府の住人に仲間入りする。", 0.0, 0.0, 0.0, 0, 30000, 14.0, 0.0, 80, 105103, 0.0, 0.0, 0.0, 470, "コキュートスネイル", 0.0, 0.0, 0.0, 105103, 3.0, 0.0, 0.0, 5, 1, 10, 0, 120.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "嵐を司る神の力を宿した籠手。暴風\nを纏う籠手が繰り出す打撃は荒ぶる\n竜巻の如し。戦いが終わる頃、辺り\nはただ無人の荒野が広がるのみ。", 0.0, 0.0, 0.0, 0, 32000, 16.0, 0.0, 88, 105104, 0.0, 0.0, 0.0, 605, "嵐神テンペストギア", 0.0, 0.0, 0.0, 105104, 4.0, 0.0, 0.0, 5, 1, 10, 0, 124.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "大狼の狂爪の欠片から造られたとい\nう籠手。圧倒的な力を与える代償に\n未熟な者が扱えば心身共に蝕まれ、\n呪いつくされると畏怖されている。", 0.0, 6.0, 0.0, 0, 32000, 30.0, 0.0, 94, 105105, 0.0, 0.0, 0.0, 600, "極闇爪ブラッディハウル", 0.0, 0.0, 0.0, 105105, 0.0, 0.0, 0.0, 5, 1, 10, 0, 111.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "大地を統べる母なる神が、圧政に抗\nう不屈の闘士に与えた巌の拳。地の\n底でたぎるマグマのエネルギーを宿\nした拳は、一撃で万物を破壊する。", 0.0, 0.0, 0.0, 0, 32000, 30.0, 0.0, 100, 105106, 0.0, 0.0, 0.0, 605, "星核拳エルツロア", 0.0, 0.0, 0.0, 105106, 0.0, 0.0, 0.0, 5, 1, 10, 0, 154.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "原野の霊獣が姿を変えたと謳われる\n拳武具。武勇に優れた者が扱えば、\n心身ともに錬鉄を超える頑強さを誇\nり、武の境地の入口へ至るという。", 0.0, 3.0, 0.0, 0, 32000, 28.0, 0.0, 106, 105107, 0.0, 0.0, 0.0, 425, "通天手甲・犀打ち", 0.0, 0.0, 0.0, 105107, 4.0, 0.0, 0.0, 5, 1, 10, 0, 133.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "白銀の翼を持つ鳥を模した弓。放た\nれた矢は滑空する鳥のように飛び、\nその透き通るような一撃であらゆる\n魔を貫く。", 2.0, 4.0, 0.0, 0, 24000, 4.0, 0.0, 64, 105131, 0.0, 0.0, 0.0, 245, "白銀の大翼弓", 0.0, 0.0, 0.0, 105131, 0.0, 0.0, 0.0, 5, 1, 13, 0, 100.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔族の女王の加護を受けた妖弓。\n射掛けた矢は禍々しい魔力を帯び、\n闇に紛れるかのごとく\nどこからともなく敵を襲う。", 0.0, 3.0, 0.0, 0, 27000, 7.0, 0.0, 72, 105132, 0.0, 0.0, 0.0, 280, "アビスボウ", 0.0, 0.0, 0.0, 105132, 0.0, 0.0, 2.0, 5, 1, 13, 0, 110.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説の弓使いが、弓折れ矢尽きた際\n天から遣わされたという聖なる弓。\nどんな速射にも耐え、使い手の狙っ\nたところに矢を届ける。", 0.0, 0.0, 0.0, 0, 30000, 15.0, 0.0, 80, 105133, 0.0, 0.0, 0.0, 420, "紅天弓", 0.0, 0.0, 3.0, 105133, 0.0, 0.0, 0.0, 5, 1, 13, 0, 126.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "神話の大英雄が使った巨大な弓。常\n人では持つことすらかなわず、放た\nれた一矢は天を穿ち空を支配する龍\nすら撃ち墜とすという。", 0.0, 2.0, 0.0, 0, 32000, 0.0, 0.0, 88, 105134, 0.0, 0.0, 0.0, 560, "装號弓デウスフォール", 0.0, 0.0, 0.0, 105134, 2.0, 0.0, 0.0, 5, 1, 13, 0, 132.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "冬の女神が流した涙の結晶で作られ\nた弓。放たれた矢は女神の加護を纏\nい、あらゆる難敵を永久に氷漬けに\nする。", 0.0, 1.0, 0.0, 0, 32000, 0.0, 0.0, 94, 105135, 0.0, 0.0, 0.0, 470, "氷涙弓フリージングティア", 0.0, 0.0, 0.0, 105135, 3.0, 0.0, 0.0, 5, 1, 13, 0, 137.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "大地を統べる母なる神が、邪竜退治\nに挑む英雄に与えた頑強な大弓。大\n地のエネルギーが巡る弓から放たれ\nる一矢は天に輝く星をも穿つ。", 0.0, 2.0, 0.0, 0, 32000, 0.0, 0.0, 100, 105136, 0.0, 0.0, 0.0, 600, "星核弓エルツボーゲン", 0.0, 0.0, 0.0, 105136, 4.0, 0.0, 0.0, 5, 1, 13, 0, 139.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天翔ける精霊を宿せし狩弓。荒ぶる\n風を纏い放たれる一矢に貫けぬ物は\nなく、精霊に認められし使い手とも\nなれば、嵐すら巻き起こすという。", 0.0, 2.0, 0.0, 0, 32000, 22.0, 0.0, 106, 105137, 0.0, 0.0, 0.0, 630, "天穿乃隼弓", 0.0, 0.0, 0.0, 105137, 0.0, 0.0, 0.0, 5, 1, 13, 0, 160.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説の氷獄に封印されていたとされ\nる氷の槍。その一突きの餌食になっ\nた者は、悲鳴すらも凍りついてしま\nうという。", 0.0, 2.0, 0.0, 0, 24000, 10.0, 0.0, 64, 105161, 0.0, 0.0, 0.0, 120, "ゼロフロストランス", 0.0, 0.0, 0.0, 105161, 4.0, 0.0, 0.0, 5, 1, 16, 0, 98.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 2.0, 0, "風の神からの恩恵を授かった\n由緒正しき大槍。\nその一撃は目にも止まらぬ\n突風となり、全てを吹き飛ばす。", 0.0, 3.0, 0.0, 0, 27000, 0.0, 0.0, 72, 105162, 0.0, 0.0, 0.0, 305, "ゲイルスティンガー", 0.0, 0.0, 0.0, 105162, 4.0, 0.0, 0.0, 5, 1, 16, 0, 92.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "聖域を守護する者が振るった神聖な\n槍。切っ先が向く先に敵はなく、た\nだ足元に邪悪なるものの骸が転がり\n続けたという。", 0.0, 4.0, 0.0, 0, 30000, 0.0, 0.0, 80, 105163, 0.0, 0.0, 0.0, 420, "護天の聖槍", 0.0, 0.0, 0.0, 105163, 4.0, 0.0, 0.0, 5, 1, 16, 0, 102.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "幽冥を支配する神が振るう魔槍。紅\n蓮の切っ先からは奈落に幽閉されし\n咎神の憎悪と闇の魔力が迸り、見境\nなしの殺戮を繰り返す。", 0.0, 3.0, 0.0, 0, 32000, 0.0, 0.0, 88, 105164, 0.0, 0.0, 0.0, 692, "冥神槍ドゥームペイン", 0.0, 0.0, 0.0, 105164, 3.0, 0.0, 2.0, 5, 1, 16, 0, 113.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天にまで名を轟かせる鍛冶師が炎帝\nの名を受け生み出した伝説の槍。そ\nの穂先は灼熱の業火を纏い、神の怒\nりの如く森羅万象を焼き貫く。", 0.0, 3.0, 0.0, 0, 32000, 0.0, 0.0, 94, 105165, 0.0, 0.0, 0.0, 440, "豪炎槍プロミネンス", 0.0, 0.0, 0.0, 105165, 0.0, 0.0, 0.0, 5, 1, 16, 0, 141.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (150.0, 0, 0.0, 0, "大地を統べる母なる神が、禍を司る\n悪しき女神に立ち向かう勇者に与え\nた重槍。迸る大地のパワーを纏いし\n一閃は、この世の一切を塵に返す。", 0.0, 0.0, 0.0, 0, 32000, 0.0, 0.0, 100, 105166, 0.0, 0.0, 0.0, 560, "星核槍エルツボルグ", 0.0, 0.0, 0.0, 105166, 5.0, 0.0, 0.0, 5, 1, 16, 0, 127.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (250.0, 0, 0.0, 0, "神域を護る聖獣を象った霊槍。自然\nに存在する命脈を司るとされ、その\n一撃は、荒れ果てた死の土地へ新た\nな命を芽吹かせるという。", 0.0, 0.0, 0.0, 0, 32000, 0.0, 0.0, 106, 105167, 0.0, 0.0, 0.0, 418, "聖鹿槍アルマベナード", 0.0, 0.0, 0.0, 105167, 3.0, 0.0, 0.0, 5, 1, 16, 0, 139.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "冥界の力が封じ込められた斧。死を\n司る使者がその役目を執行する時に\n使い、鈍い音を立てながら生者を冥\n界に送るという。", 0.0, 0.0, 0.0, 0, 24000, 0.0, 0.0, 64, 105191, 0.0, 0.0, 0.0, 400, "ネクロディムアックス", 0.0, 0.0, 1.0, 105191, 0.0, 0.0, 2.0, 5, 1, 19, 0, 120.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天界が裁きを下す際に\n用いるとされる、聖なる斧。\n相手が抱える業が大きいほど\n威力は増大し、神の威光を示す。", 3.0, 0.0, 0.0, 0, 27000, 10.0, 0.0, 72, 105192, 0.0, 0.0, 0.0, 280, "神判の聖斧", 0.0, 0.0, 0.0, 105192, 0.0, 0.0, 0.0, 5, 1, 19, 0, 120.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "古の女戦士が振るった戦斧。\nこの斧に屠られた者は、神々の住ま\nう肥沃な理想郷へと迎え入れられる\nといわれている。", 0.0, 0.0, 0.0, 0, 30000, 12.0, 0.0, 80, 105193, 0.0, 0.0, 0.0, 430, "ガイアアクス", 0.0, 0.0, 0.0, 105193, 0.0, 0.0, 0.0, 5, 1, 19, 0, 130.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "巨神族が愛用した無骨な戦斧。神界\nの巨岩から削り出した刀身は恐るべ\nき硬度と重量を誇り、たった一撃で\n大地の形を変えてしまう。", 0.0, 0.0, 100.0, 0, 32000, 12.0, 0.0, 88, 105194, 0.0, 0.0, 0.0, 585, "神轟斧テラブレイク", 0.0, 0.0, 0.0, 105194, 0.0, 0.0, 0.0, 5, 1, 19, 0, 140.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "かつて栄華を誇った文明の遺失技術\nである蒸気による変形機構を備えた\n斧。出力を最大まで振り切ると星の\n核をも砕くと言われている。", 0.0, 1.0, 0.0, 0, 32000, 0.0, 0.0, 94, 105195, 0.0, 0.0, 0.0, 642, "機操斧コアブレイカー", 0.0, 0.0, 0.0, 105195, 0.0, 0.0, 0.0, 5, 1, 19, 0, 151.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "神代に存在した蒼海の深水を鍛えた\n戦斧。膨大な量の水を凝縮した超重\nの刃は、大波の如き破壊の奔流を生\nみ出し、眼前の敵全てを呑み潰す。", 0.0, 0.0, 0.0, 0, 32000, 0.0, 0.0, 100, 105196, 0.0, 0.0, 0.0, 580, "ターコイズ・ノア", 0.0, 0.0, 0.0, 105196, 0.0, 0.0, 0.0, 5, 1, 19, 0, 170.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "山の神と呼ばれた火熊の魂を宿す戦\n斧。魂を共鳴させ放つ灼熱の一振り\nは、味方に豊穣と繁栄を、仇なす者\nには破滅と衰退をもたらすという。", 0.0, 0.0, 0.0, 0, 32000, 20.0, 0.0, 106, 105197, 0.0, 0.0, 0.0, 585, "炎羆帝の爪戦斧", 0.0, 0.0, 0.0, 105197, 0.0, 0.0, 0.0, 5, 1, 19, 0, 150.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "異界の魔力を封じ込めたとされる\n杖。爆発的な威力を宿しているが、\n相応の実力者でなければ、その力を\n解放することはできないという。", 0.0, 0.0, 0.0, 0, 24000, 0.0, 0.0, 64, 105221, 3.0, 100.0, 0.0, 120, "ゼノスフィアロッド", 10.0, 0.0, 0.0, 105221, 0.0, 0.0, 0.0, 5, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "世紀の大魔導士が愛用した杖。\n天地創造の理を宿しているとされ、\n一振りで魔物を\n塵をも残さず消し飛ばすという。", 0.0, 0.0, 0.0, 0, 27000, 0.0, 20.0, 72, 105222, 0.0, 110.0, 0.0, 280, "ジェネシスロッド", 12.0, 0.0, 0.0, 105222, 0.0, 0.0, 0.0, 5, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天に轟く稲妻の力が込められた聖な\nる杖。人の手には余る苛烈な力のこ\nもった杖ではあるが、ひとたび使い\nこなせれば如何なる敵も焼き払う。", 2.0, 0.0, 0.0, 0, 30000, 0.0, 0.0, 80, 105223, 0.0, 118.0, 0.0, 525, "ケラウノスワンド", 14.0, 0.0, 0.0, 105223, 0.0, 0.0, 0.0, 5, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "神々の大戦を生き延びた龍の魂を封\nじた杖。ランタンの放つ黒き魔光が\n敵を葬り、魂を喰らう。喰らった魂\nの数だけ灯りは強く妖しく光る。", 0.0, 0.0, 0.0, 0, 32000, 0.0, 10.0, 88, 105224, 0.0, 128.0, 0.0, 770, "黒蛇龍の杖", 16.0, 0.0, 0.0, 105224, 0.0, 0.0, 0.0, 5, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "死の神が月の女神から奪い、深淵に\n貶めた魔法杖。使う者の命運を喰ら\nい、月相の如く生と死を流転させる\nと言い伝えられる。", 0.0, 0.0, 0.0, 0, 32000, 0.0, 0.0, 94, 105225, 0.0, 146.0, 0.0, 600, "月淵杖サクリファイス", 10.0, 0.0, 0.0, 105225, 0.0, 0.0, 0.0, 5, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "この世で一番美しいとされる霊蝶の\n翅を用いた杖。翠の翅が生み出す風\nと輝く鱗粉が敵の感覚を狂わせ、荒\nぶる魔物も無血で制圧する。", 0.0, 0.0, 0.0, 0, 32000, 0.0, 20.0, 100, 105226, 0.0, 154.0, 0.0, 440, "清雅なる翠蝶杖", 0.0, 0.0, 0.0, 105226, 0.0, 0.0, 0.0, 5, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "神話に記された蛇たちの覇王の魂を\n刻んだ魔杖。放たれる業炎は敵に巻\nきついて離さずその身を焼き続け、\n魂すら燃やし尽くすという。", 0.0, 0.0, 0.0, 0, 32000, 0.0, 0.0, 106, 105227, 0.0, 172.0, 0.0, 477, "黒蛇の魔炎杖", 12.0, 0.0, 0.0, 105227, 0.0, 0.0, 0.0, 5, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "愛に生きた炎の女神による加護を受\nけた杖。燃えるような愛の光は、傷\nついた仲間の傷だけではなく、心ま\nでも癒すことができるという。", 0.0, 4.0, 120.0, 0, 24000, 0.0, 0.0, 64, 105251, 0.0, 95.0, 6.0, 120, "フレイアムルロッド", 0.0, 0.0, 0.0, 105251, 0.0, 0.0, 0.0, 5, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "慈愛の精神によって結晶化した\n霊花があしらわれた聖杖。\nもたらされる無尽蔵の治癒力は、\nもはや女神そのもの。", 0.0, 3.0, 0.0, 0, 27000, 0.0, 10.0, 72, 105252, 2.0, 92.0, 0.0, 300, "神花の聖杖", 0.0, 0.0, 0.0, 105252, 2.0, 0.0, 0.0, 5, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "母なる海の生命を蓄えた聖なる杖。\nこの杖を振るえば、いかなる怪我や\n病気もたちどころに快癒するといわ\nれている。", 0.0, 4.0, 120.0, 0, 30000, 0.0, 0.0, 80, 105253, 0.0, 100.0, 0.0, 460, "アトランティスロッド", 0.0, 0.0, 0.0, 105253, 3.0, 0.0, 0.0, 5, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "稀代の占星術師が知識と技術を結集\nさせた神秘の杖。天球が星の動きを\n読み解いて仲間を導き、星の輝きを\n集め治癒の光に変換し解き放つ。", 0.0, 4.0, 0.0, 0, 32000, 0.0, 0.0, 88, 105254, 0.0, 110.0, 0.0, 580, "天杖ステラスフィア", 0.0, 0.0, 0.0, 105254, 3.0, 0.0, 0.0, 5, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "様々な世界を内包すると言われる世\n界樹の枝を模した杖。宝玉から発す\nる生命の息吹により、万物に癒しを\n与える。", 0.0, 2.0, 0.0, 0, 32000, 0.0, 0.0, 94, 105255, 0.0, 127.0, 5.0, 1000, "世界樹の枝杖", 0.0, 0.0, 0.0, 105255, 2.0, 0.0, 0.0, 5, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "永遠を生きる不死鳥の炎を宿す深紅\nの杖。杖から溢れ出す炎は重篤なケ\nガもたちどころに癒し、時に死者す\nら蘇らせるという。", 0.0, 2.0, 0.0, 0, 32000, 0.0, 0.0, 100, 105256, 0.0, 152.0, 1.0, 425, "炎鳥杖レイズフレア", 0.0, 0.0, 0.0, 105256, 1.0, 0.0, 0.0, 5, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "神話に記された癒しの蛇妃の加護を\n受けた聖杖。杖より絶えず生成され\nる聖水は、あらゆる傷病のみならず\n死の運命すら流し清めるという。", 0.0, 5.0, 0.0, 0, 32000, 0.0, 0.0, 106, 105257, 0.0, 136.0, 0.0, 432, "白蛇の水聖杖", 0.0, 0.0, 0.0, 105257, 4.0, 0.0, 0.0, 5, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "見るものを惑わす魔性の鎧。\n立ち上る紫煙の揺らめきを一度目に\nすると、逃れようのない深い幻惑に\n誘われてしまうという。", 3.0, 4.0, 0.0, 0, 24000, 0.0, 0.0, 70, 105281, 0.0, 0.0, 0.0, 349, "ファンタズムメイル", 0.0, 0.0, 0.0, 105281, 6.0, 0.0, 0.0, 5, 1, 28, 0, 32.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (80.0, 0, 0.0, 0, "失われた太古の技術で作られた鎧。\n身に着けた者は不可視の翼を授かり\n戦場を縦横無尽に駆け抜ける。", 0.0, 6.0, 0.0, 0, 27000, 0.0, 0.0, 77, 105282, 0.0, 0.0, 0.0, 392, "九天の鎧", 0.0, 0.0, 0.0, 105282, 6.0, 0.0, 0.0, 5, 1, 28, 0, 42.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (80.0, 0, 0.0, 0, "暗澹たる深山を支配してきた賊の女\n王の鎧。纏えば魔獣の如き強靭さと\n獰猛さが滾り、血風舞う戦場で輝く\n野蛮な美しさに人々は畏怖する。", 0.0, 5.0, 0.0, 0, 30000, 0.0, 0.0, 85, 105283, 0.0, 0.0, 0.0, 362, "レイジクイーンドレス", 0.0, 0.0, 0.0, 105283, 7.0, 0.0, 0.0, 5, 1, 28, 0, 44.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説の舞踊兵士の一族が戦地で纏っ\nていた軽鎧。花びらが舞うように身\n軽な上に、その強度はいかなる猛攻\nも許さない。", 0.0, 6.0, 0.0, 0, 32000, 0.0, 12.0, 93, 105284, 0.0, 0.0, 0.0, 560, "閃華の舞鎧", 0.0, 0.0, 0.0, 105284, 6.0, 0.0, 0.0, 5, 1, 28, 0, 48.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "自ら戦場で剣を振るった、伝説の軍\n国の王女が纏いしバラの鎧。纏えば\n気高き魂がその身に宿り、いかなる\n絶望や恐怖にも屈することはない。", 0.0, 2.0, 0.0, 0, 32000, 9.0, 0.0, 99, 105285, 0.0, 0.0, 0.0, 795, "麗装ソウルローゼス", 0.0, 0.0, 0.0, 105285, 8.0, 0.0, 0.0, 5, 1, 28, 0, 70.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "南天を司る守護天使の加護を受けた\n紺碧の鎧。正義を示す神の使徒を率\nいる強者の証であり、守護天使の大\nいなる力を恩恵に授かるという。", 0.0, 4.0, 0.0, 0, 32000, 0.0, 0.0, 105, 105286, 0.0, 0.0, 0.0, 452, "極南天の烈蒼鎧", 0.0, 0.0, 0.0, 105286, 6.0, 0.0, 0.0, 5, 1, 28, 0, 81.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "純潔と威厳を司る天界の白百合に加\n護された白花の鎧。装備者を包む優\n雅な香りは一切の不浄を退け何事に\nも動じぬ凛とした気風を纏わせる。", 0.0, 5.0, 0.0, 0, 32000, 20.0, 0.0, 111, 105287, 0.0, 0.0, 0.0, 511, "聖光のリリープレート", 0.0, 0.0, 0.0, 105287, 3.0, 0.0, 0.0, 5, 1, 28, 0, 92.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (120.0, 0, 0.0, 0, "青く透き通る結晶から作られた鎧。\nこれまで発見されたことのない結晶\nは、加工さえも困難な強度を誇り、\n表面を曇らせることさえできない。", 0.0, 9.0, 0.0, 0, 24000, 0.0, 0.0, 70, 105311, 0.0, 0.0, 0.0, 511, "蒼輝の鎧", 0.0, 0.0, 0.0, 105311, 10.0, 0.0, 0.0, 5, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "危機に瀕した祖国を救うため立ち上\nがった勇猛な乙女が身に着けていた\n鎧。不思議な加護により、あらゆる\n攻撃を弾く。", 0.0, 10.0, 100.0, 0, 27000, 0.0, 0.0, 77, 105312, 0.0, 0.0, 0.0, 401, "聖櫻の鎧", 0.0, 0.0, 0.0, 105312, 11.0, 0.0, 0.0, 5, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (50.0, 0, 0.0, 0, "かつて繁栄を極めた古代王朝の遺跡\nから発掘された金色の鎧。数千年の\n時を経てもその神々しい輝きと、絶\n対的強度は失われることはない。", 0.0, 8.0, 0.0, 0, 30000, 0.0, 0.0, 85, 105313, 1.0, 0.0, 0.0, 587, "煌金の王鎧", 0.0, 0.0, 0.0, 105313, 12.0, 0.0, 0.0, 5, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (70.0, 0, 0.0, 0, "天と地の境界に潜みし風の守護神が常用したとされる重鎧。纏いし者の周囲に鋭い烈風を巻き起こし、触れた者を慄かせる。", 0.0, 10.0, 0.0, 0, 32000, 0.0, 0.0, 93, 105314, 0.0, 0.0, 0.0, 595, "烈風の俊鎧", 0.0, 0.0, 0.0, 105314, 12.0, 0.0, 0.0, 5, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "神界の銀を鍛冶神の御業で鍛えた鏡\nの鎧。磨き抜かれた胸部の鏡はあら\nゆる魔法を捻じ曲げ吸収し、凄まじ\nい光の奔流に変え撃ち放つ。", 0.0, 13.0, 50.0, 0, 32000, 0.0, 0.0, 99, 105315, 0.0, 0.0, 0.0, 652, "熾白銀の鏡鎧", 0.0, 0.0, 0.0, 105315, 9.0, 0.0, 0.0, 5, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (75.0, 0, 0.0, 0, "北天を司る守護天使の加護を受けた\n真紅の鎧。罪を清める審判の炎で鍛\nえられており、守護天使の深き洞察\nと鋭き見識を恩恵に授かるという。", 0.0, 9.0, 0.0, 0, 32000, 0.0, 0.0, 105, 105316, 0.0, 0.0, 0.0, 605, "極北天の覇焔鎧", 0.0, 0.0, 0.0, 105316, 16.0, 0.0, 0.0, 5, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (210.0, 0, 0.0, 0, "枯れた大地を万年耐え抜く覇王樹で\n作られた碧翠の鎧。いかなる渇きも\n撥ね退ける加護を持ち、終わらぬ戦\n火から永久に主人を守り抜く。", 0.0, 9.0, 0.0, 0, 32000, 0.0, 0.0, 111, 105317, 0.0, 0.0, 0.0, 580, "覇王樹の棘針鎧", 0.0, 0.0, 0.0, 105317, 15.0, 0.0, 0.0, 5, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "生涯で一度の敗北もなかった女騎士\nが身に着けていた戦衣。ひとたび\n纏えば、如何なる戦局も覆す不倒の\n戦果を挙げることができるという。", 0.0, 2.0, 0.0, 0, 24000, 0.0, 0.0, 70, 105341, 0.0, 0.0, 0.0, 509, "イージスコート", 0.0, 0.0, 10.0, 105341, 4.0, 0.0, 0.0, 5, 1, 34, 0, 34.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (160.0, 0, 2.0, 0, "穢れを知らぬ乙女だけが身に着ける\nことができる神聖な服。乙女が無垢\nな祈りを捧げることにより発揮され\nる破邪の力は絶大。", 0.0, 10.0, 0.0, 0, 27000, 0.0, 0.0, 77, 105342, 0.0, 0.0, 0.0, 355, "メイデンクロース", 0.0, 0.0, 0.0, 105342, 6.0, 0.0, 0.0, 5, 1, 34, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "炎鬼神の魔力を宿した戦装束。ひと\nたび身に着ければ守護の業炎を全身\nに纏い、降りかかる災いをことごと\nく滅却する。", 0.0, 4.0, 0.0, 0, 30000, 10.0, 0.0, 85, 105343, 0.0, 0.0, 0.0, 405, "鬼焔の闘衣", 0.0, 0.0, 0.0, 105343, 5.0, 0.0, 0.0, 5, 1, 34, 0, 65.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "冥府の王に仕えし密偵の戦闘衣装。\n着衣者の殺傷能力を極限まで引き出\nし、新たな影の歴史を彩ることを強\nいるだろう。", 0.0, 4.0, 0.0, 0, 32000, 12.0, 0.0, 93, 105344, 0.0, 0.0, 0.0, 600, "極黒の冥衣", 0.0, 0.0, 0.0, 105344, 5.0, 0.0, 0.0, 5, 1, 34, 0, 66.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説の舞姫が着ていた衣装。身に着\nけることで体は水と同質に変化し、\n流水の如き変幻自在の動きで敵を翻\n弄する。", 0.0, 2.0, 0.0, 0, 32000, 0.0, 0.0, 99, 105345, 0.0, 0.0, 0.0, 910, "流蒼装アズールロンド", 0.0, 0.0, 5.0, 105345, 6.0, 0.0, 0.0, 5, 1, 34, 0, 68.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "東天を司る守護天使の加護を受けた\n深緑の装束。病を遠ざける治癒の風\nを纏っており、守護天使の健やかな\n慈愛と献身を恩恵に授かるという。", 0.0, 5.0, 150.0, 0, 32000, 0.0, 0.0, 105, 105346, 0.0, 0.0, 0.0, 500, "極東天の碧風装", 0.0, 0.0, 0.0, 105346, 7.0, 0.0, 0.0, 5, 1, 34, 0, 62.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 2.0, 0, "白霞の花妖精が切なる祈りを込めた\n薄染めの聖衣。その幸福の加護と聖\n性は遍く災厄や穢れを寄せ付けず、\n着用者の心身に安寧をもたらす。", 0.0, 5.0, 0.0, 0, 32000, 12.0, 0.0, 111, 105347, 0.0, 0.0, 0.0, 471, "白霞の純花装", 0.0, 0.0, 0.0, 105347, 6.0, 0.0, 0.0, 5, 1, 34, 0, 68.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (120.0, 0, 0.0, 0, "神に全てを捧げた巫女が着ていた\n装束。着ている者は神の寵愛を一身\nに受け、魔に屈することのない護り\nの力を授けられるという。", 3.0, 7.0, 0.0, 0, 24000, 0.0, 0.0, 70, 105371, 0.0, 20.0, 0.0, 365, "純潔の巫女装束", 0.0, 0.0, 0.0, 105371, 5.0, 0.0, 0.0, 5, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "かつて偉大な女帝が身に着けていた\nローブ。紡糸の一本一本に女帝の魔\n力が込められており、身に着けた者\nをあらゆる魔術から守る。", 0.0, 7.0, 0.0, 0, 27000, 0.0, 0.0, 77, 105372, 0.0, 43.0, 0.0, 370, "エンプレスローブ", 8.0, 0.0, 0.0, 105372, 5.0, 0.0, 0.0, 5, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "幾千もの魔術を操り、魔術王と呼ば\nれた者が纏ったローブ。纏うに値す\nる術者には、膨大な王の知識と魔力\nが授けられるという。", 0.0, 7.0, 0.0, 0, 30000, 0.0, 0.0, 85, 105373, 0.0, 48.0, 0.0, 440, "エクゾマギアローブ", 10.0, 0.0, 0.0, 105373, 4.0, 0.0, 0.0, 5, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (80.0, 0, 0.0, 0, "氷上を統べし歴代の仙女が着ていた\nとされる神秘のローブ。ひとたび身\nに纏えば、天衣のオーラであらゆる\n衝撃を無効化する。", 0.0, 7.0, 0.0, 0, 32000, 0.0, 0.0, 93, 105374, 0.0, 43.0, 0.0, 782, "爽氷の天衣", 0.0, 0.0, 0.0, 105374, 6.0, 0.0, 0.0, 5, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "星を詠み全てを見通した預言者が着\nていたローブ。袖を通せば星の軌道\nから万物を詠み解き、あらゆる厄災\nを事前に察知することができる。", 0.0, 8.0, 0.0, 0, 32000, 0.0, 0.0, 99, 105375, 0.0, 46.0, 0.0, 560, "星詠みの聖霊衣", 13.0, 0.0, 0.0, 105375, 5.0, 0.0, 0.0, 5, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "西天を司る守護天使の加護を受けた\n月白の法衣。混迷の世界を導く光に\n満ちており、守護天使の清き祝福と\n啓示を恩恵に授かるという。", 0.0, 9.0, 0.0, 0, 32000, 0.0, 0.0, 105, 105376, 0.0, 52.0, 0.0, 507, "極西天の聖導衣", 15.0, 0.0, 0.0, 105376, 4.0, 0.0, 0.0, 5, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "緋天に咲く牡丹百合の花弁で編んだ\n深紅のドレス。情熱を司る花の加護\nは、着用者に不撓不屈の精神を授け\nいかなる危局をも撥ね退ける。", 0.0, 9.0, 0.0, 0, 32000, 0.0, 0.0, 111, 105377, 0.0, 60.0, 0.0, 430, "緋天のチューリップドレス", 8.0, 0.0, 0.0, 105377, 6.0, 0.0, 0.0, 5, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 2.0, 0, "天体図が刻まれた円盾。\n天に浮かぶ星々の力が宿っており、\nどんな攻撃も受け流すその力は星の\n導きと呼ぶに相応しい。", 0.0, 3.0, 0.0, 0, 24000, 0.0, 0.0, 70, 105401, 0.0, 0.0, 0.0, 446, "星詠みの円盾", 0.0, 0.0, 0.0, 105401, 5.0, 0.0, 0.0, 5, 1, 40, 0, 54.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (80.0, 0, 0.0, 0, "神界の銀と幾千もの魔術を組み合わ\nせた鏡の盾。傷ひとつ付かない曇り\nなき鏡面は、禁呪すら反射する。", 0.0, 14.0, 0.0, 0, 32000, 0.0, 0.0, 99, 105402, 0.0, 0.0, 0.0, 726, "熾白銀の鏡盾", 0.0, 0.0, 0.0, 105402, 9.0, 0.0, 0.0, 5, 1, 40, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (120.0, 0, 0.0, 0, "混沌の世界に清浄をもたらす聖蓮華\nの円盾。破邪の祈念が込められた紋\n様は、時にその大輪の花弁を賭して\nまでも己が主の窮地を護るという。", 0.0, 17.0, 0.0, 0, 32000, 0.0, 0.0, 111, 105403, 0.0, 0.0, 0.0, 560, "聖円環ヘブンリーロータス", 0.0, 0.0, 0.0, 105403, 9.0, 0.0, 0.0, 5, 1, 40, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "覇道を征った戦姫が敵の刃に倒れる\nまで身に着けていたとされる軍靴。\nあと一歩世界に手が届かなかった無\n念が絶大な魔力として宿っている。", 0.0, 6.0, 0.0, 0, 27000, 10.0, 0.0, 77, 105431, 0.0, 0.0, 0.0, 380, "インファナルグリーブ", 0.0, 0.0, 0.0, 105431, 8.0, 0.0, 0.0, 5, 1, 43, 0, 30.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 2.0, 0, "天使の羽根で作られた黄金に輝く羽\n靴。扱いには熟練を要するが、ひと\nたび足に纏えば自在に天翔けること\nができる。", 0.0, 3.0, 0.0, 0, 32000, 0.0, 0.0, 93, 105432, 0.0, 0.0, 0.0, 560, "天翔の金靴", 0.0, 0.0, 0.0, 105432, 4.0, 0.0, 0.0, 5, 1, 43, 0, 70.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "天空の守護天使たちの加護を賜りし\n戦靴。四方の天使に授かった祝福の\n羽根をあしらうことで、万象の呪詛\nと苦難を退ける無比の聖性を宿す。", 0.0, 18.0, 0.0, 0, 32000, 0.0, 0.0, 105, 105433, 0.0, 0.0, 0.0, 620, "極翼天の聖靴", 0.0, 0.0, 0.0, 105433, 6.0, 0.0, 0.0, 5, 1, 43, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "享楽的な人格と妖艶な美貌で、いく\nつもの国を混乱に陥れた魔女が愛用\nした靴。履いて歩くだけで幻影が発\n生し、見る者を惑い狂わせる。", 0.0, 9.0, 0.0, 0, 30000, 0.0, 0.0, 85, 105462, 0.0, 24.0, 4.0, 510, "ブラッドルビーヒール", 0.0, 0.0, 0.0, 105462, 6.0, 0.0, 0.0, 5, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (70.0, 0, 0.0, 0, "神界の銀と錬金術の粋を集め作られ\nた鏡の脚具。歩を刻むごとに実体を\n持った鏡像を生み出し、無尽の軍勢\nを形成して敵を威圧する。", 0.0, 11.0, 0.0, 0, 32000, 0.0, 0.0, 99, 105463, 0.0, 26.0, 0.0, 881, "熾白銀の鏡脚", 0.0, 0.0, 0.0, 105463, 7.0, 0.0, 0.0, 5, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "薔薇王女と謳われた姫君が愛用した\nドレスヒール。ひとたび履けば妖艶\nなる趣で、たとえ愛の天使や神であ\nっても魅了し堕落せしめたという。", 0.0, 14.0, 0.0, 0, 32000, 0.0, 0.0, 111, 105464, 0.0, 28.0, 0.0, 580, "プライドオブローゼス", 0.0, 0.0, 0.0, 105464, 9.0, 0.0, 0.0, 5, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "命を賭して祖国を救った伝説の親衛\n隊長が身に着けていた瀟洒な帽子。\n大きな羽飾りは装備者のみならず目\nにした者の勇気を奮い立たせる。", 0.0, 4.0, 0.0, 0, 30000, 0.0, 0.0, 85, 105491, 0.0, 0.0, 0.0, 305, "ロイヤルガードハット", 0.0, 0.0, 3.0, 105491, 5.0, 0.0, 0.0, 5, 1, 49, 0, 60.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "過去に滅び、忘れ去られた国の王女\nが身に着けていた冠。次の持ち主に\nは、深い哀しみを伝える代わりに、\n膨大な魔力を授ける。", 0.0, 5.0, 0.0, 0, 24000, 0.0, 0.0, 70, 105521, 0.0, 48.0, 0.0, 370, "忘哭の冠", 8.0, 0.0, 0.0, 105521, 3.0, 0.0, 0.0, 5, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "民草から絶大な尊敬を集めていた聖\n女に贈られた冠。心清らかな者が身\nに着ければ、邪な者を遠ざける力を\n発揮する。", 0.0, 10.0, 0.0, 0, 27000, 0.0, 12.0, 77, 105522, 0.0, 22.0, 0.0, 425, "白祈の聖冠", 0.0, 0.0, 0.0, 105522, 6.0, 0.0, 0.0, 5, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "人類にその身を捧げた聖女が愛用し\nた繁栄のベール。この聖遺物を手に\nした者は、僥倖と災厄のすべてを見\n定めることができるとされる。", 2.0, 9.0, 0.0, 0, 32000, 0.0, 0.0, 93, 105523, 0.0, 23.0, 0.0, 830, "プロスペリティベール", 0.0, 0.0, 0.0, 105523, 8.0, 0.0, 0.0, 5, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "大地の守護天使たちの加護を賜りし\n聖帽。真の求道者へのみ授けられ、\n身に着ける者は天上の理である奇蹟\nに触れることが叶うとされる。", 0.0, 10.0, 0.0, 0, 32000, 0.0, 15.0, 105, 105524, 0.0, 36.0, 0.0, 425, "極翼天の賢聖帽", 0.0, 0.0, 0.0, 105524, 7.0, 0.0, 0.0, 5, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (70.0, 0, 0.0, 0, "数千年も昔の地層から発掘された魔\n石の耳飾り。膨大な自然の力を蓄え\nており、身に着けた者に大いなる大\n地の加護を与える。", 0.0, 0.0, 0.0, 0, 24000, 10.0, 0.0, 67, 105551, 0.0, 0.0, 0.0, 210, "ミレニアムイヤリング", 0.0, 0.0, 10.0, 105551, 0.0, 0.0, 0.0, 5, 1, 55, 0, 64.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "竜の怒りを封じ込めたと伝承される\n神秘のペンダント。憤怒の化身とし\nて、身につけた者に山を震わせ大地\nを砕く力を与える。", 0.0, 0.0, 0.0, 0, 27000, 13.0, 25.0, 74, 105552, 0.0, 0.0, 0.0, 280, "赫怒竜のペンダント", 0.0, 0.0, 0.0, 105552, 0.0, 0.0, 0.0, 5, 1, 55, 0, 84.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "闘神の荒ぶる魂を宿した腕輪。大気\n中の魔力を力に変換し、山を砕くほ\nどの膂力を与えるが、使うに値する\n武力が不可欠。", 0.0, 0.0, 0.0, 0, 30000, 24.0, 0.0, 82, 105553, 0.0, 0.0, 0.0, 420, "闘神の荒腕", 0.0, 0.0, 0.0, 105553, 0.0, 0.0, 0.0, 5, 1, 55, 0, 102.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "陰謀渦巻く戦国時代を生き抜いた伝\n説のくノ一が身に着けていた簪。\n簪に掛けられた魔法は、どんな華奢\nな身にも鬼神の如き力を与える。", 0.0, 0.0, 0.0, 0, 32000, 28.0, 0.0, 90, 105554, 0.0, 0.0, 0.0, 480, "花簪焔火牡丹", 0.0, 0.0, 0.0, 105554, 0.0, 0.0, 0.0, 5, 1, 55, 0, 104.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "闇の世界の伝説的暗殺者が愛用した\n指輪型の暗器。火竜の爪を模した棘\nには業火が宿り、一刺しで骨も残さ\nず焼き尽くす。", 0.0, 0.0, 0.0, 0, 32000, 29.0, 0.0, 96, 105555, 0.0, 0.0, 0.0, 480, "緋竜の爪火輪", 0.0, 0.0, 3.0, 105555, 0.0, 0.0, 0.0, 5, 1, 55, 0, 98.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (50.0, 0, 0.0, 0, "闘いの女神が唯一寵愛したとされる\n真紅の薔薇を象った首飾り。装備者\nの闘争心に呼応し紅き輝きと共に女\n神の加護をもたらす。", 0.0, 0.0, 0.0, 0, 32000, 29.0, 0.0, 102, 105556, 0.0, 0.0, 0.0, 480, "ルビーローズチョーカー", 0.0, 0.0, 0.0, 105556, 0.0, 0.0, 0.0, 5, 1, 55, 0, 105.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "戦勝をもたらすラッパのブローチ。\n象られた霊鳥は戦場に赴くと生きて\nいるかのように飛び回り、軽快なリ\nズムを奏で、装備者を勝利に導く。", 0.0, 0.0, 0.0, 0, 32000, 38.0, 0.0, 108, 105557, 0.0, 0.0, 0.0, 480, "紅鳥のクラリオンブローチ", 0.0, 0.0, 0.0, 105557, 0.0, 0.0, 0.0, 5, 1, 55, 0, 110.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "精霊王に祝福された耳飾り。\n森一つ覆いつくすほどの守護の力は\nありとあらゆる災厄を寄せ付けない\nという。", 0.0, 6.0, 100.0, 0, 24000, 0.0, 0.0, 67, 105581, 0.0, 0.0, 0.0, 210, "精霊王の護石", 0.0, 0.0, 0.0, 105581, 10.0, 0.0, 0.0, 5, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "結晶化した人魚姫の落涙を宝玉とし\nてあしらった首飾り。\n永遠へ紡がれる想いは青い輝きを放\nち続け、あらゆる呪詛を拒絶する。", 0.0, 8.0, 0.0, 0, 27000, 0.0, 0.0, 74, 105582, 0.0, 0.0, 2.0, 280, "人魚姫の霊涙", 0.0, 0.0, 0.0, 105582, 12.0, 0.0, 0.0, 5, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "戦乱から国を護りぬき、英盾王と呼\nばれた君主愛用の腕輪。周囲の魔力\nを吸収して守護の力を展開し、絶対\n的防御で同胞の盾となる。", 0.0, 10.0, 0.0, 0, 30000, 0.0, 0.0, 82, 105583, 2.0, 0.0, 0.0, 420, "英盾王の腕輪", 0.0, 0.0, 0.0, 105583, 10.0, 0.0, 0.0, 5, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "母なる大海を司る神のウロコから生\nまれ出た髪留め。身に着けた者は大\n海の加護を受け、如何なる攻撃をも\n受け止める。", 0.0, 12.0, 100.0, 0, 32000, 0.0, 0.0, 90, 105584, 0.0, 0.0, 0.0, 480, "海龍神の髪飾り", 0.0, 0.0, 0.0, 105584, 10.0, 0.0, 0.0, 5, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (50.0, 0, 0.0, 0, "盾の女神の加護を宿した指輪。指を\n通せば万里に渡る魔力の巨盾を展開\nし、降りかかる苦痛、邪悪、厄災を\n断つ。", 0.0, 9.0, 0.0, 0, 32000, 0.0, 0.0, 96, 105585, 0.0, 0.0, 0.0, 480, "神盾輪ウォールブレス", 0.0, 0.0, 0.0, 105585, 14.0, 0.0, 0.0, 5, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 3.0, 0, "天空の花園にのみ生息するという霊\n蝶の翅を魔術的に再現した首飾り。\nその羽ばたきは因果を歪め致命の一\n撃すらも静かに受け止める。", 0.0, 11.0, 0.0, 0, 32000, 0.0, 0.0, 102, 105586, 0.0, 0.0, 0.0, 480, "エルフィンチョーカー", 0.0, 0.0, 0.0, 105586, 9.0, 0.0, 0.0, 5, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "聖樹の力を宿すと言い伝えられる、\nハープを象ったブローチ。緑豊かな\n天界の庭園を思わせる癒しに満ちた\n音色は、いかなる厄災をも退ける。", 0.0, 13.0, 0.0, 0, 32000, 0.0, 0.0, 108, 105587, 0.0, 0.0, 0.0, 480, "翆奏のハープブローチ", 0.0, 0.0, 0.0, 105587, 13.0, 0.0, 0.0, 5, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "海神が持つとされる槍をかたどった\n耳飾り。海のように深い色合いをし\nた碧い宝玉は、荒れ狂う海を鎮める\nほどの魔力を授けるという。", 0.0, 0.0, 0.0, 0, 24000, 0.0, 0.0, 67, 105611, 3.0, 78.0, 0.0, 210, "海神の耳飾り", 8.0, 0.0, 0.0, 105611, 0.0, 0.0, 0.0, 5, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (140.0, 0, 0.0, 0, "穢れなき聖獣、ユニコーンの加護を\n宿した首飾り。\n角に宿りし聖なる力は装備者の魔力\nを高め、霊妙な才覚を授ける。", 0.0, 0.0, 0.0, 0, 27000, 0.0, 0.0, 74, 105612, 0.0, 84.0, 0.0, 280, "聖獣の祈念", 10.0, 0.0, 0.0, 105612, 0.0, 0.0, 0.0, 5, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "叡智を極め、神の領域に到達した賢\n人が遺した装飾品。秀でた知恵者に\nのみ装着を許され、周囲の魔力を奪\nい無限に供給する。", 0.0, 0.0, 120.0, 0, 30000, 0.0, 0.0, 82, 105613, 0.0, 92.0, 0.0, 420, "ソフォスブレスレット", 14.0, 0.0, 0.0, 105613, 0.0, 0.0, 0.0, 5, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (30.0, 0, 0.0, 0, "氷の心を持った姫君が愛を知り、自\n然と零れ出た涙が結晶化したものを\nあしらったリボン。身に着けると氷\n雪を自在に操れるようになる。", 0.0, 0.0, 0.0, 0, 32000, 0.0, 0.0, 90, 105614, 0.0, 98.0, 0.0, 480, "細氷姫の結び紐", 16.0, 0.0, 0.0, 105614, 0.0, 0.0, 0.0, 5, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "太古の地層より出土した、膨大な魔\n力の結晶体を用いた指輪。魔法を何\n百倍にも増幅させるが扱いが困難な\nため、優れた術者しか扱えない。", 0.0, 0.0, 0.0, 0, 32000, 0.0, 0.0, 96, 105615, 0.0, 101.0, 0.0, 480, "深結晶ゼノクリスタル", 20.0, 0.0, 0.0, 105615, 0.0, 0.0, 0.0, 5, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "混沌の神が地上へもたらしたとされ\nる魔装具。宝石内部に描かれた緻密\nな立体魔法陣により異界からの魔力\nを無尽蔵に取り出せる。", 0.0, 0.0, 0.0, 0, 32000, 0.0, 10.0, 102, 105616, 0.0, 103.0, 0.0, 480, "ケイオティックチョーカー", 15.0, 0.0, 0.0, 105616, 0.0, 0.0, 0.0, 5, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "蒼き夜の輝きに満ちたブローチ。優\n美なる夜想の旋律は邪念を祓い、精\n神を純化させることで、身につけた\n者の更なる潜在能力を引き出す。", 0.0, 0.0, 0.0, 0, 32000, 0.0, 0.0, 108, 105617, 0.0, 105.0, 0.0, 480, "蒼夜のノクターンブローチ", 25.0, 0.0, 0.0, 105617, 0.0, 0.0, 0.0, 5, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (155.0, 0, 0.0, 0, "原初の金剛石を削り鍛えられたと伝\n説に伝わる宝石剣。幾星霜の時を経\nても変わらぬ光を放ち続け、永世折\nれずにその輝きで魔を祓う。", 0.0, 0.0, 0.0, 0, 34000, 21.0, 0.0, 112, 106011, 0.0, 0.0, 0.0, 680, "輝光剣アダマス", 0.0, 0.0, 0.0, 106011, 0.0, 0.0, 0.0, 6, 1, 1, 0, 191.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (75.0, 0, 0.0, 0, "お菓子の国に伝わる由緒正しきチョ\nコの宝剣。スイートな見た目に反し\nて鋭い切れ味を誇り、冒険者たちに\nとって垂涎の一品。", 0.0, 0.0, 0.0, 0, 34000, 20.0, 0.0, 118, 106012, 0.0, 0.0, 0.0, 820, "チョコスティックブレード", 0.0, 0.0, 0.0, 106012, 0.0, 0.0, 0.0, 6, 1, 1, 0, 216.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (55.0, 0, 0.0, 0, "陽炎を生むほどの太陽光を宿し剣。\nその内に秘めたる膨大な魔力が装備\n者の膂力を極限まで高め敵対する者\n全てを焼き尽くす。", 0.0, 0.0, 0.0, 0, 36000, 18.0, 0.0, 124, 106013, 0.0, 0.0, 0.0, 870, "炎天赤日の剣", 0.0, 0.0, 0.0, 106013, 0.0, 0.0, 0.0, 6, 1, 1, 0, 235.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "紅玉の結晶を研ぎ作られた魔性を宿\nす妖刀。赤い三日月状の刀身は血に\n飢えており、生命を持つ全ての生物\nを斬り裂く抜群の切れ味を誇る。", 0.0, 0.0, 0.0, 0, 34000, 26.0, 0.0, 112, 106041, 0.0, 0.0, 0.0, 880, "紅玉刀スカーレットムーン", 0.0, 0.0, 0.0, 106041, 0.0, 0.0, 0.0, 6, 1, 4, 0, 206.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ソフトクリームの刀身を持つお菓子\nの国伝来の刀。滑らかで自然な湾曲\nにより、変幻自在の刀捌きを可能と\nしている。", 0.0, 0.0, 0.0, 0, 34000, 37.0, 0.0, 118, 106042, 0.0, 0.0, 0.0, 880, "ソフタイスシュベールト", 0.0, 0.0, 0.0, 106042, 0.0, 0.0, 0.0, 6, 1, 4, 0, 216.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "穏やかながらも雄大に森を渡る風を\n宿した刀。風に舞う花弁の如く涼や\nかに流れる太刀筋で何物にも防がれ\nることなく急所を突く。", 0.0, 0.0, 0.0, 0, 36000, 39.0, 0.0, 124, 106043, 0.0, 0.0, 0.0, 1200, "薫風花散", 0.0, 0.0, 5.0, 106043, 0.0, 0.0, 0.0, 6, 1, 4, 0, 215.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "風を司る妖精王の力を宿した翠玉の\n宝石剣。風の妖精たちを従えられる\n権能を持ち、彼らが巻き起こす疾風\nはあらゆる邪悪を吹き飛ばす。", 0.0, 0.0, 0.0, 0, 34000, 42.0, 0.0, 112, 106071, 0.0, 0.0, 0.0, 720, "翠風刃エメラルドエッジ", 0.0, 0.0, 0.0, 106071, 0.0, 0.0, 0.0, 6, 1, 7, 0, 198.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (250.0, 0, 0.0, 0, "チョコバナナでできたお菓子の国秘\n伝の短刀。固まったチョコの表面の\n堅牢さとバナナの粘る刀身が無限の\n切れ味を生み出す。", 0.0, 0.0, 0.0, 0, 34000, 15.0, 0.0, 118, 106072, 0.0, 0.0, 0.0, 880, "チョコバナナダガー", 0.0, 0.0, 0.0, 106072, 0.0, 0.0, 0.0, 6, 1, 7, 0, 199.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 5.0, 0, "全てを惑わす深い霧を禁忌の呪法\nで留めた短剣。刀身を振ると滲み\n出る煙霧が装備者の姿を隠し、敵\n対者を幻惑させる。", 0.0, 0.0, 0.0, 0, 36000, 12.0, 0.0, 124, 106073, 0.0, 0.0, 0.0, 1160, "紫霧の短剣", 0.0, 0.0, 0.0, 106073, 0.0, 0.0, 0.0, 6, 1, 7, 0, 212.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "神の力を宿すという宝石、希望を司\nるオパールがあしらわれた拳具。希\n望の光を放つ拳は、あらゆる魔を葬\nり、人々を絶望から救うという。", 0.0, 4.0, 0.0, 0, 34000, 30.0, 0.0, 112, 106101, 0.0, 0.0, 0.0, 680, "オパルスパージフィスト", 0.0, 0.0, 0.0, 106101, 2.0, 0.0, 0.0, 6, 1, 10, 0, 174.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "お菓子の国の伝説の拳豪が愛用した\nシュークリームの拳甲。装備者への\n衝撃を柔らかく包みつつその反動全\nてを相手へと叩きこむ。", 0.0, 0.0, 0.0, 0, 34000, 0.0, 0.0, 118, 106102, 0.0, 0.0, 0.0, 680, "シューナックル", 0.0, 0.0, 0.0, 106102, 2.0, 0.0, 0.0, 6, 1, 10, 0, 225.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "壁の如く天を覆う砂塵を凝縮させた\n手甲。装備者に巨岩の堅固さと空を\n舞う身軽さを与え、万の軍勢と対峙\nしてもその身が果てる事はない。", 0.0, 0.0, 0.0, 0, 36000, 0.0, 0.0, 124, 106103, 0.0, 0.0, 0.0, 680, "砂塵瀑布の手甲", 0.0, 0.0, 0.0, 106103, 6.0, 0.0, 0.0, 6, 1, 10, 0, 220.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "神が人に授けた霊石、サファイアで\n作られし神弓。慈愛を司るとされ、\n放たれる蒼き輝きを纏いし矢は人々\nを邪へと堕とす魔神をも退ける。", 0.0, 10.0, 0.0, 0, 34000, 0.0, 0.0, 112, 106131, 0.0, 0.0, 0.0, 880, "蒼神弓マーシーサピロス", 0.0, 0.0, 0.0, 106131, 5.0, 0.0, 0.0, 6, 1, 13, 0, 144.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "お菓子の国で作られたカラフルに透\nき通った飴細工の弓。矢を放つ度に\n長きにわたり素材に蓄積された甘き\n香りが周囲を包みこむ。", 0.0, 8.0, 0.0, 0, 34000, 0.0, 0.0, 118, 106132, 0.0, 0.0, 0.0, 880, "キャンディーシュガーボウ", 0.0, 0.0, 0.0, 106132, 0.0, 0.0, 0.0, 6, 1, 13, 0, 195.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "風に吹かれ刺すように降り注ぐ飛雨\nを束ね造られた弓。一矢放つごとに\nとめどなく降り注ぎ装備者を護ると\n同時に敵の動きを抑え急所を貫く。", 0.0, 10.0, 0.0, 0, 36000, 8.0, 0.0, 124, 106133, 0.0, 0.0, 0.0, 1080, "白雨の流転弓", 0.0, 0.0, 0.0, 106133, 0.0, 0.0, 0.0, 6, 1, 13, 0, 196.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "神の力が結晶化した水晶の槍。神聖\nなる力を宿しており、聖光を放つ一\n撃は不死の王をも消滅させたことか\nら、浄化を司る槍とも呼ばれる。", 0.0, 4.0, 0.0, 0, 34000, 0.0, 0.0, 112, 106161, 0.0, 0.0, 0.0, 520, "クリスタロススパイク", 0.0, 0.0, 0.0, 106161, 0.0, 0.0, 0.0, 6, 1, 16, 0, 199.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "お菓子の国で発見されたというチョ\nコレートパラソルを巨大化させた大\n槍。計算され尽くした重心バランス\nにより性能は高い。", 0.0, 0.0, 0.0, 0, 34000, 0.0, 0.0, 118, 106162, 0.0, 0.0, 0.0, 680, "ショコラートランス", 0.0, 0.0, 0.0, 106162, 7.0, 0.0, 0.0, 6, 1, 16, 0, 200.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天を駆け地を穿つ雷を宿した剛槍。\n膨大な力を宿すため、装備者を選ぶ\nもののそこから放たれる一撃は比類\nなき破壊力を誇る。", 0.0, 3.0, 0.0, 0, 36000, 10.0, 0.0, 124, 106163, 0.0, 0.0, 0.0, 840, "迅雷一閃の槍", 0.0, 0.0, 0.0, 106163, 3.0, 0.0, 0.0, 6, 1, 16, 0, 215.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "英雄譚に名を刻む豪胆な戦神が生涯\nの相棒とした大戦斧。黄金に似て非\nなる雷光の輝きは、畏怖の象徴とし\nて戦場にその名を轟かせたという。", 0.0, 0.0, 0.0, 0, 34000, 0.0, 0.0, 112, 106191, 0.0, 0.0, 0.0, 720, "黄銅の裂戦斧", 0.0, 0.0, 0.0, 106191, 0.0, 0.0, 0.0, 6, 1, 19, 0, 219.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "お菓子の国一番の戦士が使っていた\n具沢山なクレープの斧。多彩な食感\nの如き複雑な形状の刃は絶大な破壊\n力を誇る。", 0.0, 0.0, 0.0, 0, 34000, 0.0, 0.0, 118, 106192, 0.0, 0.0, 0.0, 880, "クレープアックス", 0.0, 0.0, 0.0, 106192, 0.0, 0.0, 0.0, 6, 1, 19, 0, 235.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "極域の夜を彩るオーロラ一枚一枚を\n束ね編み込みこんだ斧。放つ輝きが\n装備者に活力を与え、その潜在能力\nを限界まで発揮させる。", 0.0, 0.0, 0.0, 0, 36000, 0.0, 9.0, 124, 106193, 0.0, 0.0, 0.0, 1020, "極天の光帯斧", 0.0, 0.0, 0.0, 106193, 0.0, 0.0, 0.0, 6, 1, 19, 0, 243.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "冥府の黒き女王が死者の霊魂を導く\nために用いたとされる杖。黒き宝珠\nから吹き荒れる冥界の風は禁呪や神\nの奇跡でさえも等しく虚無へ帰す。", 0.0, 0.0, 0.0, 0, 34000, 0.0, 0.0, 112, 106221, 0.0, 190.0, 0.0, 680, "黒真珠の闇獄杖", 29.0, 0.0, 0.0, 106221, 0.0, 0.0, 0.0, 6, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "お菓子の国で禁忌とされたペロペロ\nキャンディーの魔法杖。渦巻き文様\nに練りこまれた魔力により使用者の\n魔法の威力を爆発的に高める。", 0.0, 0.0, 0.0, 0, 34000, 0.0, 0.0, 118, 106222, 0.0, 202.0, 0.0, 820, "ロリポップステッキ", 33.0, 0.0, 0.0, 106222, 0.0, 0.0, 0.0, 6, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "闇深き夜に浮かぶ仄暗き月影を写し\nとり造られた魔法杖。掲げられた弧\n月は現世と異界を繋げる裂け目とな\nり、装備者に闇の魔力を与える。", 0.0, 0.0, 0.0, 0, 36000, 0.0, 0.0, 124, 106223, 0.0, 214.0, 0.0, 1000, "月闇の弧月杖", 36.0, 0.0, 0.0, 106223, 0.0, 0.0, 0.0, 6, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (345.0, 0, 0.0, 0, "天上の白き女神が生命の始まりを祝\n福して授けたとされる杖。宝珠に満\nちる聖光は万病を癒し、悪鬼邪神の\n呪いすら打ち払うとされる。", 0.0, 4.0, 0.0, 0, 34000, 0.0, 0.0, 112, 106251, 0.0, 145.0, 0.0, 680, "白真珠の光天杖", 0.0, 0.0, 0.0, 106251, 3.0, 0.0, 0.0, 6, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (175.0, 0, 0.0, 0, "お菓子の国で開発された３段重ねの\nアイスクリームの杖。３つのアイス\nの玉それぞれに究極の癒しの力を秘\nめているという。", 0.0, 7.0, 0.0, 0, 34000, 0.0, 0.0, 118, 106252, 0.0, 150.0, 0.0, 820, "トリプルアイスロッド", 0.0, 0.0, 0.0, 106252, 6.0, 0.0, 0.0, 6, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (250.0, 0, 0.0, 0, "悠久の時を舞い続け巨大な結晶と化\nした雪華を核とした魔法杖。杖に籠\nめられた不変の加護が、装備者に永\n久凍土の如き頑健さを与える。", 0.0, 9.0, 0.0, 0, 36000, 0.0, 0.0, 124, 106253, 0.0, 142.0, 0.0, 1126, "氷雪華晶の杖", 0.0, 0.0, 0.0, 106253, 7.0, 0.0, 0.0, 6, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "極めて純度の高い白金を聖火と霊峰\nの清水で鍛えた礼装甲冑。繋ぎ合わ\nされた白金片は白竜の鱗の如き煌き\nを放ち纏う者を守護している。", 0.0, 7.0, 0.0, 0, 34000, 0.0, 0.0, 117, 106281, 0.0, 0.0, 0.0, 520, "白金の煌鱗鎧", 0.0, 0.0, 0.0, 106281, 9.0, 0.0, 0.0, 6, 1, 28, 0, 78.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "お菓子の国の最先端技術を結集して\n編まれたチョコの鎧。ダイヤモンド\nより硬いといわれる伝説のチョコを\n幾重にも重ねて作られている。", 0.0, 5.0, 0.0, 0, 34000, 0.0, 0.0, 123, 106282, 0.0, 0.0, 0.0, 960, "チョコレートメイル", 0.0, 0.0, 0.0, 106282, 13.0, 0.0, 0.0, 6, 1, 28, 0, 79.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "最高級の漆板に桜花の螺鈿を施した\n東方の鎧。秘伝とされる製法により\n堅牢さと優美な姿を併せ持ち、装備\n者の戦闘中の動きを助けるという。", 0.0, 5.0, 0.0, 0, 36000, 10.0, 0.0, 129, 106283, 0.0, 0.0, 0.0, 960, "宵桜の紫鎧", 0.0, 0.0, 0.0, 106283, 6.0, 0.0, 0.0, 6, 1, 28, 0, 120.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (185.0, 0, 0.0, 0, "精緻な細工が施された黄金の重鎧。\n板金を彩る聖なる文様は立体の魔法\n陣を構築しており装備者は重さを感\nじず守護の恩恵を得られる。", 0.0, 11.0, 0.0, 0, 34000, 0.0, 15.0, 117, 106311, 0.0, 0.0, 0.0, 810, "金無垢の聖彫重甲", 0.0, 0.0, 0.0, 106311, 14.0, 0.0, 0.0, 6, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (160.0, 0, 0.0, 0, "お菓子の国随一の騎士が纏っていた\n魔法の苺が散りばめられた鎧。気高\nい芳香は、装備者のみならずその周\n囲の者まで戦意を昂揚させる。", 0.0, 12.0, 0.0, 0, 34000, 0.0, 20.0, 123, 106312, 0.0, 0.0, 0.0, 1205, "ロゼストロベリーアーマー", 0.0, 0.0, 0.0, 106312, 15.0, 0.0, 0.0, 6, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (215.0, 0, 0.0, 0, "春の息吹を封じた特殊な板金で作ら\nれた大鎧。刻まれた桜の文様が身代\nわりとなり散ることで与えられた傷\nを無効化するという。", 0.0, 12.0, 0.0, 0, 36000, 0.0, 20.0, 129, 106313, 0.0, 0.0, 0.0, 1205, "桜花の八重鎧", 0.0, 0.0, 0.0, 106313, 16.0, 0.0, 0.0, 6, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "果てなる海より稀に漂着する僅かな\n珊瑚片を丹念に集め織り込んだドレ\nス。海神の愛したその鮮やかな色は\n纏う者を万難から遠ざけるという。", 0.0, 4.0, 0.0, 0, 34000, 10.0, 0.0, 117, 106341, 0.0, 0.0, 0.0, 680, "ピンクコーラルドレス", 0.0, 0.0, 0.0, 106341, 4.0, 0.0, 0.0, 6, 1, 34, 0, 113.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "お菓子の国秘伝の守護魔法を込めた\nマカロンで作られたドレス。一粒ず\nつ異なる魔力が込められており、あ\nらゆる攻撃を防ぐことができる。", 0.0, 6.0, 0.0, 0, 34000, 0.0, 0.0, 123, 106342, 0.0, 0.0, 0.0, 980, "ファンシーマカロンドレス", 0.0, 0.0, 0.0, 106342, 6.0, 0.0, 0.0, 6, 1, 34, 0, 109.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "春の神々に感謝の踊りを奉納する際\nに踊り子たちが着ていた神聖な衣。\n散りばめられた桜の花弁の装飾が、\n装備者の身体能力を引き上げる。", 0.0, 6.0, 0.0, 0, 36000, 10.0, 0.0, 129, 106343, 0.0, 0.0, 0.0, 980, "薄紅桜花の聖衣", 0.0, 0.0, 0.0, 106343, 7.0, 0.0, 0.0, 6, 1, 34, 0, 110.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "月明かりすら届かぬ地の奥から掘り\n出された黒瑪瑙をちりばめた黒衣。\n煌きの代わりに振りまかれる漆黒は\nあらゆる危難から纏う者を隠す。", 0.0, 7.0, 0.0, 0, 34000, 0.0, 0.0, 117, 106371, 0.0, 87.0, 0.0, 520, "黒瑪瑙の祈装衣", 10.0, 0.0, 0.0, 106371, 5.0, 0.0, 0.0, 6, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "お菓子の国で神事に用いられる、巨\n大なパンケーキの法衣。魔法のバタ\nーが発する優しい香りは魔除けの効\n果があり、装備者を厄災から護る。", 0.0, 14.0, 0.0, 0, 34000, 0.0, 0.0, 123, 106372, 0.0, 49.0, 0.0, 1080, "マジックパンケーキローブ", 0.0, 0.0, 0.0, 106372, 10.0, 0.0, 0.0, 6, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "冬に咲く伝説の桜の花弁を刺繍した\n特別なローブ。ローブ全体に花弁で\nできた魔法陣が配され、装備者に尽\nきぬ魔力を与えるという。", 0.0, 8.0, 0.0, 0, 36000, 0.0, 0.0, 129, 106373, 0.0, 100.0, 0.0, 1080, "白雪桜の魔装", 10.0, 0.0, 0.0, 106373, 6.0, 0.0, 0.0, 6, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "巨大なアイオライトの結晶から作ら\nれた円盾。その硬度は物理的なもの\nから魔法的なものまであらゆる苦境\nから装備者を護る。", 0.0, 12.0, 0.0, 0, 34000, 0.0, 0.0, 117, 106401, 0.0, 0.0, 0.0, 720, "アイオライトシールド", 0.0, 0.0, 0.0, 106401, 12.0, 0.0, 0.0, 6, 1, 40, 0, 37.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "お菓子の国に伝わる永遠に溶けない\n氷を素材に作られた靴。青みを帯び\nた特有の色合いは見る者を惑わせ、\n神すら魅了する力があるという。", 0.0, 18.0, 0.0, 0, 34000, 0.0, 0.0, 123, 106431, 0.0, 0.0, 0.0, 1200, "チョコミントアイスヒール", 0.0, 0.0, 0.0, 106431, 11.0, 0.0, 0.0, 6, 1, 43, 0, 24.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (125.0, 0, 0.0, 0, "妖精が女神のためにあつらえたとい\nわれる靴。月の光を浴び続け自ら光\nを放つようになった水晶を素材とし\n光と共に踊るように災厄をかわす。", 0.0, 12.0, 0.0, 0, 34000, 0.0, 0.0, 117, 106461, 0.0, 43.0, 0.0, 880, "ムーンクリスタルヒール", 0.0, 0.0, 0.0, 106461, 8.0, 0.0, 0.0, 6, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (175.0, 0, 0.0, 0, "悠久の時を超えてもなお枯れぬ桜の\n木より作られたサンダル。大地と装\n備者を魔法的に繋ぐことでその生命\n力を飛躍的に高める。", 0.0, 13.0, 0.0, 0, 36000, 0.0, 0.0, 129, 106462, 0.0, 50.0, 0.0, 880, "桜吹雪の編上靴", 0.0, 0.0, 0.0, 106462, 9.0, 0.0, 0.0, 6, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "常春の妖精郷に咲くという散らぬ桜\nの花弁を編み込んだ、鍔広帽。装備\n者に妖精王の加護を与え目にも留ま\nらぬ一撃を見舞う。", 0.0, 19.0, 0.0, 0, 36000, 0.0, 0.0, 129, 106491, 0.0, 0.0, 0.0, 880, "不散桜の鍔広帽", 0.0, 0.0, 0.0, 106491, 11.0, 0.0, 0.0, 6, 1, 49, 0, 31.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "お菓子の国で祭事に用いられる魔法\nのタルトで作られた帽子。周囲に漂\nう焼きたての香りが創造力を向上さ\nせ、魔力を劇的に高める力を持つ。", 0.0, 3.0, 0.0, 0, 34000, 0.0, 0.0, 123, 106521, 0.0, 122.0, 0.0, 985, "シーツタルトベレー", 12.0, 0.0, 0.0, 106521, 4.0, 0.0, 0.0, 6, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (95.0, 0, 0.0, 0, "情熱を司るルビーの薔薇が施された\n指輪。戦神の力を宿しており、万の\n軍勢を薙ぎ払う絶対的な力と、邪神\nの恐怖すら振り払う勇気を授ける。", 0.0, 0.0, 0.0, 0, 34000, 40.0, 0.0, 114, 106551, 0.0, 0.0, 0.0, 600, "神紅輪ルビーローズ", 0.0, 0.0, 0.0, 106551, 0.0, 0.0, 0.0, 6, 1, 55, 0, 124.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "お菓子の国王家に伝わる宝石の如く\n輝きを放つポップコーンの首飾り。\n一粒一粒から放たれる香りが装備者\nの食欲と闘争本能に火をつける。", 0.0, 0.0, 0.0, 0, 34000, 41.0, 0.0, 120, 106552, 0.0, 0.0, 0.0, 600, "ポップコーンネックレス", 0.0, 0.0, 0.0, 106552, 0.0, 0.0, 0.0, 6, 1, 55, 0, 137.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (90.0, 0, 0.0, 0, "万物を枯死させんばかりの炎天を封\nじ込めた耳飾り。永遠に続く勝利へ\nの渇望とひきかえに、全てを打ち滅\nぼす力を装備者に与える。", 0.0, 0.0, 0.0, 0, 36000, 44.0, 0.0, 126, 106553, 0.0, 0.0, 0.0, 600, "獄天の耳飾り", 0.0, 0.0, 0.0, 106553, 0.0, 0.0, 0.0, 6, 1, 55, 0, 150.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "古き神樹の園の緑葉を象った指輪。\n常盤の緑葉が如きエメラルドの輝き\nは身に着けた者へ無窮の旅路を支え\nる幸運と強健の加護を授ける。", 0.0, 15.0, 95.0, 0, 34000, 0.0, 0.0, 114, 106581, 0.0, 0.0, 0.0, 600, "常盤の緑環", 0.0, 0.0, 0.0, 106581, 15.0, 0.0, 0.0, 6, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (35.0, 0, 0.0, 0, "お菓子の国でも既に製法が失われた\nというマカロンをあしらったチュロ\nスの首飾り。いかなる衝撃からも装\n着者を包みこむように守りぬく。", 0.0, 16.0, 0.0, 0, 34000, 0.0, 0.0, 120, 106582, 0.0, 0.0, 0.0, 600, "マカロンペンダント", 0.0, 0.0, 0.0, 106582, 17.0, 0.0, 0.0, 6, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (110.0, 0, 0.0, 0, "舞い踊る旋風をその回転のまま封じ\n込めた耳飾り。常に装備者の周囲に\n風の防壁を張り巡らせ、剣も魔法も\nその身には寄せ付けない。", 0.0, 17.0, 0.0, 0, 36000, 0.0, 0.0, 126, 106583, 0.0, 0.0, 0.0, 600, "旋風の耳飾り", 0.0, 0.0, 0.0, 106583, 17.0, 0.0, 0.0, 6, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "光の精霊が盟約の証として授けた金\n剛石の指輪。尽きぬ輝きは無尽蔵の\n魔力に由来し、新たな星を作れる程\nの力を秘めているという。", 0.0, 0.0, 0.0, 0, 34000, 0.0, 0.0, 114, 106611, 0.0, 132.0, 0.0, 600, "白聖石ダイヤモンドスター", 24.0, 0.0, 0.0, 106611, 0.0, 0.0, 0.0, 6, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "お菓子の国の伝説の職人が作ったと\nされるドーナツの首飾り。甘い香り\nが装備者の集中力を高め、飛躍的に\n魔法の威力が増すという。", 0.0, 0.0, 0.0, 0, 34000, 0.0, 0.0, 120, 106612, 0.0, 134.0, 0.0, 600, "ドーナツチョーカー", 35.0, 0.0, 0.0, 106612, 0.0, 0.0, 0.0, 6, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "万物を潤す優しき糸雨を封じ込めた\n耳飾り。優しく降り注ぐその雨は、\n戦いで傷ついた装備者を絶え間なく\n癒し続ける。", 0.0, 0.0, 100.0, 0, 36000, 0.0, 0.0, 126, 106613, 0.0, 140.0, 0.0, 600, "恵雨の耳飾り", 36.0, 0.0, 0.0, 106613, 0.0, 0.0, 0.0, 6, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (40.0, 0, 0.0, 0, "春の息吹が込められた特殊な鉱石で\n錬成された大剣。桜の文様が装備者\nの生命力を活性化させ、あらゆる物\nを両断する力を与える。", 0.0, 0.0, 0.0, 0, 38000, 18.0, 0.0, 130, 107011, 0.0, 0.0, 0.0, 880, "チェリーブロッサム", 0.0, 0.0, 0.0, 107011, 0.0, 0.0, 0.0, 7, 1, 1, 0, 268.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (85.0, 0, 0.0, 0, "氷海の天使と呼ばれるクリオネを鍔\nに象った大剣。氷冷の海原を舞う翼\nの加護が、装備者に過酷な環境にも\n負けぬ生命力を与える。", 0.0, 0.0, 0.0, 0, 38000, 16.0, 0.0, 136, 107012, 0.0, 0.0, 0.0, 1000, "クリオネブレード", 0.0, 0.0, 0.0, 107012, 0.0, 0.0, 0.0, 7, 1, 1, 0, 281.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (170.0, 0, 0.0, 0, "古の戦場で連戦戦勝を誇った戦士が\n携えていた剣。乱戦を戦い抜くため\n切れ味よりも打撃力に特化した暴虐\nの剛剣はいかなる敵も吹き飛ばす。", 0.0, 0.0, 0.0, 0, 38000, 14.0, 0.0, 142, 107013, 0.0, 0.0, 0.0, 600, "ライオットスパイク", 0.0, 0.0, 0.0, 107013, 0.0, 0.0, 0.0, 7, 1, 1, 0, 286.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "宵闇の精霊に捧げられたという特殊\nな桜の花びらを刃に散りばめた刀。\n光を吸収する刀身が、斬撃の軌道を\n覆い隠し必殺の一撃を見舞う。", 0.0, 0.0, 0.0, 0, 38000, 42.0, 0.0, 130, 107041, 0.0, 0.0, 0.0, 1180, "宵刀影桜", 0.0, 0.0, 0.0, 107041, 0.0, 0.0, 0.0, 7, 1, 4, 0, 260.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "海のギャングと呼ばれるシャチの鋭\nい背ビレを象った太刀。その太刀筋\nは海面を泳ぎ回るシャチのように縦\n横無尽に敵を切り裂くという。", 0.0, 0.0, 0.0, 0, 38000, 31.0, 0.0, 136, 107042, 0.0, 0.0, 0.0, 600, "オルカソード", 0.0, 0.0, 0.0, 107042, 5.0, 0.0, 0.0, 7, 1, 4, 0, 258.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "古の戦場で万夫に名の知れた狂剣士\nが振るっていた刀。刀身とともに暴\nれまわる鎖が斬撃の痛みを倍増させ\n幾多の苦しみを敵に刻みこむ。", 0.0, 0.0, 0.0, 0, 38000, 31.0, 0.0, 142, 107043, 0.0, 0.0, 0.0, 1120, "チェインフューリーソード", 0.0, 0.0, 0.0, 107043, 0.0, 0.0, 0.0, 7, 1, 4, 0, 297.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (65.0, 0, 0.0, 0, "儚く散る間際の桜の花弁を、秘法で\n刀身にとどめ、鋭い刃とした短刀。\nその切っ先はどこまでも薄く、あら\nゆる隙間を切り裂く。", 0.0, 0.0, 0.0, 0, 38000, 40.0, 0.0, 130, 107071, 0.0, 0.0, 0.0, 1160, "チェリーペタルダガー", 0.0, 0.0, 0.0, 107071, 0.0, 0.0, 0.0, 7, 1, 7, 0, 254.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "血に飢えた大海の狩人であるサメの\n牙を象った短剣。一度、食い込めば\n決して抜けることがないといわれる\n刃が、獲物を着実に追い詰める。", 0.0, 0.0, 0.0, 0, 38000, 41.0, 0.0, 136, 107072, 0.0, 0.0, 0.0, 600, "シャークダガー", 0.0, 0.0, 0.0, 107072, 0.0, 0.0, 0.0, 7, 1, 7, 0, 278.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "古の戦場で最速と呼ばれた戦士が巧\nみに扱った短剣。刃に迸る雷により\n切れ味が大幅に強化されており一閃\nで敵を断ち切る威力を誇る。", 0.0, 0.0, 0.0, 0, 38000, 35.0, 0.0, 142, 107073, 0.0, 0.0, 0.0, 600, "サンダーパンクダガー", 0.0, 0.0, 0.0, 107073, 0.0, 0.0, 0.0, 7, 1, 7, 0, 295.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (120.0, 0, 0.0, 0, "樹齢千年を超える伝説の桜の古木を\n稀代の名工が一刀彫で作った手甲。\n静かに満ちる古木の生命力が必殺の\n一撃を生む。", 0.0, 0.0, 0.0, 0, 38000, 0.0, 0.0, 130, 107101, 0.0, 0.0, 0.0, 880, "桜花の貫き手", 0.0, 0.0, 0.0, 107101, 4.0, 0.0, 0.0, 7, 1, 10, 0, 248.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "海中を遊泳するウミガメの甲羅を象\nった手甲。エメラルドの如く澄んだ\n輝きを誇り、その圧倒的な硬度でい\nかなる対象をも粉砕する。", 0.0, 6.0, 0.0, 0, 38000, 0.0, 0.0, 136, 107102, 0.0, 0.0, 0.0, 880, "タートルガントレット", 0.0, 0.0, 0.0, 107102, 6.0, 0.0, 0.0, 7, 1, 10, 0, 239.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "古の戦場で大暴れしたという獣人の\n戦士が愛用した拳具。肉弾戦に特化\nした形状により猫のようなしなやか\nさと肉食獣の如き剛力を発揮する。", 0.0, 0.0, 0.0, 0, 38000, 0.0, 0.0, 142, 107103, 0.0, 0.0, 0.0, 600, "メリケンニャックル", 0.0, 0.0, 0.0, 107103, 0.0, 0.0, 0.0, 7, 1, 10, 0, 312.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "秘境に咲く桜の古木の枝から作られ\nた弓。自然に形作られた湾曲のみで\n作られており、装備者は自然と一体\n化し様々な加護を得るという。", 0.0, 5.0, 0.0, 0, 38000, 0.0, 0.0, 130, 107131, 0.0, 0.0, 0.0, 1040, "枝垂れの桜花弓", 0.0, 0.0, 0.0, 107131, 5.0, 0.0, 0.0, 7, 1, 13, 0, 231.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "常夏の海に群れで暮らすクマノミを\n象った弓。装備者は地形を活かした\n神出鬼没の矢捌きで身を隠しながら\n敵の不意を撃つという。", 0.0, 7.0, 0.0, 0, 38000, 15.0, 0.0, 136, 107132, 0.0, 0.0, 0.0, 600, "クラウンフィッシュボウ", 0.0, 0.0, 0.0, 107132, 0.0, 0.0, 0.0, 7, 1, 13, 0, 256.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "古の戦場で剛腕と恐れられた弓手が\n使い熟していた強弓。常人では引く\nこともままならぬ弦から放たれる剛\n矢は必ず獲物の急所を一撃で貫く。", 0.0, 6.0, 0.0, 0, 38000, 17.0, 0.0, 142, 107133, 0.0, 0.0, 0.0, 980, "クライムハントボウ", 0.0, 0.0, 0.0, 107133, 2.0, 0.0, 0.0, 7, 1, 13, 0, 264.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "桜の花を散らす風を舞い散る花びら\nごと封じ込めた槍。常に装備者の周\n囲を舞う花びらが魔法的な防壁とな\nり悪意ある魔法を防ぐという。", 0.0, 9.0, 0.0, 0, 38000, 0.0, 0.0, 130, 107161, 0.0, 0.0, 0.0, 880, "散桜の颯槍", 0.0, 0.0, 0.0, 107161, 3.0, 0.0, 0.0, 7, 1, 16, 0, 221.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "鋭さと堅牢さを併せ持った蟹の鋏を\n象った槍。強靭さもさることながら\n二股に分かれた特殊な形状で相手の\n攻撃を絡めとり鉄壁の防御を誇る。", 0.0, 4.0, 0.0, 0, 38000, 0.0, 0.0, 136, 107162, 0.0, 0.0, 0.0, 880, "クラブシザースピアー", 0.0, 0.0, 0.0, 107162, 10.0, 0.0, 0.0, 7, 1, 16, 0, 229.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "古の戦場で不死身と噂された戦士が\n常に装備していた槍。槍頭の飾具か\nら魔力が滾り、装備者の全身を包み\nこむことでその身を護るという。", 0.0, 4.0, 0.0, 0, 38000, 0.0, 0.0, 142, 107163, 0.0, 0.0, 0.0, 600, "スカルゴシックランス", 0.0, 0.0, 0.0, 107163, 9.0, 0.0, 0.0, 7, 1, 16, 0, 247.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "大英傑と称された人物が用いた伝説\nの斧。この斧に切り倒された桜の精\nがあまりの切れ味に感心し罰ではな\nく祝福を与えたと伝えられている。", 0.0, 0.0, 0.0, 0, 38000, 0.0, 0.0, 130, 107191, 0.0, 0.0, 0.0, 1100, "桜伐り", 0.0, 0.0, 0.0, 107191, 0.0, 0.0, 0.0, 7, 1, 19, 0, 281.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (255.0, 0, 0.0, 0, "大海原を自在に泳ぎ回る鯨が潮を吹\nく姿を象った斧。吹き上がる水の刃\nは装備者に大海を泳ぎ切る驚異の生\n命力と絶大な腕力を与える。", 0.0, 0.0, 0.0, 0, 38000, 0.0, 0.0, 136, 107192, 0.0, 0.0, 0.0, 600, "ホエールアックス", 0.0, 0.0, 0.0, 107192, 0.0, 0.0, 0.0, 7, 1, 19, 0, 270.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (240.0, 0, 0.0, 0, "古の戦場で常に最前線を駆けていた\n戦士が担いでいた斧。楽器を模した\n形状であり、一振りごとに鳴り響く\n轟音が装備者の心身を鼓舞する。", 0.0, 0.0, 0.0, 0, 38000, 25.0, 0.0, 142, 107193, 0.0, 0.0, 0.0, 980, "ロッキングルーブアックス", 0.0, 0.0, 0.0, 107193, 0.0, 0.0, 0.0, 7, 1, 19, 0, 273.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "万の樹から一つしか見つからない、\n魔力を宿した特別な桜を核として作\nられた杖。装備者の魔法を研ぎ澄ま\nされた一撃へと変えるという。", 0.0, 0.0, 0.0, 0, 38000, 0.0, 0.0, 130, 107221, 0.0, 229.0, 0.0, 880, "チェリッシュロッド", 52.0, 0.0, 0.0, 107221, 0.0, 0.0, 0.0, 7, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "海底で静かに佇む巻貝を象った杖。\n深海に蓄積された水の魔力をその内\nに蓄えており、装備者の放つ魔力の\n質と量を底上げさせるという。", 0.0, 0.0, 0.0, 0, 38000, 0.0, 0.0, 136, 107222, 0.0, 252.0, 0.0, 960, "ジュエルシェルロッド", 47.0, 0.0, 0.0, 107222, 0.0, 0.0, 0.0, 7, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "古の戦場において破壊者として忌み\n嫌われた魔術師の杖。内部に封印さ\nれた膨大な魔力は一度解放されれば\n戦場の全てを飲み込んでしまう。", 0.0, 0.0, 0.0, 0, 38000, 0.0, 0.0, 142, 107223, 0.0, 277.0, 0.0, 600, "パドロックセプター", 35.0, 0.0, 0.0, 107223, 0.0, 0.0, 0.0, 7, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (50.0, 0, 0.0, 0, "一年を通して散ることのない特殊な\n桜を用いた聖なる杖。魔法儀式によ\nり傷つけることなく採取された枝の\n生命力が装備者を守護する。", 0.0, 9.0, 0.0, 0, 38000, 0.0, 0.0, 130, 107251, 0.0, 201.0, 0.0, 880, "桜華の舞杖", 0.0, 0.0, 0.0, 107251, 6.0, 0.0, 0.0, 7, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (320.0, 0, 0.0, 0, "海中を優雅にたゆたうクラゲを象っ\nた杖。幾重にも折り重なる透明な襞\nが装備者の周りに展開され、その身\nに神秘の生命力を与えるという。", 0.0, 8.0, 0.0, 0, 38000, 0.0, 0.0, 136, 107252, 0.0, 193.0, 0.0, 985, "ジェリーフィッシュロッド", 0.0, 0.0, 0.0, 107252, 6.0, 0.0, 0.0, 7, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (420.0, 0, 0.0, 0, "古の戦場において支配者と呼ばれた\n女帝が持っていた杖。杖の持つ加護\nが装備者の胆力を高め、いかなる窮\n地でも泰然自若に振舞えるという。", 0.0, 7.0, 0.0, 0, 38000, 0.0, 0.0, 142, 107253, 0.0, 210.0, 0.0, 600, "パンクプリンセスロッド", 0.0, 0.0, 0.0, 107253, 4.0, 0.0, 0.0, 7, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "水辺での敏捷性を生かした軽装鎧。\n見た目よりもはるかに戦闘向きで、\nその大胆なデザインと迅速な動きが\n相まって致命の一撃を連発する。", 0.0, 8.0, 0.0, 0, 38000, 18.0, 0.0, 135, 107281, 0.0, 0.0, 0.0, 960, "サマーライトビキニアーマー", 0.0, 0.0, 0.0, 107281, 11.0, 0.0, 0.0, 7, 1, 28, 0, 140.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "古の戦場で剣を振るい続けた王女が\nまとっていたとされる、戦ドレス。\n荘厳な気品が装備者を加護し、いか\nなる敵をも打ち伏せる力を与える。", 0.0, 9.0, 0.0, 0, 38000, 22.0, 0.0, 141, 107282, 0.0, 0.0, 0.0, 1120, "ゴシックドレープアーマー", 0.0, 0.0, 0.0, 107282, 11.0, 0.0, 0.0, 7, 1, 28, 0, 148.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "原初の粉雪が積もり、硬結晶化した\n雪を丹念に磨き上げた鎧。神水の如\nき、清涼なる雪の結晶は金属以上の\n硬度と軽さで装備者を守る。", 0.0, 13.0, 0.0, 0, 38000, 22.0, 0.0, 147, 107283, 0.0, 0.0, 0.0, 1120, "ピュアスノウメイル", 0.0, 0.0, 0.0, 107283, 10.0, 0.0, 0.0, 7, 1, 28, 0, 149.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (340.0, 0, 0.0, 0, "水辺の安全を護る浮輪を、特殊な魔\n法で強化して組み込んだ巨大な鎧。\n剛性と弾性を両立し圧倒的な衝撃吸\n収能力で絶対の防御力を誇る。", 0.0, 18.0, 0.0, 0, 38000, 0.0, 20.0, 135, 107311, 0.0, 0.0, 0.0, 1205, "ビーチフローターメイル", 0.0, 0.0, 0.0, 107311, 20.0, 0.0, 0.0, 7, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (430.0, 0, 0.0, 0, "古の戦場で主君を守り続けた女騎士\nがまとっていた鎧。鎧内に宿りし忠\n義心が装備者に鋼鉄の如き頑健さと\n決して倒れぬ不屈の心を与える。", 0.0, 20.0, 0.0, 0, 38000, 0.0, 0.0, 141, 107312, 0.0, 0.0, 0.0, 600, "ゴシックメイデン", 0.0, 0.0, 0.0, 107312, 22.0, 0.0, 0.0, 7, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (400.0, 0, 0.0, 0, "極点の大氷原で稀に発見される水晶\n板を贅沢に使用した鎧。絶対零度で\n形成された水晶は熱や衝撃を拒絶し\n装備者に不壊不動の加護を与える。", 0.0, 20.0, 0.0, 0, 38000, 0.0, 0.0, 147, 107313, 0.0, 0.0, 0.0, 920, "クリスタルアイスメイル", 0.0, 0.0, 0.0, 107313, 26.0, 0.0, 0.0, 7, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "盛夏の煌めく記憶を象徴する朝顔の\n柄を織り込んだ特別な浴衣。装備者\nの心身を郷愁と共に、思い出の中に\nある夏の最高の状態へと導く。", 0.0, 7.0, 0.0, 0, 38000, 0.0, 0.0, 135, 107341, 0.0, 0.0, 0.0, 980, "朝顔の夏影浴衣", 0.0, 0.0, 0.0, 107341, 9.0, 0.0, 0.0, 7, 1, 34, 0, 164.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "古の戦場で常に最前線に立ち続けた\n女戦士がまとっていた戦衣。宿りし\n叛逆心が、装備者にあらゆる逆境を\nはね除ける圧倒的な武力を与える。", 0.0, 12.0, 0.0, 0, 38000, 0.0, 0.0, 141, 107342, 0.0, 0.0, 0.0, 880, "パンキッシュガール", 0.0, 0.0, 0.0, 107342, 15.0, 0.0, 0.0, 7, 1, 34, 0, 124.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (320.0, 0, 0.0, 0, "極点の夜に咲き誇るオーロラの微光\nを封じ込めた糸で編まれたドレス。\n揺れ動くたびに零れ出る暖かな光が\n魔力の層を形成し装備者を守る。", 0.0, 10.0, 0.0, 0, 38000, 0.0, 0.0, 147, 107343, 0.0, 0.0, 0.0, 600, "ホワイトオーロラドレス", 0.0, 0.0, 0.0, 107343, 8.0, 0.0, 0.0, 7, 1, 34, 0, 149.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "夏風に舞う日傘のように宙に浮くこ\nとができる魔法のワンピース。詠唱\nを妨げない適切な速度の浮遊能力で\n敵の死角から必殺の一撃を放つ。", 0.0, 7.0, 0.0, 0, 38000, 0.0, 0.0, 135, 107371, 0.0, 167.0, 0.0, 1080, "パラソルワンピース", 17.0, 0.0, 0.0, 107371, 5.0, 0.0, 0.0, 7, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "古の戦場で伝説となった若き女宮廷\n魔導士がまとっていたドレス。精緻\nな縫製技術により魔力効率と可憐さ\nを見事なレベルで両立している。", 0.0, 8.0, 0.0, 0, 38000, 0.0, 0.0, 141, 107372, 0.0, 169.0, 0.0, 600, "ゴシックブルーローズ", 20.0, 0.0, 0.0, 107372, 6.0, 0.0, 0.0, 7, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "凍てつく月夜の空気を織り込んだ呪\n法衣。金剛石と同硬度の氷の小結晶\nが立体的な天然魔法陣を形成し装備\n者を守護しつつ魔力を増幅させる。", 0.0, 9.0, 0.0, 0, 38000, 0.0, 0.0, 147, 107373, 0.0, 182.0, 0.0, 920, "ダイヤモンドダストローブ", 18.0, 0.0, 0.0, 107373, 6.0, 0.0, 0.0, 7, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (345.0, 0, 0.0, 0, "溢れんばかりの真夏の活力を宿した\nビーチサンダル。ハイビスカスの装\n飾は生花のまま咲き誇り、装備者に\n無限の生命力を与えている。", 0.0, 13.0, 0.0, 0, 38000, 0.0, 0.0, 135, 107461, 0.0, 80.0, 0.0, 880, "ハイビスカスサンダル", 0.0, 0.0, 0.0, 107461, 12.0, 0.0, 0.0, 7, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (375.0, 0, 0.0, 0, "数多の戦場を駆けた歴戦の勇士が履\nいていた靴。幾重もの革帯で装備者\nを包み、どんな強敵と対峙しても決\nして折れない反骨心を与える。", 0.0, 14.0, 0.0, 0, 38000, 0.0, 0.0, 141, 107462, 0.0, 82.0, 0.0, 1280, "スタッズドブラック", 0.0, 0.0, 0.0, 107462, 13.0, 0.0, 0.0, 7, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (460.0, 0, 0.0, 0, "極寒の氷海で育つという特殊な珊瑚\nで作られた靴。各所にあしらわれた\n雪の結晶の護符が装備者の動きを補\n助し体力の消耗を抑えてくれる。", 0.0, 15.0, 0.0, 0, 38000, 0.0, 0.0, 147, 107463, 0.0, 83.0, 0.0, 600, "フロストコラムヒール", 0.0, 0.0, 0.0, 107463, 13.0, 0.0, 0.0, 7, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "真夏の太陽の力を存分に蓄えた大輪\nの向日葵を大胆にあしらった麦わら\n帽子。堅固な守りだけではなく攻め\nにおいても格別の加護を得られる。", 0.0, 6.0, 0.0, 0, 38000, 0.0, 0.0, 135, 107491, 0.0, 0.0, 0.0, 880, "サンフラワーストローハット", 0.0, 0.0, 0.0, 107491, 6.0, 0.0, 0.0, 7, 1, 49, 0, 184.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "数多の戦場を駆けた歴戦の勇士が身\nに着けていた戦帽。宿りし孤高の精\n神が装備者の精神を高揚させ、飽く\nなき闘争心と絶大な腕力を与える。", 0.0, 8.0, 0.0, 0, 38000, 0.0, 0.0, 141, 107492, 0.0, 0.0, 0.0, 600, "ピアスドブラック", 0.0, 0.0, 0.0, 107492, 5.0, 0.0, 0.0, 7, 1, 49, 0, 194.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (525.0, 0, 0.0, 0, "ふわふわと舞う綿雪を彷彿とさせる\n帽子。氷の結晶の加護が付与されて\nおり、装備者は極寒の中でも動き続\nけられる無限の活力を得るという。", 0.0, 0.0, 0.0, 0, 38000, 0.0, 0.0, 147, 107493, 0.0, 0.0, 0.0, 600, "スノウフレークベレー", 0.0, 0.0, 0.0, 107493, 0.0, 0.0, 0.0, 7, 1, 49, 0, 215.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "絢爛に咲き誇る八重桜の枝の生命力\nをそのまま封じ込めた簪。常に満開\nの精気は装備者に、いついかなる時\nでも最高の力を発揮させる。", 0.0, 0.0, 0.0, 0, 38000, 30.0, 0.0, 132, 107551, 0.0, 0.0, 0.0, 600, "桜舞の八重簪", 0.0, 0.0, 0.0, 107551, 0.0, 0.0, 0.0, 7, 1, 55, 0, 210.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (90.0, 0, 0.0, 0, "南国に咲く生命力溢れるハイビスカ\nスの花を植え付けた髪飾り。真紅に\n煌めく花弁に満ちた陽光の加護が、\n装備者に膨大な活力を与えている。", 0.0, 0.0, 0.0, 0, 38000, 11.0, 0.0, 138, 107552, 0.0, 0.0, 0.0, 600, "ルビーハイビスカスの髪飾り", 0.0, 0.0, 0.0, 107552, 0.0, 0.0, 0.0, 7, 1, 55, 0, 225.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "苛烈な戦場を強大な力で席巻した戦\n士の魂が宿る腕輪。鋭い棘の装飾が\n放つ暴威が、装備者に背水の気迫と\n共に爆発的な攻撃力を与える。", 0.0, 0.0, 0.0, 0, 38000, 18.0, 0.0, 144, 107553, 0.0, 0.0, 0.0, 600, "パンクニードルバングル", 0.0, 0.0, 0.0, 107553, 0.0, 0.0, 0.0, 7, 1, 55, 0, 247.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (315.0, 0, 0.0, 0, "夜に静謐に咲く桜の枝に降り注ぐ月\n光の力を封じ込めた簪。月の魔力と\n桜の生命力が相互に高めあい装備者\nに無限の生命力を与える。", 0.0, 19.0, 0.0, 0, 38000, 0.0, 0.0, 132, 107581, 0.0, 0.0, 0.0, 600, "桜花の月夜簪", 0.0, 0.0, 0.0, 107581, 19.0, 0.0, 0.0, 7, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "大海に抱かれた大真珠の輝きを放ち\n生命力を保ち続ける椰子の実を集め\n作られた髪飾り。実を守る殻の加護\nがあらゆる攻撃から装備者を守る。", 0.0, 24.0, 0.0, 0, 38000, 0.0, 0.0, 138, 107582, 0.0, 0.0, 0.0, 600, "パールココナッツの髪飾り", 0.0, 0.0, 0.0, 107582, 24.0, 0.0, 0.0, 7, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "苛烈な戦場を強固な守りで支えた騎\n士の魂が宿る腕輪。目に見えない程\n細かく刻まれた不壊の魔紋があらゆ\nる攻撃から装備者を守る。", 0.0, 25.0, 0.0, 0, 38000, 0.0, 0.0, 144, 107583, 0.0, 0.0, 0.0, 600, "エメラルドゴシックバングル", 0.0, 0.0, 0.0, 107583, 26.0, 0.0, 0.0, 7, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "佳麗に咲き誇る枝垂れ桜に集う地脈\nの力ごと封じ込めた簪。揺れるたび\nに舞い踊る花弁が装備者に大自然の\n大いなる魔力の加護を与える。", 0.0, 0.0, 0.0, 0, 38000, 0.0, 0.0, 132, 107611, 0.0, 195.0, 0.0, 600, "仙桜の祝簪", 30.0, 0.0, 0.0, 107611, 0.0, 0.0, 0.0, 7, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ゆらめく輝きを纏った二枚貝を集め\n編み込んだ髪飾り。大海の魔力を蓄\nえた貝殻は装備者に尽きぬ魔力と共\nに強固な魔力障壁の加護を与える。", 0.0, 8.0, 0.0, 0, 38000, 0.0, 0.0, 138, 107612, 0.0, 201.0, 0.0, 600, "オパールシェルの髪飾り", 0.0, 0.0, 0.0, 107612, 0.0, 0.0, 0.0, 7, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "苛烈な戦場を知略で支配した魔法使\nいの魂が宿る腕輪。宝石には限界ま\nで魔力が貯め込まれ装備者の魔法に\n絶大な破壊力を与える。", 0.0, 0.0, 0.0, 0, 38000, 0.0, 0.0, 144, 107613, 0.0, 241.0, 0.0, 600, "ロッキンチェインバングル", 15.0, 0.0, 0.0, 107613, 0.0, 0.0, 0.0, 7, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "神代より溶けた事のない永久氷塊か\nら削り出された氷の大剣。圧倒的な\n輝きと硬度で繰り出される攻撃は、\n如何なる敵も一撃で剛断する。", 0.0, 0.0, 0.0, 0, 40000, 18.0, 0.0, 148, 108011, 0.0, 0.0, 0.0, 500, "氷輝剣グラースブレード", 0.0, 0.0, 0.0, 108011, 0.0, 0.0, 0.0, 8, 1, 1, 0, 330.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "最強と謳われた武奏楽団の団長達が\n愛用していた大剣。常人には構える\n事さえ困難な重量から繰り出される\n一撃は壮大な剣戟音で敵を討つ。", 0.0, 0.0, 0.0, 0, 40000, 12.0, 0.0, 154, 108012, 0.0, 0.0, 0.0, 500, "音界剣グランデピアニオス", 0.0, 0.0, 0.0, 108012, 0.0, 0.0, 0.0, 8, 1, 1, 0, 352.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の大剣。\n失われた技術で作られており湾曲\nした刃の絶妙な重心配分によりあら\nゆる攻撃が必殺の一撃と化す。", 0.0, 0.0, 0.0, 0, 40000, 3.0, 0.0, 160, 108013, 0.0, 0.0, 0.0, 500, "オアシスガードブレード", 0.0, 0.0, 0.0, 108013, 0.0, 0.0, 0.0, 8, 1, 1, 0, 364.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した護国の\n剣。柄に咲く紫紺と守護者の戦意は\n決して散ることなく敵を討つ。", 0.0, 0.0, 0.0, 0, 40000, 3.0, 0.0, 166, 108014, 0.0, 0.0, 0.0, 500, "ローズインペリアルソード", 0.0, 0.0, 0.0, 108014, 0.0, 0.0, 0.0, 8, 1, 1, 0, 382.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (40.0, 0, 0.0, 0, "神が住まう氷河の氷をもとに名工が\n何代もかけて研ぎ、刃と為した刀。\n絶対零度の刃は如何なる物質をも鋭\nく両断し、切断面を凍て付かせる。", 0.0, 0.0, 0.0, 0, 40000, 23.0, 0.0, 148, 108041, 0.0, 0.0, 0.0, 900, "氷雪刀グラキエッジ", 0.0, 0.0, 0.0, 108041, 0.0, 0.0, 0.0, 8, 1, 4, 0, 334.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (40.0, 0, 0.0, 0, "最強と謳われた武奏楽団に伝わる曲\n刀。一太刀ごとに鳴り響く風切り音\nが共鳴することで万物を断つ究極の\n刃となり装備者を勝利へと導く。", 0.0, 0.0, 0.0, 0, 40000, 16.0, 0.0, 154, 108042, 0.0, 0.0, 0.0, 900, "創音刀ゲルトナ", 0.0, 0.0, 0.0, 108042, 0.0, 0.0, 0.0, 8, 1, 4, 0, 356.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (50.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の曲刀。\n失われた技術で作られており湾曲し\nた刃の軌道はいかなる防御をも軽々\nとすり抜け相手の弱点を切り裂く。", 0.0, 0.0, 0.0, 0, 40000, 4.0, 0.0, 160, 108043, 0.0, 0.0, 0.0, 900, "クイックサンドシャムシール", 0.0, 0.0, 0.0, 108043, 0.0, 0.0, 0.0, 8, 1, 4, 0, 380.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (50.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した妖艶なる\n刀。斃した敵の血と命を吸い刀身と\n薔薇はより鮮やかに紅に染まる。", 0.0, 0.0, 0.0, 0, 40000, 4.0, 0.0, 166, 108044, 0.0, 0.0, 0.0, 900, "クルーエルローズブレード", 0.0, 0.0, 0.0, 108044, 0.0, 0.0, 0.0, 8, 1, 4, 0, 399.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "霊峰の断崖に生成され数百年を経た\n氷柱を刃とした短剣。風雪に晒され\n波打つ切っ先は的確に対象の弱点を\n捉え、凍えるような一撃を与える。", 0.0, 0.0, 0.0, 0, 40000, 30.0, 0.0, 148, 108071, 0.0, 0.0, 0.0, 500, "氷牙スティーリアダガー", 0.0, 0.0, 0.0, 108071, 0.0, 0.0, 0.0, 8, 1, 7, 0, 335.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "最強と謳われた武奏楽団に在籍した\n作曲家兼諜報員愛用の短剣。高度な\n静謐性は振るうたびに装備者の戦意\nと創作意欲を搔き立てるという。", 0.0, 0.0, 0.0, 0, 40000, 20.0, 0.0, 154, 108072, 0.0, 0.0, 0.0, 500, "刻音刃クレフトオン", 0.0, 0.0, 0.0, 108072, 0.0, 0.0, 0.0, 8, 1, 7, 0, 359.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の短剣。\n失われた技術で作られており超硬度\nで取り回しの良い諸刃が敵の急所を\n的確に突き致命の一撃を与える。", 0.0, 0.0, 0.0, 0, 40000, 5.0, 0.0, 160, 108073, 0.0, 0.0, 0.0, 900, "ダークデザートエッジ", 0.0, 0.0, 0.0, 108073, 0.0, 0.0, 0.0, 8, 1, 7, 0, 385.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した懐中の\n凶刃。美麗なる装飾が油断を誘い、\n隠された鋭き棘が敵を刺し穿つ。", 0.0, 0.0, 0.0, 0, 40000, 5.0, 0.0, 166, 108074, 0.0, 0.0, 0.0, 500, "ソーンオブローゼズ", 0.0, 0.0, 0.0, 108074, 0.0, 0.0, 0.0, 8, 1, 7, 0, 404.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "金剛石を遥かに凌ぐ硬度を持つとい\nう精霊氷から削り出された手甲。前\n腕を覆う氷塊が攻撃と共に冷気を放\nち対象を硬直させ確実に破壊する。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 148, 108101, 0.0, 0.0, 0.0, 500, "氷塊拳グラセナックル", 0.0, 0.0, 0.0, 108101, 0.0, 0.0, 0.0, 8, 1, 10, 0, 350.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "最強と謳われた武奏楽団の守護者で\nある拳士の愛用した手甲。拳の動き\nに合わせ張られた弦が共鳴し、曲を\n奏でているように聞こえたという。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 154, 108102, 0.0, 0.0, 0.0, 500, "叫鳴拳バイオラフィスト", 0.0, 0.0, 0.0, 108102, 0.0, 0.0, 0.0, 8, 1, 10, 0, 369.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の拳刃。\n失われた技術で作られており達人が\n用いれば徒手の延長の如く自在に\n強力な刺突を繰り出すことが可能。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 160, 108103, 0.0, 0.0, 0.0, 500, "ヘリテージジャマダハル", 0.0, 0.0, 0.0, 108103, 0.0, 0.0, 0.0, 8, 1, 10, 0, 388.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した貴人の籠\n手。紅拳刃の軌跡が薔薇の紋章を\n刻む時、如何なる敵も倒れ伏す。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 166, 108104, 0.0, 0.0, 0.0, 500, "ローズペタルナックル", 0.0, 0.0, 0.0, 108104, 0.0, 0.0, 0.0, 8, 1, 10, 0, 406.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "雪原大陸を分断するクレバスの壁面\nの巨大な氷から削り出した大弓。絶\n対の冷気を纏い、放たれた矢は降り\n注ぐ雹のように対象を貫く。", 0.0, 4.0, 0.0, 0, 40000, 14.0, 0.0, 148, 108131, 0.0, 0.0, 0.0, 900, "氷聖弓コンヘラシオン", 0.0, 0.0, 0.0, 108131, 0.0, 0.0, 0.0, 8, 1, 13, 0, 323.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "最強と謳われた武奏楽団で代々使わ\nれた弓。矢を放つと同時に鼓が共鳴\nし装備者のまわりに防護壁を展開、\n楽団員と観客たちを守ったという。", 0.0, 3.0, 0.0, 0, 40000, 10.0, 0.0, 154, 108132, 0.0, 0.0, 0.0, 900, "巧音弓スネアアーク", 0.0, 0.0, 0.0, 108132, 0.0, 0.0, 0.0, 8, 1, 13, 0, 349.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の大弓。\n失われた技術で作られており鋭い\n矢の一撃を放つ際の弦鳴により発生\nする不可視の風壁が装備者を包む。", 0.0, 2.0, 0.0, 0, 40000, 2.0, 0.0, 160, 108133, 0.0, 0.0, 0.0, 900, "オリエンタルハリケーンボウ", 0.0, 0.0, 0.0, 108133, 0.0, 0.0, 0.0, 8, 1, 13, 0, 377.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した必中の\n魔弓。この弓に狙われた者の胸元に\nは必ず大輪の鮮血の紅薔薇が咲く。", 0.0, 0.0, 0.0, 0, 40000, 4.0, 0.0, 166, 108134, 0.0, 0.0, 0.0, 900, "ベルアルクロゼ", 0.0, 0.0, 0.0, 108134, 0.0, 0.0, 0.0, 8, 1, 13, 0, 405.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "万年の雪嵐の中で削られ生成された\n尖氷を穂先とした槍。大自然の猛威\nで錬成された刃は高い殺傷能力で対\n象を完膚なきまでに破壊し尽くす。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 148, 108161, 0.0, 0.0, 0.0, 900, "氷穿槍スノーストーム", 0.0, 0.0, 0.0, 108161, 6.0, 0.0, 0.0, 8, 1, 16, 0, 320.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "最強と謳われた武奏楽団の前衛部隊\nで使われた重槍。複雑な変形機構を\n持ちながらも非常に堅固で、攻防を\n自在に切り替え敵を翻弄していた。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 154, 108162, 0.0, 0.0, 0.0, 1505, "仁重槍トロムスピア", 0.0, 0.0, 0.0, 108162, 5.0, 0.0, 0.0, 8, 1, 16, 0, 344.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の重槍。\n失われた技術で作られており特殊な\n形状の穂先で相手の攻撃を絡めとる\n鉄壁の立ち回りを実現している。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 160, 108163, 0.0, 0.0, 0.0, 500, "ウィンドレガシースピア", 0.0, 0.0, 0.0, 108163, 2.0, 0.0, 0.0, 8, 1, 16, 0, 378.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した騎神の\n豪槍。薔薇の花弁の如く重なり合う\n穂先は決して砕かれることはない。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 166, 108164, 0.0, 0.0, 0.0, 500, "ランスオブカローラ", 0.0, 0.0, 0.0, 108164, 2.0, 0.0, 0.0, 8, 1, 16, 0, 396.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (70.0, 0, 0.0, 0, "常時氷点下に湧き出づる霊泉に張る\n分厚い氷板を刃として使用した斧。\n頑健な刃は攻撃時に絶大な攻撃力を\n誇ると同時に盾としても機能する。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 148, 108191, 0.0, 0.0, 0.0, 500, "氷壊斧リオートアックス", 0.0, 0.0, 0.0, 108191, 0.0, 0.0, 0.0, 8, 1, 19, 0, 342.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (70.0, 0, 0.0, 0, "最強と謳われた武奏楽団の切り込み\n隊で使われた剛斧。装備者の発する\n熱が伝わることでどこまでも熱く、\n硬くなり必殺の一撃を放つという。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 154, 108192, 0.0, 0.0, 0.0, 500, "普天音斧バスターホルン", 0.0, 0.0, 0.0, 108192, 0.0, 0.0, 0.0, 8, 1, 19, 0, 361.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の大斧。\n失われた技術で作られており贅沢に\n使用された碧玉の効果で、装備者の\n腕力と生命力を大幅に引き上げる。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 160, 108193, 0.0, 0.0, 0.0, 500, "オアシスファアス", 0.0, 0.0, 0.0, 108193, 0.0, 0.0, 0.0, 8, 1, 19, 0, 376.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した破天の\n豪斧。薔薇の紋章の刻まれた厚刃は\n数多の戦場を経て真紅に染まる。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 166, 108194, 0.0, 0.0, 0.0, 900, "ローズクラッシャーアクス", 0.0, 0.0, 0.0, 108194, 0.0, 0.0, 0.0, 8, 1, 19, 0, 395.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "絶対零度下でのみ生成されるという\n特殊な氷結晶を核とした魔杖。強力\nな魔力増幅効果を持つが、それ故に\n取り扱いには困難を極めるという。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 148, 108221, 0.0, 322.0, 0.0, 500, "氷雪杖パーゴスワンド", 28.0, 0.0, 0.0, 108221, 0.0, 0.0, 0.0, 8, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "最強と謳われた武奏楽団の魔法使い\nのために作られた魔杖。魔力を込め\nて鍵盤を弾くことで、その調べに\n応じた天地万有の魔術を繰り出す。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 154, 108222, 0.0, 350.0, 0.0, 500, "絶対音杖アコーディア", 19.0, 0.0, 0.0, 108222, 0.0, 0.0, 0.0, 8, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の魔杖。\n失われた技術で作られており赤石内\nに刻まれた解析不能の古代術式が\n魔法の威力を爆発的に高める。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 160, 108223, 0.0, 382.0, 0.0, 500, "エンシェントサンドワンド", 6.0, 0.0, 0.0, 108223, 0.0, 0.0, 0.0, 8, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した破滅の魔\n杖。宝玉内で咲き誇る薔薇は精密に\n刻み込まれた立体魔法陣である。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 166, 108224, 0.0, 400.0, 0.0, 500, "ローズステイメンワンド", 6.0, 0.0, 0.0, 108224, 0.0, 0.0, 0.0, 8, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (270.0, 0, 0.0, 0, "峻厳な極寒地に自生する氷霊木の枝\nで造られた聖杖。極限環境で旺盛な\n生命力は杖の姿になっても変わらず\n生きているかの様に装備者を守る。", 0.0, 6.0, 0.0, 0, 40000, 0.0, 0.0, 148, 108251, 0.0, 265.0, 0.0, 500, "氷樹杖フロストスタッフ", 0.0, 0.0, 0.0, 108251, 5.0, 0.0, 0.0, 8, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (270.0, 0, 0.0, 0, "最強と謳われた武奏楽団の守護士が\n愛用していた杖。祈りを込めた息を\n吹き込むことで発生する癒しの領域\nがあらゆる障害から装備者を守る。", 0.0, 5.0, 0.0, 0, 40000, 0.0, 0.0, 154, 108252, 0.0, 293.0, 0.0, 500, "慈宣杖アルテマクラリオン", 0.0, 0.0, 0.0, 108252, 4.0, 0.0, 0.0, 8, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (270.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の短杖。\n失われた技術で作られており扇状の\n杖頭から輻射される神秘の波動が\n障壁を生成し、装備者を守護する。", 0.0, 3.0, 0.0, 0, 40000, 0.0, 0.0, 160, 108253, 0.0, 332.0, 0.0, 500, "デザートレインケーン", 0.0, 0.0, 0.0, 108253, 2.0, 0.0, 0.0, 8, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した不滅の\n魔杖。絡みつく茨の結界が装備者を\nいかなる危険からも守り抜く。", 0.0, 2.0, 0.0, 0, 40000, 0.0, 0.0, 166, 108254, 0.0, 352.0, 0.0, 500, "ローズピスティルスタッフ", 0.0, 0.0, 0.0, 108254, 2.0, 0.0, 0.0, 8, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説の名工が音楽の神の啓示を受け\n作成したとされる鎧。精緻かつ堅牢\nな造りで高い防御力と動きやすさを\n両立し後世の職人の手本とされた。", 0.0, 14.0, 0.0, 0, 40000, 17.0, 0.0, 153, 108281, 0.0, 0.0, 0.0, 900, "鍵盤奏鎧チェンバロン", 0.0, 0.0, 0.0, 108281, 11.0, 0.0, 0.0, 8, 1, 28, 0, 176.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の軽鎧。\n失われた技術で作られており華美な\n見た目ながら機動性と防御力が完璧\nなまでに両立された逸品である。", 0.0, 13.0, 0.0, 0, 40000, 9.0, 0.0, 159, 108282, 0.0, 0.0, 0.0, 1180, "デザートクロスメイル", 0.0, 0.0, 0.0, 108282, 8.0, 0.0, 0.0, 8, 1, 28, 0, 217.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した礼装鎧。\n女帝が纏うに相応しい麗しき紫華は\n装備者に覇道を歩む力を与える。", 0.0, 9.0, 0.0, 0, 40000, 9.0, 0.0, 165, 108283, 0.0, 0.0, 0.0, 900, "ローズエンプレスメイル", 0.0, 0.0, 0.0, 108283, 7.0, 0.0, 0.0, 8, 1, 28, 0, 259.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n鎧。こちらの世界では原理すら不明\nの技術で作られており装備者の潜在\n能力以上の力を無理やり引き出す。", 0.0, 9.0, 0.0, 0, 40000, 9.0, 0.0, 171, 108284, 0.0, 0.0, 0.0, 900, "デモンズペインメイル", 0.0, 0.0, 0.0, 108284, 9.0, 0.0, 0.0, 8, 1, 28, 0, 266.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (615.0, 0, 0.0, 0, "高名な楽器職人が尊敬する騎士へと\n献上するために作成した重鎧。鎧に\n受けた攻撃を音へと変換、拡散させ\n楽曲を奏でながら装備者を守る。", 0.0, 21.0, 0.0, 0, 40000, 0.0, 0.0, 153, 108311, 0.0, 0.0, 0.0, 900, "重奏鎧ブラスホーン", 0.0, 0.0, 0.0, 108311, 27.0, 0.0, 0.0, 8, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (1345.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の重鎧。\n失われた技術で作られており装備者\nを敵の攻撃のみならず過酷な砂漠の\n環境からも完璧に守り切るという。", 0.0, 20.0, 0.0, 0, 40000, 0.0, 0.0, 159, 108312, 0.0, 0.0, 0.0, 900, "オアシスブループレート", 0.0, 0.0, 0.0, 108312, 15.0, 0.0, 0.0, 8, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (1810.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した鉄壁の\n重鎧。女帝を守護する濃紫の大輪は\n何があっても散ることはない。", 0.0, 16.0, 0.0, 0, 40000, 0.0, 0.0, 165, 108313, 0.0, 0.0, 0.0, 900, "ローズデイムプレート", 0.0, 0.0, 0.0, 108313, 12.0, 0.0, 0.0, 8, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (1875.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n重鎧。こちらの世界では生成不可能\nな材質で作られており拘束具の如く\n装備者の全身を硬く覆ってしまう。", 0.0, 15.0, 0.0, 0, 40000, 0.0, 0.0, 171, 108314, 0.0, 0.0, 0.0, 900, "デモンズバインドアーマー", 0.0, 0.0, 0.0, 108314, 15.0, 0.0, 0.0, 8, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (320.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の衣服。\n失われた技術で作られており魔力が\n編み込まれた布地が装備者に過酷な\n環境下でも戦い抜く活力を与える。", 0.0, 9.0, 0.0, 0, 40000, 0.0, 0.0, 159, 108342, 0.0, 0.0, 0.0, 500, "デザートシェイドクロース", 0.0, 0.0, 0.0, 108342, 6.0, 0.0, 0.0, 8, 1, 34, 0, 216.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (320.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した神舞の\n装束。神の寵愛を受けた可憐な花冠\nが装備者を優しく包みこむという。", 0.0, 7.0, 0.0, 0, 40000, 0.0, 0.0, 165, 108343, 0.0, 0.0, 0.0, 500, "ローズプリエステスドレス", 0.0, 0.0, 0.0, 108343, 5.0, 0.0, 0.0, 8, 1, 34, 0, 248.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "歌姫としても高名だった魔術師が、\n舞台衣装としても愛用していた特別\nな魔装具。各部位に可憐に配された\n楽譜記号が装備者の魔力を高める。", 0.0, 9.0, 0.0, 0, 40000, 0.0, 0.0, 153, 108371, 0.0, 224.0, 0.0, 500, "譜唱装ムジカスコア", 10.0, 0.0, 0.0, 108371, 6.0, 0.0, 0.0, 8, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の法衣。\n失われた技術で作られており瀟洒な\n装飾には装備者の魔力を飛躍的に\n高める加護が施されているという。", 0.0, 6.0, 0.0, 0, 40000, 0.0, 0.0, 159, 108372, 0.0, 267.0, 0.0, 1180, "オリエントブリーズローブ", 5.0, 0.0, 0.0, 108372, 5.0, 0.0, 0.0, 8, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した魔法の\nドレス。妖艶なる紅花弁は鋭い棘の\n如き魔力を放ち鮮やかに敵を貫く。", 0.0, 6.0, 0.0, 0, 40000, 0.0, 0.0, 165, 108373, 0.0, 284.0, 0.0, 900, "ローズバロネスドレス", 5.0, 0.0, 0.0, 108373, 5.0, 0.0, 0.0, 8, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\nローブ。こちらの世界では解析不能\nな製法で作られており、装備したが\n最後、永遠に魔力を放ち続ける。", 0.0, 6.0, 0.0, 0, 40000, 0.0, 0.0, 171, 108374, 0.0, 296.0, 0.0, 900, "カースドデモンズローブ", 5.0, 0.0, 0.0, 108374, 6.0, 0.0, 0.0, 8, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (260.0, 0, 0.0, 0, "高名な演奏家でもあった戦士愛用の\n円盾。攻撃を受け止めるたびに鳴り\n響く壮麗な音色が装備者を鼓舞し、\nその秘めたる力を解放させる。", 0.0, 13.0, 0.0, 0, 40000, 0.0, 0.0, 153, 108401, 0.0, 0.0, 0.0, 900, "重円奏ホプロンシンバル", 0.0, 0.0, 0.0, 108401, 13.0, 0.0, 0.0, 8, 1, 40, 0, 150.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (260.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した不壊の\n大盾。青薔薇の紋章が示す通り奇跡\nの如き硬度であらゆる攻撃を弾く。", 0.0, 13.0, 0.0, 0, 40000, 0.0, 0.0, 165, 108403, 0.0, 0.0, 0.0, 500, "ブルーローズシールド", 0.0, 0.0, 0.0, 108403, 13.0, 0.0, 0.0, 8, 1, 40, 0, 185.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "神々に剣舞を奉納する戦士のために\n作られた踵の高い靴。動く度に弦が\n鳴り響くことで勇猛な音色を奏で、\n装備者の戦意を高揚させるという。", 0.0, 9.0, 0.0, 0, 40000, 0.0, 0.0, 153, 108431, 0.0, 0.0, 0.0, 500, "舞奉奏アルパンプス", 0.0, 0.0, 0.0, 108431, 6.0, 0.0, 0.0, 8, 1, 43, 0, 234.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n具足。こちらの世界では再現不能な\nほど精密に作られており装備者の\n制御を超える脚力を与えてしまう。", 0.0, 5.0, 0.0, 0, 40000, 0.0, 0.0, 171, 108434, 0.0, 0.0, 0.0, 500, "ディアブロスカルペ", 0.0, 0.0, 0.0, 108434, 5.0, 0.0, 0.0, 8, 1, 43, 0, 311.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (460.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の靴。\n失われた技術で作られており靴底に\n刻まれた文様が地脈の力を集めて、\n装備者に膨大な魔力を与える。", 0.0, 9.0, 0.0, 0, 40000, 0.0, 0.0, 159, 108462, 0.0, 200.0, 0.0, 500, "オアシスアハルディア", 0.0, 0.0, 0.0, 108462, 6.0, 0.0, 0.0, 8, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (525.0, 0, 0.0, 0, "砂漠の遺都で発見された幻の巻布。\n失われた技術で作られており大気中\nに漂う自然のエネルギーを集積し、\n装備者の生命力へと変換する。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 159, 108492, 0.0, 0.0, 0.0, 500, "デザートウィンドターバン", 0.0, 0.0, 0.0, 108492, 0.0, 0.0, 0.0, 8, 1, 49, 0, 267.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (525.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n額冠。こちらの世界では存在しない\n生物の素材を使用しており装備者は\n内なる獣性を引き出されてしまう。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 171, 108494, 0.0, 0.0, 0.0, 500, "バリアントデモンズホーン", 0.0, 0.0, 0.0, 108494, 0.0, 0.0, 0.0, 8, 1, 49, 0, 302.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "数百年に渡り受け継がれ奏でられ続\nけたタンバリンから作られた帽子。\n叩かれる度に防御力と共に装着者の\nボルテージと魔力も高まってゆく。", 0.0, 8.0, 0.0, 0, 40000, 0.0, 0.0, 153, 108521, 0.0, 239.0, 0.0, 500, "魔奏帽タンバリンキャスケット", 0.0, 0.0, 0.0, 108521, 6.0, 0.0, 0.0, 8, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した魔装の\n帽子。波打つ花弁の如きブリムが\n装備者を護り集中力を研ぎ澄ます。", 0.0, 8.0, 0.0, 0, 40000, 0.0, 0.0, 165, 108523, 0.0, 274.0, 0.0, 500, "薔薇術士の魔宴帽", 0.0, 0.0, 0.0, 108523, 6.0, 0.0, 0.0, 8, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n帽子。こちらの世界で未発見の術式\nが組み込まれており装備者の魔力を\n限界を超えるまで高めてしまう。", 0.0, 5.0, 0.0, 0, 40000, 0.0, 0.0, 171, 108524, 0.0, 311.0, 0.0, 500, "エンヴィデモンズホーン", 0.0, 0.0, 0.0, 108524, 5.0, 0.0, 0.0, 8, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "大雪原の最奥に佇む氷狼の顎と呼ば\nれる大洞窟の入り口にできた氷柱か\nら生成された指輪。猛々しい狼の如\nき攻撃衝動を呼び覚ます。", 0.0, 0.0, 0.0, 0, 40000, 15.0, 0.0, 150, 108551, 0.0, 0.0, 0.0, 500, "アイスピラーリング", 0.0, 0.0, 0.0, 108551, 0.0, 0.0, 0.0, 8, 1, 55, 0, 286.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "楽神の啓示を受け作られた木製の耳\n飾り。装備者の動きに合わせて鳴り\n響く木の音色が、内なる野生を呼び\n覚まし闘争本能を高めるという。", 0.0, 0.0, 0.0, 0, 40000, 9.0, 0.0, 156, 108552, 0.0, 0.0, 0.0, 500, "琴樹奏シロフォニア", 0.0, 0.0, 0.0, 108552, 0.0, 0.0, 0.0, 8, 1, 55, 0, 308.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "砂漠の遺都で発見された峻烈たる\n腕輪。失われた技術で作られており\n砂漠を灼く烈日の加護が装備者の\n生存本能と闘争心を掻き立てる。", 0.0, 0.0, 0.0, 0, 40000, 9.0, 0.0, 162, 108553, 0.0, 0.0, 0.0, 500, "エンシェントルビー", 0.0, 0.0, 0.0, 108553, 0.0, 0.0, 0.0, 8, 1, 55, 0, 327.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した紅薔薇の\nペンダント。情熱の赤き花が装備者\nの胸に尽きない闘争心を咲かせる。", 0.0, 0.0, 0.0, 0, 40000, 9.0, 0.0, 168, 108554, 0.0, 0.0, 0.0, 500, "ローズルージュペンダント", 0.0, 0.0, 0.0, 108554, 0.0, 0.0, 0.0, 8, 1, 55, 0, 345.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (295.0, 0, 0.0, 0, "極点の夜空を彩るオーロラの淡光を\n結晶化させた指輪。大自然の雄威は\n装備者の生命力を高め如何なる天災\nからも生還させると言われている。", 0.0, 26.0, 0.0, 0, 40000, 0.0, 0.0, 150, 108581, 0.0, 0.0, 0.0, 500, "グリーンオーロラリング", 0.0, 0.0, 0.0, 108581, 26.0, 0.0, 0.0, 8, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (455.0, 0, 0.0, 0, "楽神の啓示を受け作られた金属製の\n小さな太鼓の耳飾り。絶えず鳴り続\nける太鼓の音色が装備者を鼓舞し、\n強き生命力と不壊の加護を与える。", 0.0, 26.0, 0.0, 0, 40000, 0.0, 0.0, 156, 108582, 0.0, 0.0, 0.0, 500, "仙撞鼓ティンパニア", 0.0, 0.0, 0.0, 108582, 26.0, 0.0, 0.0, 8, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (545.0, 0, 0.0, 0, "砂漠の遺都で発見された荘厳なる\n腕輪。失われた技術で作られており\nかつて大地を覆っていた雄大な緑の\n生命力を今なお装備者に与える。", 0.0, 27.0, 0.0, 0, 40000, 0.0, 0.0, 162, 108583, 0.0, 0.0, 0.0, 500, "エンシェントエメラルド", 0.0, 0.0, 0.0, 108583, 27.0, 0.0, 0.0, 8, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (620.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した翠薔薇の\nペンダント。壮麗な緑の花が装備者\nの生命力を育み、その身を護る。", 0.0, 28.0, 0.0, 0, 40000, 0.0, 0.0, 168, 108584, 0.0, 0.0, 0.0, 500, "ローズベルテペンダント", 0.0, 0.0, 0.0, 108584, 28.0, 0.0, 0.0, 8, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "万年に一度、花咲くといわれる氷華\nの花を元に作成された指輪。特殊な\n結晶配列により繊細な扱いを要する\nが装備者の魔力を極限まで高める。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 150, 108611, 0.0, 281.0, 0.0, 500, "雪華晶の指輪", 12.0, 0.0, 0.0, 108611, 0.0, 0.0, 0.0, 8, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "楽神の啓示を受け作られた超小型の\n譜面帖。天上の神々の音曲が記され\nており装備者に溢れんばかりの霊感\nと尽きることのない魔力を与える。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 156, 108612, 0.0, 305.0, 0.0, 500, "神謡譜デミスコア", 7.0, 0.0, 0.0, 108612, 0.0, 0.0, 0.0, 8, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "砂漠の遺都で発見された清凛たる\n腕輪。失われた技術で作られており\n涼やかな霊水の加護がいかなる環境\n下でも安定した魔力を供給する。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 162, 108613, 0.0, 324.0, 0.0, 500, "エンシェントサファイア", 7.0, 0.0, 0.0, 108613, 0.0, 0.0, 0.0, 8, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ある帝国の神話に魅入られた職人が\n神器を再現すべく作成した蒼薔薇の\nペンダント。怜悧な青き花が装備者\nの魔法の才を強制的に開花させる。", 0.0, 0.0, 0.0, 0, 40000, 0.0, 0.0, 168, 108614, 0.0, 343.0, 0.0, 500, "ラピスローズペンダント", 7.0, 0.0, 0.0, 108614, 0.0, 0.0, 0.0, 8, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n剣。こちらの世界の物理法則を無視\nするように、軽く振っただけの攻撃\nを必殺の一撃へ変えてしまう。", 0.0, 0.0, 0.0, 0, 42000, 3.0, 0.0, 172, 109011, 0.0, 0.0, 0.0, 500, "デモンヴィクティムソード", 0.0, 0.0, 0.0, 109011, 0.0, 0.0, 0.0, 9, 1, 1, 0, 420.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "伝説と謳われた調理師旅団で使用\nされていた剣。フライ返しのような\nスリットにより如何なる物体も張り\n付くことなく華麗に切り分ける。", 0.0, 0.0, 0.0, 0, 42000, 3.0, 0.0, 178, 109012, 0.0, 0.0, 0.0, 500, "秘剣訃雷返し", 0.0, 0.0, 0.0, 109012, 0.0, 0.0, 0.0, 9, 1, 1, 0, 439.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の各船\nに一本ずつ備え付けられた巨剣。\n有事には折れたマストの代わりに\n使われるほどの頑健さを誇る。", 0.0, 0.0, 0.0, 0, 42000, 3.0, 0.0, 184, 109013, 0.0, 0.0, 0.0, 500, "バリアントマスト", 0.0, 0.0, 0.0, 109013, 0.0, 0.0, 0.0, 9, 1, 1, 0, 457.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した巨大な剣。壁の\n如き幅を誇り一度構えれば根を張る\n大樹の生命力を宿すことができる。", 0.0, 0.0, 0.0, 0, 42000, 3.0, 0.0, 190, 109014, 0.0, 0.0, 0.0, 500, "皇蓉楓刃", 0.0, 0.0, 0.0, 109014, 0.0, 0.0, 0.0, 9, 1, 1, 0, 476.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (50.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n刀。こちらの世界では存在しえない\n斬れ味の刀身は、保護するための鞘\nですら容易く切り裂いてしまう。", 0.0, 0.0, 0.0, 0, 42000, 5.0, 0.0, 172, 109041, 0.0, 0.0, 0.0, 900, "デモンズスカーブレード", 0.0, 0.0, 0.0, 109041, 0.0, 0.0, 0.0, 9, 1, 4, 0, 436.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (50.0, 0, 0.0, 0, "伝説と謳われた調理師旅団で使用\nされていた包丁。トーゴクの刀鍛冶\nによる大業物で、巨大なトゥンヌス\nを一瞬で捌くほどの切れ味を誇る。", 0.0, 0.0, 0.0, 0, 42000, 5.0, 0.0, 178, 109042, 0.0, 0.0, 0.0, 800, "刺身刀・匠八", 0.0, 0.0, 0.0, 109042, 0.0, 0.0, 0.0, 9, 1, 4, 0, 454.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (50.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の船員\nたちが刀を改造してつくった釣竿。\n後付けされた針と糸が思わぬ軌道を\n描き敵の隙を釣りだすという。", 0.0, 0.0, 0.0, 0, 42000, 5.0, 0.0, 184, 109043, 0.0, 0.0, 0.0, 800, "フィッシャーマンズソード", 0.0, 0.0, 0.0, 109043, 0.0, 0.0, 0.0, 9, 1, 4, 0, 473.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (50.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した刀。その鋭い剣閃\nは秋風の如き優美さで立ち塞がる者\n全ての視界を紅に染め上げる。", 0.0, 0.0, 0.0, 0, 42000, 5.0, 0.0, 190, 109044, 0.0, 0.0, 0.0, 800, "大業物・紅一文字", 0.0, 0.0, 0.0, 109044, 0.0, 0.0, 0.0, 9, 1, 4, 0, 492.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n短剣。こちらの世界では製造不可能\nな形状の刃でつけた傷は、決して\n癒えることなく相手を苛み続ける。", 0.0, 0.0, 0.0, 0, 42000, 5.0, 0.0, 172, 109071, 0.0, 0.0, 0.0, 500, "豪魔ノ爪刃", 0.0, 0.0, 0.0, 109071, 0.0, 0.0, 0.0, 9, 1, 7, 0, 442.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説と謳われた調理師旅団で使用\nされていた小型ナイフ。一見すると\n食器のような装飾を施されているが\n硬い鎧もバターのように切り裂く。", 0.0, 0.0, 0.0, 0, 42000, 5.0, 0.0, 178, 109072, 0.0, 0.0, 0.0, 500, "クト・ドフィス", 0.0, 0.0, 0.0, 109072, 0.0, 0.0, 0.0, 9, 1, 7, 0, 460.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の上陸\n部隊に支給された短剣。強力な発光\n機能を有し、信号を送るだけでなく\n戦闘時敵の視界を奪うことも可能。", 0.0, 0.0, 0.0, 0, 42000, 5.0, 0.0, 184, 109073, 0.0, 0.0, 0.0, 500, "大灯刃アレキサンドリア", 0.0, 0.0, 0.0, 109073, 0.0, 0.0, 0.0, 9, 1, 7, 0, 479.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した短刀。舞い散る葉\nの如く不規則に踊る斬撃はわずかな\n隙へ秋風のように吹き込んでいく。", 0.0, 0.0, 0.0, 0, 42000, 5.0, 0.0, 190, 109074, 0.0, 0.0, 0.0, 500, "襲楓裂爪・葉", 0.0, 0.0, 0.0, 109074, 0.0, 0.0, 0.0, 9, 1, 7, 0, 497.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n手甲。こちらの世界とは異なる次元\nに存在しており、如何なる防御をも\nすり抜け急所を確実に狙える。", 0.0, 0.0, 0.0, 0, 42000, 7.0, 0.0, 172, 109101, 0.0, 0.0, 0.0, 500, "デモンパニッシュフィスト", 0.0, 0.0, 0.0, 109101, 0.0, 0.0, 0.0, 9, 1, 10, 0, 440.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説と謳われた調理師旅団で使用\nされていたヤカン。補充した液体に\nより性能を変化させ、客と味方には\n癒しを、敵には重い一撃を与える。", 0.0, 0.0, 0.0, 0, 42000, 7.0, 0.0, 178, 109102, 0.0, 0.0, 0.0, 500, "鉄観音五百薬缶", 0.0, 0.0, 0.0, 109102, 0.0, 0.0, 0.0, 9, 1, 10, 0, 459.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の初代\n船長愛用の鉤爪。荒々しさと獰猛さ\nを宿した見た目は、かつての私掠船\n時代の名残を今に伝えている。", 0.0, 0.0, 0.0, 0, 42000, 7.0, 0.0, 184, 109103, 0.0, 0.0, 0.0, 500, "海賊王の義手", 0.0, 0.0, 0.0, 109103, 0.0, 0.0, 0.0, 9, 1, 10, 0, 478.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した籠手。鮮烈な紅は\n装いではなく警戒色であり、触れた\n物全てを等しく砕き、朽ちさせる。", 0.0, 0.0, 0.0, 0, 42000, 7.0, 0.0, 190, 109104, 0.0, 0.0, 0.0, 500, "紅蛙手甲・拳楓", 0.0, 0.0, 0.0, 109104, 0.0, 0.0, 0.0, 9, 1, 10, 0, 496.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n弓。こちらの世界では未確認の自在\nに動く素材で作られ、時折装備者を\n捕食するような動きを見せる。", 0.0, 1.0, 0.0, 0, 42000, 4.0, 0.0, 172, 109131, 0.0, 0.0, 0.0, 900, "ディアブロマッシェーラ", 0.0, 0.0, 0.0, 109131, 1.0, 0.0, 0.0, 9, 1, 13, 0, 432.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説と謳われた調理師旅団で使用\nされていた弓。シリンジに充填した\n液体を発射することもでき、巨大な\nケーキすらデコレート可能である。", 0.0, 1.0, 0.0, 0, 42000, 4.0, 0.0, 178, 109132, 0.0, 0.0, 0.0, 800, "スクィーザーボウ", 0.0, 0.0, 0.0, 109132, 1.0, 0.0, 0.0, 9, 1, 13, 0, 451.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の射手\nたちが使用する石弓。通常の矢だけ\nでなく漁に使う銛も装填可能で長い\n船上生活での必需品となっている。", 0.0, 1.0, 0.0, 0, 42000, 4.0, 0.0, 184, 109133, 0.0, 0.0, 0.0, 800, "セイリングシューター", 0.0, 0.0, 0.0, 109133, 1.0, 0.0, 0.0, 9, 1, 13, 0, 469.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した弓。弦に使われる\n蔦の捻じれが矢の軌道を複雑なもの\nへ変えてしまうため熟練を要する。", 0.0, 1.0, 0.0, 0, 42000, 4.0, 0.0, 190, 109134, 0.0, 0.0, 0.0, 800, "錦秋弓蔦紅葉", 0.0, 0.0, 0.0, 109134, 1.0, 0.0, 0.0, 9, 1, 13, 0, 488.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n槍。こちらの世界では解明不能な\n力場を纏っており、装備者は操られ\nているような感覚に陥るという。", 0.0, 2.0, 0.0, 0, 42000, 0.0, 0.0, 172, 109161, 0.0, 0.0, 0.0, 500, "デビルドミニオンランス", 0.0, 0.0, 0.0, 109161, 2.0, 0.0, 0.0, 9, 1, 16, 0, 424.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説と謳われた調理師旅団で使用\nされていた槍。高級食器の如く手に\nなじみ突く斬る巻き取る等、まるで\n手の延長のように繊細に扱える。", 0.0, 2.0, 0.0, 0, 42000, 0.0, 0.0, 178, 109162, 0.0, 0.0, 0.0, 800, "ランスオブフォルセッタ", 0.0, 0.0, 0.0, 109162, 2.0, 0.0, 0.0, 9, 1, 16, 0, 443.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の脱出\n用の小舟に備え付けられたオール。\n鍛えられた船員たちにかかれば取り\n外して槍として使うことも容易い。", 0.0, 2.0, 0.0, 0, 42000, 0.0, 0.0, 184, 109163, 0.0, 0.0, 0.0, 500, "ツインオールランス", 0.0, 0.0, 0.0, 109163, 2.0, 0.0, 0.0, 9, 1, 16, 0, 461.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した槍。傘としての\n機能を持たせた結果開くことで如何\nなる攻撃をも防ぐことができる。", 0.0, 2.0, 0.0, 0, 42000, 0.0, 0.0, 190, 109164, 0.0, 0.0, 0.0, 500, "天傘紅槍アキサメ", 0.0, 0.0, 0.0, 109164, 2.0, 0.0, 0.0, 9, 1, 16, 0, 480.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n斧。こちらの世界には存在しない超\n高密度素材で非常に重いのだが、\n片手で使用されていた形跡がある。", 0.0, 0.0, 0.0, 0, 42000, 3.0, 0.0, 172, 109191, 0.0, 0.0, 0.0, 900, "デモンズデストラクション", 0.0, 0.0, 0.0, 109191, 0.0, 0.0, 0.0, 9, 1, 19, 0, 431.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "伝説と謳われた調理師旅団で使用\nされていた鈍器。巨大な魔物の肉を\n柔らかくする器具だが調理場だけで\nなく戦場でも猛威を振るった。", 0.0, 0.0, 0.0, 0, 42000, 3.0, 0.0, 178, 109192, 0.0, 0.0, 0.0, 500, "ミートマレットアクス", 0.0, 0.0, 0.0, 109192, 0.0, 0.0, 0.0, 9, 1, 19, 0, 450.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の剛力\n自慢たちが振るう大錨。一度振るわ\nれれば敵だけではなく大嵐でさえも\n抑え込み船団に安寧をもたらす。", 0.0, 0.0, 0.0, 0, 42000, 3.0, 0.0, 184, 109193, 0.0, 0.0, 0.0, 800, "豪斧大抜錨", 0.0, 0.0, 0.0, 109193, 0.0, 0.0, 0.0, 9, 1, 19, 0, 469.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (100.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した大槌。神木から\n削り出された頭は、振り上げる際は\n軽く、振り下ろす際は重くなる。", 0.0, 0.0, 0.0, 0, 42000, 3.0, 0.0, 190, 109194, 0.0, 0.0, 0.0, 800, "撃槌ツルベオトシ", 0.0, 0.0, 0.0, 109194, 0.0, 0.0, 0.0, 9, 1, 19, 0, 487.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n呪杖。こちらの世界では精製不可能\nな結晶化した魔力が、装備者の許容\n限界を無視して流れ込んでゆく。", 0.0, 0.0, 0.0, 0, 42000, 0.0, 0.0, 172, 109221, 0.0, 438.0, 0.0, 500, "デモンズコアワンド", 6.0, 0.0, 0.0, 109221, 0.0, 0.0, 0.0, 9, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説と謳われた調理師旅団で使用\nされていたサーバー。優れた魔力\n伝達力を持ち、狙った相手に確実に\n破壊やスイーツを配ったという。", 0.0, 0.0, 0.0, 0, 42000, 0.0, 0.0, 178, 109222, 0.0, 457.0, 0.0, 500, "ペール・ア・タルテ", 6.0, 0.0, 0.0, 109222, 0.0, 0.0, 0.0, 9, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の砲撃\n担当の船員が持つ杖。魔力を使用し\n船と感覚を共有することにより精密\nな艦砲攻撃を行うことができる。", 0.0, 0.0, 0.0, 0, 42000, 0.0, 0.0, 184, 109223, 0.0, 475.0, 0.0, 500, "ステアリングホイーラー", 6.0, 0.0, 0.0, 109223, 0.0, 0.0, 0.0, 9, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した錫杖。樹齢千年を\n超える銀杏の古木から削り出され、\n強力な破魔の力を内に秘めている。", 0.0, 0.0, 0.0, 0, 42000, 0.0, 0.0, 190, 109224, 0.0, 494.0, 0.0, 500, "公孫樹杖・銀天", 6.0, 0.0, 0.0, 109224, 0.0, 0.0, 0.0, 9, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n杖。こちらの世界では解読不可能な\n上位存在の名らしきものが刻まれ、\n正体不明の法術が施されている。", 0.0, 2.0, 0.0, 0, 42000, 0.0, 0.0, 172, 109251, 0.0, 390.0, 0.0, 500, "ロッドオブデモンズハート", 0.0, 0.0, 0.0, 109251, 2.0, 0.0, 0.0, 9, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "伝説と謳われた調理師旅団で使用\nされていたお玉。あらゆる物を掬い\nとるその力で戦場でも癒しを配り、\n多くの客と仲間を救ったという。", 0.0, 2.0, 0.0, 0, 42000, 0.0, 0.0, 178, 109252, 0.0, 409.0, 0.0, 500, "マジカルレードルスタッフ", 0.0, 0.0, 0.0, 109252, 2.0, 0.0, 0.0, 9, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の救助\n担当の船員たちが持つ浮輪。まるで\n意志を持つかのように要救助者の元\nへたどり着き、脅威から守りぬく。", 0.0, 2.0, 0.0, 0, 42000, 0.0, 0.0, 184, 109253, 0.0, 428.0, 0.0, 500, "シーバードフローター", 0.0, 0.0, 0.0, 109253, 2.0, 0.0, 0.0, 9, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した玉串。連なる紙垂\nは生きた枝垂れ紅葉であり、生命力\nに溢れた神域を為す神木である。", 0.0, 2.0, 0.0, 0, 42000, 0.0, 0.0, 190, 109254, 0.0, 446.0, 0.0, 500, "紅葉巫女之枝垂串", 0.0, 0.0, 0.0, 109254, 2.0, 0.0, 0.0, 9, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説と謳われた調理師旅団の制式\n軽鎧。何時いかなる場所でもベスト\nな調理パフォーマンスを発揮できる\nよう精緻な調整が施されている。", 0.0, 10.0, 0.0, 0, 42000, 9.0, 0.0, 177, 109281, 0.0, 0.0, 0.0, 800, "エプロンライトメイル", 0.0, 0.0, 0.0, 109281, 10.0, 0.0, 0.0, 9, 1, 28, 0, 291.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の勇敢\nなる水兵たちの制服。過酷な環境\nでも身軽に動けるよう最新の技術と\n最高の素材を用いて作成された。", 0.0, 10.0, 0.0, 0, 42000, 9.0, 0.0, 183, 109282, 0.0, 0.0, 0.0, 800, "ライトセイラークロス", 0.0, 0.0, 0.0, 109282, 10.0, 0.0, 0.0, 9, 1, 28, 0, 308.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した振袖。動きやすさ\nを極限まで追求し染上げられた紅葉\nが舞い踊るが如く敵を翻弄できる。", 0.0, 10.0, 0.0, 0, 42000, 9.0, 0.0, 189, 109283, 0.0, 0.0, 0.0, 800, "恋染紅葉秋模様", 0.0, 0.0, 0.0, 109283, 10.0, 0.0, 0.0, 9, 1, 28, 0, 325.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天界より遣わされた戦士たちが身に\nまとっていた鎧。眩き光の加護が\n装備者の潜在能力を引き出し、神話\nに謳われた英傑の如き力を与える。", 0.0, 10.0, 0.0, 0, 42000, 9.0, 0.0, 195, 109284, 0.0, 0.0, 0.0, 800, "アーマーオブパワー", 0.0, 0.0, 0.0, 109284, 10.0, 0.0, 0.0, 9, 1, 28, 0, 342.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (2090.0, 0, 0.0, 0, "伝説と謳われた調理師旅団の制式\n重鎧。その防御力と安定性により\n何時いかなる場所でもまるで厨房に\nいるような感覚で調理可能となる。", 0.0, 16.0, 0.0, 0, 42000, 0.0, 0.0, 177, 109311, 0.0, 0.0, 0.0, 800, "アーマー・デ・タブリエ", 0.0, 0.0, 0.0, 109311, 16.0, 0.0, 0.0, 9, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (2155.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の勇猛\nなる甲板員たちの制服。仲間と船を\n守るためかなりの重装ではあるが、\n着衣のまま泳ぐことも可能である。", 0.0, 17.0, 0.0, 0, 42000, 0.0, 0.0, 183, 109312, 0.0, 0.0, 0.0, 800, "ヘビーマリナークロス", 0.0, 0.0, 0.0, 109312, 17.0, 0.0, 0.0, 9, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (2220.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した武者鎧。厳つさと\n華やかさを両立させた威容に、敵対\nする者さえ落葉の如く頭を垂れる。", 0.0, 18.0, 0.0, 0, 42000, 0.0, 0.0, 189, 109313, 0.0, 0.0, 0.0, 800, "唐紅姫武将大鎧", 0.0, 0.0, 0.0, 109313, 18.0, 0.0, 0.0, 9, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (2370.0, 0, 0.0, 0, "天界より遣わされた戦士たちが身に\nまとっていた重鎧。強力な光の加護\nが付与されており邪悪な心を持つ者\nは近づくことさえできないという。", 0.0, 18.0, 0.0, 0, 42000, 0.0, 0.0, 195, 109314, 0.0, 0.0, 0.0, 800, "メイルオブヴァーチャー", 0.0, 0.0, 0.0, 109314, 18.0, 0.0, 0.0, 9, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (320.0, 0, 0.0, 0, "伝説と謳われた調理師旅団の制服。\n職人により作り込まれた機能性で\n何時いかなる場所でも厨房にいるか\nのような繊細な調理が可能である。", 0.0, 5.0, 0.0, 0, 42000, 0.0, 0.0, 177, 109341, 0.0, 0.0, 0.0, 500, "ベテランシェフクロス", 0.0, 0.0, 0.0, 109341, 5.0, 0.0, 0.0, 9, 1, 34, 0, 309.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (320.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した装束。敏捷性向上\nに特化され、敵の視界には舞い散る\n紅葉が如き残像しか映さない。", 0.0, 5.0, 0.0, 0, 42000, 0.0, 0.0, 189, 109343, 0.0, 0.0, 0.0, 500, "秋風裂装・紅", 0.0, 0.0, 0.0, 109343, 5.0, 0.0, 0.0, 9, 1, 34, 0, 344.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説と謳われた調理師旅団の制服。\nその可憐で瀟洒な装いは、装備者に\n何時いかなる場所でも決して崩れぬ\nもてなしの精神を与えるという。", 0.0, 8.0, 0.0, 0, 42000, 0.0, 0.0, 177, 109371, 0.0, 310.0, 0.0, 500, "プロウェイトレスエプロン", 5.0, 0.0, 0.0, 109371, 8.0, 0.0, 0.0, 9, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の頭脳\nたる幹部の制服。運動性能を著しく\n上げることはないが、鮮やかな色彩\nで後方からでも仲間を鼓舞できる。", 0.0, 8.0, 0.0, 0, 42000, 0.0, 0.0, 183, 109372, 0.0, 328.0, 0.0, 500, "シーナビゲイタークロス", 5.0, 0.0, 0.0, 109372, 8.0, 0.0, 0.0, 9, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した法衣。礼装を下地\nにトーゴク風にアレンジされており\n優美さと実用性を両立している。", 0.0, 8.0, 0.0, 0, 42000, 0.0, 0.0, 189, 109373, 0.0, 345.0, 0.0, 800, "姫法師秋草装", 5.0, 0.0, 0.0, 109373, 8.0, 0.0, 0.0, 9, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天界より遣わされた戦士たちが身に\nまとっていた法衣。背部の羽が周囲\nの魔力を吸収し、装備者に神々の\n代行者として無限の力を与える。", 0.0, 8.0, 0.0, 0, 42000, 0.0, 0.0, 195, 109374, 0.0, 362.0, 0.0, 800, "ローブオブドミニオン", 5.0, 0.0, 0.0, 109374, 8.0, 0.0, 0.0, 9, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (260.0, 0, 0.0, 0, "伝説と謳われた調理師旅団の制式\n軽装盆盾。何時いかなる場所でも\n変わらない白くエレガントな輝きが\nあらゆる攻撃とオーダーを捌く。", 0.0, 15.0, 0.0, 0, 42000, 0.0, 0.0, 177, 109401, 0.0, 0.0, 0.0, 800, "ハイシールドソーサー", 0.0, 0.0, 0.0, 109401, 15.0, 0.0, 0.0, 9, 1, 40, 0, 216.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (260.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の神業\n的な技術を誇る操舵手が用いる巨大\nな盾。圧倒的な強度を誇り、操舵輪\nが破損した時の代用にもなる逸品。", 0.0, 15.0, 0.0, 0, 42000, 0.0, 0.0, 183, 109402, 0.0, 0.0, 0.0, 800, "エスクード・デ・ボランテ", 0.0, 0.0, 0.0, 109402, 15.0, 0.0, 0.0, 9, 1, 40, 0, 233.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "未知の大陸を目指す調査船団で支給\nされている甲板用の靴。装備者に\n揺れや濡れをものともしない、平地\n以上の安定性を与えてくれる。", 0.0, 5.0, 0.0, 0, 42000, 0.0, 0.0, 183, 109432, 0.0, 0.0, 0.0, 500, "ウォーターラインランナー", 0.0, 0.0, 0.0, 109432, 5.0, 0.0, 0.0, 9, 1, 43, 0, 363.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天界より遣わされた戦士たちが身に\nまとっていた靴。神々の祝福が付与\nされており、装備者は自らの重さ\nを感じずに飛ぶように舞い踊る。", 0.0, 6.0, 0.0, 0, 42000, 0.0, 0.0, 195, 109434, 0.0, 0.0, 0.0, 500, "ヒールオブプリンシパリティ", 0.0, 0.0, 0.0, 109434, 6.0, 0.0, 0.0, 9, 1, 43, 0, 387.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (460.0, 0, 0.0, 0, "伝説と謳われた調理師旅団の制式\n魔法靴。匂い立つ紅茶の香りが精神\nを落ち着かせ何時いかなる場所でも\n安定した魔力供給を可能とする。", 0.0, 4.0, 0.0, 0, 42000, 0.0, 0.0, 177, 109461, 0.0, 304.0, 0.0, 500, "タッサ・タロン", 0.0, 0.0, 0.0, 109461, 4.0, 0.0, 0.0, 9, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (460.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した履物。ヒール内に\n紅葉に似た魔術紋様が描かれており\n美観と魔力双方を高く底上げする。", 0.0, 4.0, 0.0, 0, 42000, 0.0, 0.0, 189, 109463, 0.0, 338.0, 0.0, 500, "鳴降遊靴アキヨナガ", 0.0, 0.0, 0.0, 109463, 4.0, 0.0, 0.0, 9, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (525.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した笠。竹笠に大兜の\n意匠と性能を組み込んだ意欲作。\n紅葉も魔物も気軽に狩れると人気。", 0.0, 0.0, 0.0, 0, 42000, 0.0, 0.0, 189, 109493, 0.0, 0.0, 0.0, 500, "秋天紅兜アキシグレ", 0.0, 0.0, 0.0, 109493, 0.0, 0.0, 0.0, 9, 1, 49, 0, 371.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (525.0, 0, 0.0, 0, "天界より遣わされた戦士たちが身に\nまとっていた額冠。羽に込められた\n上級天使の加護が装備者を一時的に\n半霊的存在と化し、厄災から護る。", 0.0, 0.0, 0.0, 0, 42000, 0.0, 0.0, 195, 109494, 0.0, 0.0, 0.0, 500, "ティアラオブソロネ", 0.0, 0.0, 0.0, 109494, 0.0, 0.0, 0.0, 9, 1, 49, 0, 388.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の目で\nある見張り番の帽子。装備するだけ\nで感覚が研ぎ澄まされ危険の兆候や\n敵の隙も逃すことなく捉えられる。", 0.0, 4.0, 0.0, 0, 42000, 0.0, 0.0, 183, 109522, 0.0, 373.0, 0.0, 500, "ホライゾンウォッチャー", 0.0, 0.0, 0.0, 109522, 4.0, 0.0, 0.0, 9, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天界より遣わされた戦士たちが身に\nまとっていた魔導帽。地上と異なる\n魔法体系での強化付与によりまさに\n異次元の魔力上昇が体感できる。", 0.0, 4.0, 0.0, 0, 42000, 0.0, 0.0, 195, 109524, 0.0, 407.0, 0.0, 500, "ハットオブケルビム", 0.0, 0.0, 0.0, 109524, 4.0, 0.0, 0.0, 9, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n角の首飾り。得体の知れぬ豪角を\n自らの喉元に突きつける蛮勇を持つ\n者のみが破壊の力を得られる。", 0.0, 0.0, 0.0, 0, 42000, 10.0, 0.0, 174, 109551, 0.0, 0.0, 0.0, 500, "双角魔の首飾り", 0.0, 0.0, 0.0, 109551, 0.0, 0.0, 0.0, 9, 1, 55, 0, 383.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説と謳われた調理師旅団内で流行\nした菓子切の髪飾り。他の装備を\n失う極限状況であっても最後の武器\nとなり装備者を奮い立たせる。", 0.0, 0.0, 0.0, 0, 42000, 10.0, 0.0, 180, 109552, 0.0, 0.0, 0.0, 500, "紅色花飾菓子切包丁", 0.0, 0.0, 0.0, 109552, 0.0, 0.0, 0.0, 9, 1, 55, 0, 401.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の特別\nな功労者に与えられるブローチ。\n胸元で紅色に輝く栄誉を得た者は\n船上で八臂のごとき活躍を見せた。", 0.0, 0.0, 0.0, 0, 42000, 10.0, 0.0, 186, 109553, 0.0, 0.0, 0.0, 500, "紅海のホイールブローチ", 0.0, 0.0, 0.0, 109553, 0.0, 0.0, 0.0, 9, 1, 55, 0, 420.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した扇子。懐より取り\n出し扇ぐことで紅に染まる秋の風が\n吹き、落葉は胡蝶の如く舞い踊る。", 0.0, 0.0, 0.0, 0, 42000, 10.0, 0.0, 192, 109554, 0.0, 0.0, 0.0, 500, "紅葉扇コチョウモミジ", 0.0, 0.0, 0.0, 109554, 0.0, 0.0, 0.0, 9, 1, 55, 0, 439.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (775.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n翼の首飾り。第二の皮膚の如く密着\nし装備者の首を護るが、使いすぎる\nと癒着し取り外し不可能となる。", 0.0, 30.0, 0.0, 0, 42000, 0.0, 0.0, 174, 109581, 0.0, 0.0, 0.0, 500, "ディアブロメンブランス", 0.0, 0.0, 0.0, 109581, 30.0, 0.0, 0.0, 9, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (855.0, 0, 0.0, 0, "伝説と謳われた調理師旅団内で常用\nされた箸の髪飾り。あらゆる料理に\n対応可能という安心感が装備者の\n生存能力を大幅に底上げする。", 0.0, 31.0, 0.0, 0, 42000, 0.0, 0.0, 180, 109582, 0.0, 0.0, 0.0, 500, "翡翠花飾箸", 0.0, 0.0, 0.0, 109582, 31.0, 0.0, 0.0, 9, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (935.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の特別\nな功労者に与えられるブローチ。\n貝のごとき沈思と忍耐を誇る勇者は\n船団を守る盾と呼ばれ称えられた。", 0.0, 32.0, 0.0, 0, 42000, 0.0, 0.0, 186, 109583, 0.0, 0.0, 0.0, 500, "碧海のアンカーブローチ", 0.0, 0.0, 0.0, 109583, 32.0, 0.0, 0.0, 9, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (1010.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した扇。銀杏を食む鹿\nは緑黄に染まる秋山の恵みを表し、\n扇ぎ出る爽風は生命力をもたらす。", 0.0, 33.0, 0.0, 0, 42000, 0.0, 0.0, 192, 109584, 0.0, 0.0, 0.0, 500, "翠風扇カノコイチョウ", 0.0, 0.0, 0.0, 109584, 33.0, 0.0, 0.0, 9, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "魔界と呼ばれる別世界から漂着した\n尻尾の首飾り。蠢く尻尾が装備者の\n声帯に干渉し魔法威力を増加させる\nがその影響は詠唱時以外にも及ぶ。", 0.0, 0.0, 0.0, 0, 42000, 0.0, 0.0, 174, 109611, 0.0, 380.0, 0.0, 500, "デモニックテールタイ", 8.0, 0.0, 0.0, 109611, 0.0, 0.0, 0.0, 9, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "伝説と謳われた調理師旅団内で愛用\nされた菓子楊枝の髪飾り。東方菓子\nの繊細な甘みと香りを常に感じる\nことで、魔力が研ぎ澄まされる。", 0.0, 0.0, 0.0, 0, 42000, 0.0, 0.0, 180, 109612, 0.0, 398.0, 0.0, 500, "サファイアフォークヘアピン", 8.0, 0.0, 0.0, 109612, 0.0, 0.0, 0.0, 9, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "未知の大陸を目指す調査船団の特別\nな功労者に与えられるブローチ。\nこの栄誉を得た者は蒼海を飛び交う\n海鳥のように自在に魔力を操る。", 0.0, 0.0, 0.0, 0, 42000, 0.0, 0.0, 186, 109613, 0.0, 417.0, 0.0, 500, "蒼海のフローターブローチ", 8.0, 0.0, 0.0, 109613, 0.0, 0.0, 0.0, 9, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ランドソルの文化に触れたトーゴク\nの職人が作成した団扇。秋の夜長の\n静謐な空気に研ぎ澄まされた魔力が\n一転、猛猪の突進の如く敵を襲う。", 0.0, 0.0, 0.0, 0, 42000, 0.0, 0.0, 192, 109614, 0.0, 436.0, 0.0, 500, "碧夜扇イノコカエデ", 8.0, 0.0, 0.0, 109614, 0.0, 0.0, 0.0, 9, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "「煌めきの剣」の欠片。", 0.0, 0.0, 0.0, 1, 280, 0.0, 0.0, 19, 113011, 0.0, 0.0, 0.0, 4, "煌めきの剣（欠片）", 0.0, 0.0, 0.0, 103011, 0.0, 0.0, 0.0, 3, 0, 1, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "「竜紋剣」の欠片。", 0.0, 0.0, 0.0, 1, 600, 0.0, 0.0, 29, 113012, 0.0, 0.0, 0.0, 4, "竜紋剣（欠片）", 0.0, 0.0, 0.0, 103012, 0.0, 0.0, 0.0, 3, 0, 1, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "「フェザーブレード」の欠片。", 0.0, 0.0, 0.0, 1, 800, 0.0, 0.0, 37, 113013, 0.0, 0.0, 0.0, 4, "フェザーブレード（欠片）", 0.0, 0.0, 0.0, 103013, 0.0, 0.0, 0.0, 3, 0, 1, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "「プラチナナイフ」の欠片。", 0.0, 0.0, 0.0, 1, 280, 0.0, 0.0, 19, 113071, 0.0, 0.0, 0.0, 4, "プラチナナイフ（欠片）", 0.0, 0.0, 0.0, 103071, 0.0, 0.0, 0.0, 3, 0, 7, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "「ドラゴンズクロー」の欠片。", 0.0, 0.0, 0.0, 1, 600, 0.0, 0.0, 30, 113101, 0.0, 0.0, 0.0, 4, "ドラゴンズクロー（欠片）", 0.0, 0.0, 0.0, 103101, 0.0, 0.0, 0.0, 3, 0, 10, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "「キューピッドの弓」の欠片。", 0.0, 0.0, 0.0, 1, 600, 0.0, 0.0, 30, 113131, 0.0, 0.0, 0.0, 4, "キューピッドの弓（欠片）", 0.0, 0.0, 0.0, 103131, 0.0, 0.0, 0.0, 3, 0, 13, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "「アブソリュートスピア」の欠片。", 0.0, 0.0, 0.0, 1, 600, 0.0, 0.0, 30, 113162, 0.0, 0.0, 0.0, 4, "アブソリュートスピア（欠片）", 0.0, 0.0, 0.0, 103162, 0.0, 0.0, 0.0, 3, 0, 16, 1, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "「ブルースフィアアックス」の\n欠片。", 0.0, 0.0, 0.0, 1, 280, 0.0, 0.0, 20, 113191, 0.0, 0.0, 0.0, 4, "ブルースフィアアックス（欠片）", 0.0, 0.0, 0.0, 103191, 0.0, 0.0, 0.0, 3, 0, 19, 1, 0.0);
