INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "天界より遣わされた戦士たちが手に\nしていた聖剣。聖なる加護が剣のみ\nならず装備者を包み込み、悪へ立ち\n向かう力と勇気を与えるという。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 196, 10001032, 0.0, 0.0, 0.0, 500, "ソードオブミカエル", 0.0, 0.0, 0.0, 10001032, 0.0, 0.0, 0.0, 10, 1, 1, 0, 484.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n英雄が愛用した剣。どんな剛力でも\n破壊不能な蒼く輝く刀身が、必殺の\n威力を余すことなく敵へと伝える。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 202, 10001033, 0.0, 0.0, 0.0, 500, "妖精煌剣アキレアナ", 0.0, 0.0, 0.0, 10001033, 0.0, 0.0, 0.0, 10, 1, 1, 0, 521.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られた剣。何重にも\n重ねられた皮が金属以上の硬度を\n誇り独特の風格を醸し出している。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 262, 10001034, 0.0, 0.0, 0.0, 500, "甘蕉の秘剣", 0.0, 0.0, 0.0, 10001034, 0.0, 0.0, 0.0, 10, 1, 1, 0, 540.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "機械人族の性能を存分に発揮させる\nため作成された大剣。他種族も装備\n可能に調整されておりその爆発的な\n火力を自由自在に運用可能である。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 322, 10001035, 0.0, 0.0, 0.0, 500, "オートマトンエクスソード", 0.0, 0.0, 0.0, 10001035, 0.0, 0.0, 0.0, 10, 1, 1, 0, 559.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n硬い骨板を利用し作られた剣。強力\nな生命力により切り離されてなお\n再生し続け、鋭利さを保ち続ける。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 331, 10001036, 0.0, 0.0, 0.0, 500, "蛮骨剣ケントロ", 0.0, 0.0, 0.0, 10001036, 0.0, 0.0, 0.0, 10, 1, 1, 0, 577.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nアイスクレイモア。\n限界を超越した強度の剣身は、\nいかなる敵でも斬り伏せる。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 340, 10001037, 0.0, 0.0, 0.0, 500, "アイスクレイモアＲ", 0.0, 0.0, 0.0, 10001037, 0.0, 0.0, 0.0, 10, 1, 1, 0, 596.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nカオスブレード。\n限界を超越した強度の剣身は、\nいかなる敵でも斬り伏せる。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 349, 10001038, 0.0, 0.0, 0.0, 500, "カオスブレードＲ", 0.0, 0.0, 0.0, 10001038, 0.0, 0.0, 0.0, 10, 1, 1, 0, 615.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nライトニングブレード。\n限界を超越した強度の剣身は、\nいかなる敵でも斬り伏せる。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 358, 10001039, 0.0, 0.0, 0.0, 500, "ライトニングブレードＲ", 0.0, 0.0, 0.0, 10001039, 0.0, 0.0, 0.0, 10, 1, 1, 0, 634.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "天界より遣わされた戦士たちが手に\nしていた聖刀。鍔に浮かぶ光輪は、\n装備者を天使と同等の存在位階へと\n一時的に押し上げる力がある。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 196, 10004032, 0.0, 0.0, 0.0, 800, "ブレイドオブルシフェル", 0.0, 0.0, 0.0, 10004032, 0.0, 0.0, 0.0, 10, 1, 4, 0, 510.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n勇士が愛用した刀。硬さと軽さを\n両立した刃が風に舞う蝶の如く自在\nに動き敵の急所を容易く切り裂く。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 202, 10004033, 0.0, 0.0, 0.0, 800, "妖精舞刀パトロクルス", 0.0, 0.0, 0.0, 10004033, 0.0, 0.0, 0.0, 10, 1, 4, 0, 547.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られた刀。宝石鉱脈\n近くで育ったため豊富なミネラルを\n宿し硬く鋭利な刃を形作っている。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 262, 10004034, 0.0, 0.0, 0.0, 800, "天下一甜瓜刀", 0.0, 0.0, 0.0, 10004034, 0.0, 0.0, 0.0, 10, 1, 4, 0, 566.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "機械人族の性能を存分に発揮させる\nため作成された太刀。他種族も装備\n可能に調整されているが余りに鋭利\n過ぎる光刃は扱いが非常に難しい。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 322, 10004035, 0.0, 0.0, 0.0, 800, "オートマトンエクスカタナ", 0.0, 0.0, 0.0, 10004035, 0.0, 0.0, 0.0, 10, 1, 4, 0, 585.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n鱗を利用し作られた太刀。過酷な\n環境で育まれた硬く鋭い鱗は触れた\nだけであらゆるものを切り裂く。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 331, 10004036, 0.0, 0.0, 0.0, 800, "滅鱗大刀ミラガイア", 0.0, 0.0, 0.0, 10004036, 0.0, 0.0, 0.0, 10, 1, 4, 0, 603.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n鷹神の煌剣。\n限界を超越した切れ味の刃は、\nいかなる敵でも両断する。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 340, 10004037, 0.0, 0.0, 0.0, 800, "鷹神の煌剣Ｒ", 0.0, 0.0, 0.0, 10004037, 0.0, 0.0, 0.0, 10, 1, 4, 0, 622.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n鳳凰刀。\n限界を超越した切れ味の刃は、\nいかなる敵でも両断する。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 349, 10004038, 0.0, 0.0, 0.0, 800, "鳳凰刀Ｒ", 0.0, 0.0, 0.0, 10004038, 0.0, 0.0, 0.0, 10, 1, 4, 0, 641.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (60.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n百華白桜刀。\n限界を超越した切れ味の刃は、\nいかなる敵でも両断する。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 358, 10004039, 0.0, 0.0, 0.0, 800, "百華白桜刀Ｒ", 0.0, 0.0, 0.0, 10004039, 0.0, 0.0, 0.0, 10, 1, 4, 0, 660.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天界より遣わされた戦士たちが手に\nしていた聖刃。舞い踊る羽毛の如き\n軽さでありながら、地上の如何なる\n物質よりも硬く、鋭い一撃を放つ。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 196, 10007032, 0.0, 0.0, 0.0, 500, "エッジオブサタナエル", 0.0, 0.0, 0.0, 10007032, 0.0, 0.0, 0.0, 10, 1, 7, 0, 516.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n姫が持つ短剣。護身用と呼ぶには\n鋭利すぎる切れ味を持つだけでなく\n美術品としての価値も非常に高い。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 202, 10007033, 0.0, 0.0, 0.0, 500, "妖精夢刃ダイダミア", 0.0, 0.0, 0.0, 10007033, 0.0, 0.0, 0.0, 10, 1, 7, 0, 554.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られた短剣。あまり\nに純粋な糖分が結晶化した刃は、\n今なお硬く鋭く成長し続けている。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 262, 10007034, 0.0, 0.0, 0.0, 500, "未完刃・雲愁", 0.0, 0.0, 0.0, 10007034, 0.0, 0.0, 0.0, 10, 1, 7, 0, 573.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "機械人族の性能を存分に発揮させる\nため作成された短剣。他種族も装備\n可能に調整され追尾機構のサポート\nで敵の弱点を突くアシストを行う。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 322, 10007035, 0.0, 0.0, 0.0, 500, "オートマトンエクスダガー", 0.0, 0.0, 0.0, 10007035, 0.0, 0.0, 0.0, 10, 1, 7, 0, 592.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n牙を利用し作られた短剣。一切の\n加工を受け付けぬ餓竜の牙は本能の\n赴くままに獲物を追い詰める。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 331, 10007036, 0.0, 0.0, 0.0, 500, "黒帝牙剣チノチタ", 0.0, 0.0, 0.0, 10007036, 0.0, 0.0, 0.0, 10, 1, 7, 0, 610.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nダークマターエッジ。\n限界を超越した鋭い刃は、\nいかなる敵でも切り裂く。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 340, 10007037, 0.0, 0.0, 0.0, 500, "ダークマターエッジＲ", 0.0, 0.0, 0.0, 10007037, 0.0, 0.0, 0.0, 10, 1, 7, 0, 629.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nユニコーンナイフ。\n限界を超越した鋭い刃は、\nいかなる敵でも切り裂く。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 349, 10007038, 0.0, 0.0, 0.0, 500, "ユニコーンナイフＲ", 0.0, 0.0, 0.0, 10007038, 0.0, 0.0, 0.0, 10, 1, 7, 0, 647.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nエメラルドダガー。\n限界を超越した鋭い刃は、\nいかなる敵でも切り裂く。", 0.0, 0.0, 0.0, 0, 44000, 5.0, 0.0, 358, 10007039, 0.0, 0.0, 0.0, 500, "エメラルドダガーＲ", 0.0, 0.0, 0.0, 10007039, 0.0, 0.0, 0.0, 10, 1, 7, 0, 666.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天界より遣わされた戦士たちが身に\nつけていた聖腕甲。聖なる炎闘気が\n装備者を包むことで、身体能力を\n飛躍的に上昇させ、悪を粉砕する。", 0.0, 0.0, 0.0, 0, 44000, 6.0, 0.0, 196, 10010032, 0.0, 0.0, 0.0, 500, "フィストオブウリエル", 0.0, 0.0, 0.0, 10010032, 0.0, 0.0, 0.0, 10, 1, 10, 0, 516.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n氏族長の証たる腕飾。一見、優美な\n腕飾りだが見えざるもう一つの手を\n作り出し自在に操ることができる。", 0.0, 0.0, 0.0, 0, 44000, 6.0, 0.0, 202, 10010033, 0.0, 0.0, 0.0, 500, "妖精幻手カシカモ", 0.0, 0.0, 0.0, 10010033, 0.0, 0.0, 0.0, 10, 1, 10, 0, 553.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られた手甲。濃厚な\n甘い香りに惹きつけられてしまうと\n強烈な一撃を味わう羽目になる。", 0.0, 0.0, 0.0, 0, 44000, 6.0, 0.0, 262, 10010034, 0.0, 0.0, 0.0, 500, "菴羅の手甲", 0.0, 0.0, 0.0, 10010034, 0.0, 0.0, 0.0, 10, 1, 10, 0, 572.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "機械人族の性能を存分に発揮させる\nため作成された拳甲。他種族も装備\n可能に調整され、まるで自分の身体\nの延長のように自由自在に扱える。", 0.0, 0.0, 0.0, 0, 44000, 6.0, 0.0, 322, 10010035, 0.0, 0.0, 0.0, 500, "オートマトンエクスエッジ", 0.0, 0.0, 0.0, 10010035, 0.0, 0.0, 0.0, 10, 1, 10, 0, 591.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n頭部を模して作られた手甲。前へと\nひたすらに向かう突進は全ての障害\nを吹飛ばし確実に眼前の敵へ至る。", 0.0, 0.0, 0.0, 0, 44000, 6.0, 0.0, 331, 10010036, 0.0, 0.0, 0.0, 500, "鼎角拳サンジャオロン", 0.0, 0.0, 0.0, 10010036, 0.0, 0.0, 0.0, 10, 1, 10, 0, 609.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nブリザードクロー。\n限界を超越した重い打撃は、\nいかなる敵でも打ち砕く。", 0.0, 0.0, 0.0, 0, 44000, 6.0, 0.0, 340, 10010037, 0.0, 0.0, 0.0, 500, "ブリザードクローＲ", 0.0, 0.0, 0.0, 10010037, 0.0, 0.0, 0.0, 10, 1, 10, 0, 628.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n蒼雷拳。\n限界を超越した重い打撃は、\nいかなる敵でも打ち砕く。", 0.0, 0.0, 0.0, 0, 44000, 6.0, 0.0, 349, 10010038, 0.0, 0.0, 0.0, 500, "蒼雷拳Ｒ", 0.0, 0.0, 0.0, 10010038, 0.0, 0.0, 0.0, 10, 1, 10, 0, 647.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nムーンセスタス。\n限界を超越した重い打撃は、\nいかなる敵でも打ち砕く。", 0.0, 0.0, 0.0, 0, 44000, 6.0, 0.0, 358, 10010039, 0.0, 0.0, 0.0, 500, "ムーンセスタスＲ", 0.0, 0.0, 0.0, 10010039, 0.0, 0.0, 0.0, 10, 1, 10, 0, 666.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天界より遣わされた戦士たちが手に\nしていた聖弓。弦鳴による聖結界が\n番えた矢に命を吹き込み、風の如く\n自在に舞う矢は、必ず急所を貫く。", 0.0, 1.0, 0.0, 0, 44000, 4.0, 0.0, 196, 10013032, 0.0, 0.0, 0.0, 800, "ボウオブラファエル", 0.0, 0.0, 0.0, 10013032, 1.0, 0.0, 0.0, 10, 1, 13, 0, 507.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n吟遊詩人愛用の弓。狙った獲物を\n追尾する魔法の矢を放ち、命中する\nと弦鳴りが美しい音楽を奏でる。", 0.0, 1.0, 0.0, 0, 44000, 4.0, 0.0, 202, 10013033, 0.0, 0.0, 0.0, 800, "妖精梓弓タミュリス", 0.0, 0.0, 0.0, 10013033, 1.0, 0.0, 0.0, 10, 1, 13, 0, 544.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツの枝から作られた弓。実に\n溢れる生命力が、放たれた矢に宿り\n一切の良心の呵責なく敵を貫く。", 0.0, 1.0, 0.0, 0, 44000, 4.0, 0.0, 262, 10013034, 0.0, 0.0, 0.0, 800, "桜桃の枝弓", 0.0, 0.0, 0.0, 10013034, 1.0, 0.0, 0.0, 10, 1, 13, 0, 563.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "機械人族の性能を存分に発揮させる\nため作成された弩。他種族も装備\n可能に調整されており放たれた矢は\n敵を自動追尾して確実に射貫く。", 0.0, 1.0, 0.0, 0, 44000, 4.0, 0.0, 322, 10013035, 0.0, 0.0, 0.0, 800, "オートマトンエクスボウ", 0.0, 0.0, 0.0, 10013035, 1.0, 0.0, 0.0, 10, 1, 13, 0, 582.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n翼膜を利用し作られた弓。翼の竜の\n叫音の如き弦鳴と共に放たれる矢は\n遠く離れていても獲物を射貫く。", 0.0, 1.0, 0.0, 0, 44000, 4.0, 0.0, 331, 10013036, 0.0, 0.0, 0.0, 800, "滑空葬弓プテロダ", 0.0, 0.0, 0.0, 10013036, 1.0, 0.0, 0.0, 10, 1, 13, 0, 601.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nアルテミスボウ。\n限界を超越した強弓から放つ剛矢は\nいかなる敵でも射ち貫く。", 0.0, 1.0, 0.0, 0, 44000, 4.0, 0.0, 340, 10013037, 0.0, 0.0, 0.0, 800, "アルテミスボウＲ", 0.0, 0.0, 0.0, 10013037, 1.0, 0.0, 0.0, 10, 1, 13, 0, 619.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n精霊樹の弓。\n限界を超越した強弓から放つ剛矢は\nいかなる敵でも射ち貫く。", 0.0, 1.0, 0.0, 0, 44000, 4.0, 0.0, 349, 10013038, 0.0, 0.0, 0.0, 800, "精霊樹の弓Ｒ", 0.0, 0.0, 0.0, 10013038, 1.0, 0.0, 0.0, 10, 1, 13, 0, 638.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n白銀の大翼弓。\n限界を超越した強弓から放つ剛矢は\nいかなる敵でも射ち貫く。", 0.0, 1.0, 0.0, 0, 44000, 4.0, 0.0, 358, 10013039, 0.0, 0.0, 0.0, 800, "白銀の大翼弓Ｒ", 0.0, 0.0, 0.0, 10013039, 1.0, 0.0, 0.0, 10, 1, 13, 0, 657.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天界より遣わされた戦士たちが手に\nしていた聖槍。装備者に生命の樹の\n如き頑健さと不撓不屈の精神を与え\n倒れ伏すことを決して許さない。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 196, 10016032, 0.0, 0.0, 0.0, 800, "ランスオブザドキエル", 0.0, 0.0, 0.0, 10016032, 2.0, 0.0, 0.0, 10, 1, 16, 0, 499.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n学者が発案した槍。妖精幾何学に\n則り設計された穂先から鱗粉を振り\n撒く攻防一体の防衛兵装である。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 202, 10016033, 0.0, 0.0, 0.0, 800, "妖精翅槍メネラウス", 0.0, 0.0, 0.0, 10016033, 2.0, 0.0, 0.0, 10, 1, 16, 0, 536.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られた槍。巨大な実\nに眠る可能性を尊重し愛情をもって\n丁寧に結晶化させ穂先にした逸品。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 262, 10016034, 0.0, 0.0, 0.0, 800, "覆盆子の晶槍", 0.0, 0.0, 0.0, 10016034, 2.0, 0.0, 0.0, 10, 1, 16, 0, 555.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "機械人族の性能を存分に発揮させる\nため作成された豪槍。他種族も装備\n可能に調整されており、ブーストを\n用いた突進は他の追随を許さない。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 322, 10016035, 0.0, 0.0, 0.0, 800, "オートマトンエクスランス", 0.0, 0.0, 0.0, 10016035, 2.0, 0.0, 0.0, 10, 1, 16, 0, 574.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n剛角を利用し作られた槍。如何なる\n衝撃を受けても決して折れず、目標\nを貫くまでその進撃は止まらない。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 331, 10016036, 0.0, 0.0, 0.0, 800, "穿角槍モノクロニウス", 0.0, 0.0, 0.0, 10016036, 2.0, 0.0, 0.0, 10, 1, 16, 0, 592.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nストームブリンガー。\n限界を超越した鋭さの穂先は、\nいかなる敵でも刺し穿つ。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 340, 10016037, 0.0, 0.0, 0.0, 800, "ストームブリンガーＲ", 0.0, 0.0, 0.0, 10016037, 2.0, 0.0, 0.0, 10, 1, 16, 0, 611.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nガイアバルディッシュ。\n限界を超越した鋭さの穂先は、\nいかなる敵でも刺し穿つ。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 349, 10016038, 0.0, 0.0, 0.0, 800, "ガイアバルディッシュＲ", 0.0, 0.0, 0.0, 10016038, 2.0, 0.0, 0.0, 10, 1, 16, 0, 630.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nゼロフロストランス。\n限界を超越した鋭さの穂先は、\nいかなる敵でも刺し穿つ。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 358, 10016039, 0.0, 0.0, 0.0, 800, "ゼロフロストランスＲ", 0.0, 0.0, 0.0, 10016039, 2.0, 0.0, 0.0, 10, 1, 16, 0, 649.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "天界より遣わされた戦士たちが手に\nしていた聖斧。装備者に破壊と戦の\n加護を与え、天の敵に対して一切の\n容赦を持たぬ戦士へと変貌させる。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 196, 10019032, 0.0, 0.0, 0.0, 500, "アクスオブカマエル", 0.0, 0.0, 0.0, 10019032, 0.0, 0.0, 0.0, 10, 1, 19, 0, 495.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n勇猛なる王族が戦場で愛用した斧。\n蝶の羽ばたきの如き静謐さで、死を\nもたらす巨刃は蒼き軌跡を描く。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 202, 10019033, 0.0, 0.0, 0.0, 800, "妖精揚斧モンテズマ", 0.0, 0.0, 0.0, 10019033, 0.0, 0.0, 0.0, 10, 1, 19, 0, 532.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られた槌。凄まじい\n破壊力と引き換えに、大切な物を\n喪う勇気がなければ持てない。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 262, 10019034, 0.0, 0.0, 0.0, 800, "麝香猫果の剛槌", 0.0, 0.0, 0.0, 10019034, 0.0, 0.0, 0.0, 10, 1, 19, 0, 551.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "機械人族の性能を存分に発揮させる\nため作成された大槌。他種族も装備\n可能に調整され自動重心調整機能で\n重さの割に抜群の取り回しを誇る。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 322, 10019035, 0.0, 0.0, 0.0, 800, "オートマトンエクスプレス", 0.0, 0.0, 0.0, 10019035, 0.0, 0.0, 0.0, 10, 1, 19, 0, 570.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n殻体を利用し作られた豪斧。衝撃を\nため込む特殊な構造を活かし、軽い\n力で規格外の破壊力を生み出せる。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 331, 10019036, 0.0, 0.0, 0.0, 800, "渦殻斧アンモクラッシャー", 0.0, 0.0, 0.0, 10019036, 0.0, 0.0, 0.0, 10, 1, 19, 0, 588.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n戦女王の烈斧。\n限界を超越した破壊力は、\nいかなる敵でも割り砕く。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 340, 10019037, 0.0, 0.0, 0.0, 800, "戦女王の烈斧Ｒ", 0.0, 0.0, 0.0, 10019037, 0.0, 0.0, 0.0, 10, 1, 19, 0, 608.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nアクアスラッシャー。\n限界を超越した破壊力は、\nいかなる敵でも割り砕く。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 349, 10019038, 0.0, 0.0, 0.0, 800, "アクアスラッシャーＲ", 0.0, 0.0, 0.0, 10019038, 0.0, 0.0, 0.0, 10, 1, 19, 0, 626.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (200.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nネクロディムアックス。\n限界を超越した破壊力は、\nいかなる敵でも割り砕く。", 0.0, 0.0, 0.0, 0, 44000, 3.0, 0.0, 358, 10019039, 0.0, 0.0, 0.0, 800, "ネクロディムアックスＲ", 0.0, 0.0, 0.0, 10019039, 0.0, 0.0, 0.0, 10, 1, 19, 0, 645.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天界より遣わされた戦士たちが手に\nしていた聖征杖。太古の昔地上から\n失われた天界の操魔技術により本来\nあり得ない威力の魔法を操れる。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 196, 10022032, 0.0, 513.0, 0.0, 500, "ワンドオブヨフィエル", 6.0, 0.0, 0.0, 10022032, 0.0, 0.0, 0.0, 10, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n女神から賜った杖。女神に献上され\n上位次元に蓄えられた魔力を借受け\n尽きることなく攻撃魔法を放てる。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 202, 10022033, 0.0, 550.0, 0.0, 500, "妖精崩杖キプリス", 6.0, 0.0, 0.0, 10022033, 0.0, 0.0, 0.0, 10, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られた杖。数億の中\nから選ばれた果実の内部には天然の\n魔力増強魔法陣が刻まれている。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 262, 10022034, 0.0, 569.0, 0.0, 500, "林檎杖・北斗", 6.0, 0.0, 0.0, 10022034, 0.0, 0.0, 0.0, 10, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "機械人族の性能を存分に発揮させる\nため作成された魔杖。他種族も装備\n可能に調整され電磁場で魔力経路を\n再現し魔術の発動をサポートする。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 322, 10022035, 0.0, 588.0, 0.0, 500, "オートマトンエクスロッド", 6.0, 0.0, 0.0, 10022035, 0.0, 0.0, 0.0, 10, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n姿を模して作られた杖。大空を悠々\nと闊空する姿の如く、留まることを\n知らぬ膨大な魔力の流れを生む。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 331, 10022036, 0.0, 606.0, 0.0, 500, "竜杖ゲオステルンベルギア", 6.0, 0.0, 0.0, 10022036, 0.0, 0.0, 0.0, 10, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n司法神の錫杖。\n限界を超越した秘奥の魔術は、\nいかなる敵でも撃滅する。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 340, 10022037, 0.0, 626.0, 0.0, 500, "司法神の錫杖Ｒ", 6.0, 0.0, 0.0, 10022037, 0.0, 0.0, 0.0, 10, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nハイデビルズワンド。\n限界を超越した秘奥の魔術は、\nいかなる敵でも撃滅する。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 349, 10022038, 0.0, 644.0, 0.0, 500, "ハイデビルズワンドＲ", 6.0, 0.0, 0.0, 10022038, 0.0, 0.0, 0.0, 10, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nゼノスフィアロッド。\n限界を超越した秘奥の魔術は、\nいかなる敵でも撃滅する。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 358, 10022039, 0.0, 663.0, 0.0, 500, "ゼノスフィアロッドＲ", 6.0, 0.0, 0.0, 10022039, 0.0, 0.0, 0.0, 10, 1, 22, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "天界より遣わされた戦士たちが手に\nしていた聖護杖。天界の聖なる魔力\nが生命力を活性化させ負傷者たちが\n立ち上がるための鬨の声を届ける。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 196, 10025032, 0.0, 465.0, 0.0, 500, "ロッドオブガブリエル", 0.0, 0.0, 0.0, 10025032, 2.0, 0.0, 0.0, 10, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n泉の精が持つ杖。無限の生命力が\n湧出る宝玉から蝶たちを介し装備者\nと仲間たちに癒しの力を分配する。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 202, 10025033, 0.0, 502.0, 0.0, 500, "妖精回杖アナクシビア", 0.0, 0.0, 0.0, 10025033, 2.0, 0.0, 0.0, 10, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られた杖。その実の\n一つ一つに宿る癒しの力は神々から\n人への信頼の証と伝えられている。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 262, 10025034, 0.0, 521.0, 0.0, 500, "葡萄杖・竜眼", 0.0, 0.0, 0.0, 10025034, 2.0, 0.0, 0.0, 10, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "機械人族の性能を存分に発揮させる\nため作成された霊杖。他種族も装備\n可能に調整されており常時展開する\n防御領域が装備者を護り続ける。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 322, 10025035, 0.0, 540.0, 0.0, 500, "オートマトンエクスバトン", 0.0, 0.0, 0.0, 10025035, 2.0, 0.0, 0.0, 10, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "ジオ・ゲヘナに生息した古生生物を\n含む琥珀で作られた杖。数億年の間\n封じられながらも未だ生存するそれ\nから無尽の生命力を引出している。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 331, 10025036, 0.0, 559.0, 0.0, 500, "秘封杖アンバーコフィン", 0.0, 0.0, 0.0, 10025036, 2.0, 0.0, 0.0, 10, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nフェニックスロッド。\n限界を超越した神秘の治癒力は、\nどんな傷でも癒やし清める。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 340, 10025037, 0.0, 578.0, 0.0, 500, "フェニックスロッドＲ", 0.0, 0.0, 0.0, 10025037, 2.0, 0.0, 0.0, 10, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nハイエンジェルロッド。\n限界を超越した神秘の治癒力は、\nどんな傷でも癒やし清める。\n", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 349, 10025038, 0.0, 596.0, 0.0, 500, "ハイエンジェルロッドＲ", 0.0, 0.0, 0.0, 10025038, 2.0, 0.0, 0.0, 10, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (300.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nフレイアムルロッド。\n限界を超越した神秘の治癒力は、\nどんな傷でも癒やし清める。", 0.0, 2.0, 0.0, 0, 44000, 0.0, 0.0, 358, 10025039, 0.0, 615.0, 0.0, 500, "フレイアムルロッドＲ", 0.0, 0.0, 0.0, 10025039, 2.0, 0.0, 0.0, 10, 1, 25, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n騎士のために作られた鎧。鍛冶妖精\nの妙技により、まるで身体の一部の\nように装備者の能力を拡張させる。", 0.0, 11.0, 0.0, 0, 44000, 8.0, 0.0, 201, 10028032, 0.0, 0.0, 0.0, 800, "妖精輝装クーフーリン", 0.0, 0.0, 0.0, 10028032, 11.0, 0.0, 0.0, 10, 1, 28, 0, 367.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られた鎧。その強固\nな外皮はまるで本物の竜鱗の如く\n装備者を覆い燃える心を引き出す。", 0.0, 11.0, 0.0, 0, 44000, 8.0, 0.0, 261, 10028033, 0.0, 0.0, 0.0, 800, "白蓮閣の鱗鎧", 0.0, 0.0, 0.0, 10028033, 11.0, 0.0, 0.0, 10, 1, 28, 0, 384.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "機械人族の性能を底上げするための\n特殊骨格。他種族も装着可能に改修\nされており、身体操作をアシストし\n運動性能を劇的に向上させる。", 0.0, 11.0, 0.0, 0, 44000, 8.0, 0.0, 321, 10028034, 0.0, 0.0, 0.0, 800, "オートマトンエグゾスカル", 0.0, 0.0, 0.0, 10028034, 11.0, 0.0, 0.0, 10, 1, 28, 0, 401.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n骨を利用し作られた鎧。朽ちてなお\n溢れる強靭な生命力が装備者に眠る\n原初の狩猟本能を目覚めさせる。", 0.0, 12.0, 0.0, 0, 44000, 8.0, 0.0, 328, 10028035, 0.0, 0.0, 0.0, 800, "絶滅骸装タイラント", 0.0, 0.0, 0.0, 10028035, 12.0, 0.0, 0.0, 10, 1, 28, 0, 409.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nクルセイダープレート。\n高い防御力と運動性を両立しながら\n装備者の潜在能力を高めてくれる。\n", 0.0, 12.0, 0.0, 0, 44000, 8.0, 0.0, 337, 10028036, 0.0, 0.0, 0.0, 800, "クルセイダープレートＲ", 0.0, 0.0, 0.0, 10028036, 12.0, 0.0, 0.0, 10, 1, 28, 0, 426.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nスカーレットメイル。\n高い防御力と運動性を両立しながら\n装備者の潜在能力を高めてくれる。", 0.0, 12.0, 0.0, 0, 44000, 8.0, 0.0, 346, 10028037, 0.0, 0.0, 0.0, 800, "スカーレットメイルＲ", 0.0, 0.0, 0.0, 10028037, 12.0, 0.0, 0.0, 10, 1, 28, 0, 437.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nファンタズムメイル。\n高い防御力と運動性を両立しながら\n装備者の潜在能力を高めてくれる。", 0.0, 12.0, 0.0, 0, 44000, 8.0, 0.0, 355, 10028038, 0.0, 0.0, 0.0, 800, "ファンタズムメイルＲ", 0.0, 0.0, 0.0, 10028038, 12.0, 0.0, 0.0, 10, 1, 28, 0, 449.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n九天の鎧。\n高い防御力と運動性を両立しながら\n装備者の潜在能力を高めてくれる。", 0.0, 12.0, 0.0, 0, 44000, 8.0, 0.0, 364, 10028039, 0.0, 0.0, 0.0, 800, "九天の鎧Ｒ", 0.0, 0.0, 0.0, 10028039, 12.0, 0.0, 0.0, 10, 1, 28, 0, 469.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (2590.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n王位継承者のために作られた重鎧。\n刻みこまれた精霊王との絶対守護の\n盟約は絶命の定めすら捻じ曲げる。", 0.0, 19.0, 0.0, 0, 44000, 0.0, 0.0, 201, 10031032, 0.0, 0.0, 0.0, 800, "妖精鎧甲オーベロン", 0.0, 0.0, 0.0, 10031032, 19.0, 0.0, 0.0, 10, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (2740.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られた重鎧。分厚い\n果皮外殻が装備者を優しく包み込み\n完全無欠な守護領域を展開する。", 0.0, 19.0, 0.0, 0, 44000, 0.0, 0.0, 261, 10031033, 0.0, 0.0, 0.0, 800, "鳳梨の重殻鎧", 0.0, 0.0, 0.0, 10031033, 19.0, 0.0, 0.0, 10, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (2890.0, 0, 0.0, 0, "機械人族の性能を底上げするための\n特殊装甲。他種族も装着可能に改修\nされており、特殊な力場を発生させ\n受ける衝撃を劇的に軽減する。", 0.0, 19.0, 0.0, 0, 44000, 0.0, 0.0, 321, 10031034, 0.0, 0.0, 0.0, 800, "オートマトンエグゾシェル", 0.0, 0.0, 0.0, 10031034, 19.0, 0.0, 0.0, 10, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (2960.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n鱗を使用した鎧。金属よりも硬い鱗\nは如何なる災禍にも耐えうる強度で\n滅びに抗う強き本能の表れである。", 0.0, 20.0, 0.0, 0, 44000, 0.0, 0.0, 328, 10031035, 0.0, 0.0, 0.0, 800, "撃滅鱗装ギガント", 0.0, 0.0, 0.0, 10031035, 20.0, 0.0, 0.0, 10, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (3110.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nバイオレットアーマー。\nその魔力は堅牢さを増幅し、\n装備者の潜在能力を高めてくれる。\n", 0.0, 20.0, 0.0, 0, 44000, 0.0, 0.0, 337, 10031036, 0.0, 0.0, 0.0, 800, "バイオレットアーマーＲ", 0.0, 0.0, 0.0, 10031036, 20.0, 0.0, 0.0, 10, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (3210.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nドラゴニックアーマー。\nその魔力は堅牢さを増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 20.0, 0.0, 0, 44000, 0.0, 0.0, 346, 10031037, 0.0, 0.0, 0.0, 800, "ドラゴニックアーマーＲ", 0.0, 0.0, 0.0, 10031037, 20.0, 0.0, 0.0, 10, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (3315.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n蒼輝の鎧。\nその魔力は堅牢さを増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 20.0, 0.0, 0, 44000, 0.0, 0.0, 355, 10031038, 0.0, 0.0, 0.0, 800, "蒼輝の鎧Ｒ", 0.0, 0.0, 0.0, 10031038, 20.0, 0.0, 0.0, 10, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (3490.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n聖櫻の鎧。\nその魔力は堅牢さを増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 20.0, 0.0, 0, 44000, 0.0, 0.0, 364, 10031039, 0.0, 0.0, 0.0, 800, "聖櫻の鎧Ｒ", 0.0, 0.0, 0.0, 10031039, 20.0, 0.0, 0.0, 10, 1, 31, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (370.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n従者のために作られた衣。鮮やかな\n見た目だが主を守るため強力な魔力\nで装備者の能力を底上げしている。", 0.0, 6.0, 0.0, 0, 44000, 0.0, 0.0, 201, 10034032, 0.0, 0.0, 0.0, 500, "妖精舞装アヌーン", 0.0, 0.0, 0.0, 10034032, 6.0, 0.0, 0.0, 10, 1, 34, 0, 379.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (370.0, 0, 0.0, 0, "機械人族の性能を底上げするための\n特殊兵装。他種族も装着可能に改修\nされており、特殊な摩擦無効化素材\nにより速度を劇的に向上させる。", 0.0, 6.0, 0.0, 0, 44000, 0.0, 0.0, 321, 10034034, 0.0, 0.0, 0.0, 500, "オートマトンジャケット", 0.0, 0.0, 0.0, 10034034, 6.0, 0.0, 0.0, 10, 1, 34, 0, 414.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (420.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n蒼天のローブ。\n編み込まれた魔力が、\n装備者の潜在能力を高めてくれる。\n", 0.0, 7.0, 0.0, 0, 44000, 0.0, 0.0, 337, 10034036, 0.0, 0.0, 0.0, 500, "蒼天のローブＲ", 0.0, 0.0, 0.0, 10034036, 7.0, 0.0, 0.0, 10, 1, 34, 0, 433.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (420.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nダークテラードレス。\n編み込まれた魔力が、\n装備者の潜在能力を高めてくれる。", 0.0, 7.0, 0.0, 0, 44000, 0.0, 0.0, 346, 10034037, 0.0, 0.0, 0.0, 500, "ダークテラードレスＲ", 0.0, 0.0, 0.0, 10034037, 7.0, 0.0, 0.0, 10, 1, 34, 0, 450.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (420.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nメイデンクロース。\n編み込まれた魔力が、\n装備者の潜在能力を高めてくれる。", 0.0, 7.0, 0.0, 0, 44000, 0.0, 0.0, 364, 10034039, 0.0, 0.0, 0.0, 500, "メイデンクロースＲ", 0.0, 0.0, 0.0, 10034039, 7.0, 0.0, 0.0, 10, 1, 34, 0, 473.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n王族のために作られた衣。華やかな\n見た目ながら裁縫妖精の絶技により\n高密度の魔力が織り込まれている。", 0.0, 9.0, 0.0, 0, 44000, 0.0, 0.0, 201, 10037032, 0.0, 386.0, 0.0, 800, "妖精麗装ティターニア", 5.0, 0.0, 0.0, 10037032, 9.0, 0.0, 0.0, 10, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られたローブ。柑橘\nの爽やかな香が装備者の魔力を高め\n無邪気な破壊本能を覚醒させる。", 0.0, 9.0, 0.0, 0, 44000, 0.0, 0.0, 261, 10037033, 0.0, 403.0, 0.0, 800, "葡萄柚の霊装", 5.0, 0.0, 0.0, 10037033, 9.0, 0.0, 0.0, 10, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "機械人族の性能を底上げするための\n特殊兵装。他種族も装着可能に改修\nされており、内蔵された回路が魔力\n運用効率を劇的に向上させる。", 0.0, 9.0, 0.0, 0, 44000, 0.0, 0.0, 321, 10037034, 0.0, 421.0, 0.0, 800, "オートマトンエグゾスーツ", 5.0, 0.0, 0.0, 10037034, 9.0, 0.0, 0.0, 10, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n甲殻を使用したローブ。素材となる\n魔物の生きた姿を見た者はおらず、\n半霊的存在だと考えられている。", 0.0, 10.0, 0.0, 0, 44000, 0.0, 0.0, 328, 10037035, 0.0, 428.0, 0.0, 800, "幻蝦霊装アノーマリー", 5.0, 0.0, 0.0, 10037035, 10.0, 0.0, 0.0, 10, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n聖者のローブ。\n循環する魔力を増幅し、\n装備者の潜在能力を高めてくれる。\n", 0.0, 10.0, 0.0, 0, 44000, 0.0, 0.0, 337, 10037036, 0.0, 445.0, 0.0, 800, "聖者のローブＲ", 5.0, 0.0, 0.0, 10037036, 10.0, 0.0, 0.0, 10, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n翠緑の霊衣。\n循環する魔力を増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 10.0, 0.0, 0, 44000, 0.0, 0.0, 346, 10037037, 0.0, 462.0, 0.0, 800, "翠緑の霊衣Ｒ", 5.0, 0.0, 0.0, 10037037, 10.0, 0.0, 0.0, 10, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n純潔の巫女装束。\n循環する魔力を増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 10.0, 0.0, 0, 44000, 0.0, 0.0, 355, 10037038, 0.0, 474.0, 0.0, 800, "純潔の巫女装束Ｒ", 5.0, 0.0, 0.0, 10037038, 10.0, 0.0, 0.0, 10, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nエンプレスローブ。\n循環する魔力を増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 10.0, 0.0, 0, 44000, 0.0, 0.0, 364, 10037039, 0.0, 504.0, 0.0, 800, "エンプレスローブＲ", 5.0, 0.0, 0.0, 10037039, 10.0, 0.0, 0.0, 10, 1, 37, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (525.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n衛士のために作られた大盾。特殊な\n合金に接木された精霊花の再生能力\nにより事実上の不壊を実現した。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 201, 10040032, 0.0, 0.0, 0.0, 500, "妖精叢盾スプリガン", 0.0, 0.0, 0.0, 10040032, 0.0, 0.0, 0.0, 10, 1, 40, 0, 371.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (360.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られた重盾。独特の\n香気があらゆる攻撃を阻むが装備に\nは相応の覚悟と勇気が求められる。", 0.0, 15.0, 0.0, 0, 44000, 0.0, 0.0, 261, 10040033, 0.0, 0.0, 0.0, 800, "麝香猫果の薫盾", 0.0, 0.0, 0.0, 10040033, 15.0, 0.0, 0.0, 10, 1, 40, 0, 308.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (360.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n甲皮を使用した盾。恐るべき頑健さ\nを誇る上に、武器にもなる強固なる\n角を有した攻防一体の業物である。", 0.0, 16.0, 0.0, 0, 44000, 0.0, 0.0, 328, 10040035, 0.0, 0.0, 0.0, 800, "激突重盾トライセラ", 0.0, 0.0, 0.0, 10040035, 16.0, 0.0, 0.0, 10, 1, 40, 0, 332.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (360.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nガーディアンシールド。\nその魔力は頑強さを増幅し、\n装備者の潜在能力を高めてくれる。\n", 0.0, 16.0, 0.0, 0, 44000, 0.0, 0.0, 337, 10040036, 0.0, 0.0, 0.0, 800, "ガーディアンシールドＲ", 0.0, 0.0, 0.0, 10040036, 16.0, 0.0, 0.0, 10, 1, 40, 0, 350.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られたサンダル。\n抜群の履き心地が装備者に攻守共に\n隙のない安定した重心を与える。", 0.0, 6.0, 0.0, 0, 44000, 0.0, 0.0, 261, 10043033, 0.0, 0.0, 0.0, 500, "翠華西瓜の海水駄", 0.0, 0.0, 0.0, 10043033, 6.0, 0.0, 0.0, 10, 1, 43, 0, 439.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n革を使用した靴。大地に喰らいつく\nような独特の接地感が、稲妻の如く\n機敏で鋭い足捌きを可能にする。", 0.0, 7.0, 0.0, 0, 44000, 0.0, 0.0, 328, 10043035, 0.0, 0.0, 0.0, 500, "餓竜疾靴デュアルラプター", 0.0, 0.0, 0.0, 10043035, 7.0, 0.0, 0.0, 10, 1, 43, 0, 463.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nインファナルグリーブ。\nその魔力は機動性を増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 8.0, 0.0, 0, 44000, 0.0, 0.0, 355, 10043038, 0.0, 0.0, 0.0, 500, "インファナルグリーブＲ", 0.0, 0.0, 0.0, 10043038, 8.0, 0.0, 0.0, 10, 1, 43, 0, 504.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nフェアリアルブーツ。\nその魔力は機動性を増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 8.0, 0.0, 0, 44000, 0.0, 0.0, 364, 10043039, 0.0, 0.0, 0.0, 500, "フェアリアルブーツＲ", 0.0, 0.0, 0.0, 10043039, 8.0, 0.0, 0.0, 10, 1, 43, 0, 533.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (500.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n踊子のために作られた靴。ステップ\nを踏むことで出現する妖精の輪が\n異界から強大な魔力を引き出す。", 0.0, 4.0, 0.0, 0, 44000, 0.0, 0.0, 201, 10046032, 0.0, 385.0, 0.0, 500, "妖精舞沓シルキー", 0.0, 0.0, 0.0, 10046032, 4.0, 0.0, 0.0, 10, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (500.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する巨大な\nフルーツから作られた靴。瑞々しい\n香がインスピレーションをもたらし\n戦況を先読みする力を与える。", 0.0, 4.0, 0.0, 0, 44000, 0.0, 0.0, 261, 10046033, 0.0, 402.0, 0.0, 500, "紅玉苺の短靴", 0.0, 0.0, 0.0, 10046033, 4.0, 0.0, 0.0, 10, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (500.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nネクロマンサーブーツ。\nその魔力は機動性を増幅し、\n装備者の潜在能力を高めてくれる。\n", 0.0, 5.0, 0.0, 0, 44000, 0.0, 0.0, 337, 10046036, 0.0, 444.0, 0.0, 500, "ネクロマンサーブーツＲ", 0.0, 0.0, 0.0, 10046036, 5.0, 0.0, 0.0, 10, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (500.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nアクエリアスブーツ。\nその魔力は機動性を増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 5.0, 0.0, 0, 44000, 0.0, 0.0, 346, 10046037, 0.0, 455.0, 0.0, 500, "アクエリアスブーツＲ", 0.0, 0.0, 0.0, 10046037, 5.0, 0.0, 0.0, 10, 1, 46, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (525.0, 0, 0.0, 0, "機械人族の性能を底上げするための\n感覚拡張兵装。他種族も装着可能に\n改修されており、未来予測を投影し\n攻撃精度と生存率を劇的に高める。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 321, 10049034, 0.0, 0.0, 0.0, 800, "オートマトンバイザー", 0.0, 0.0, 0.0, 10049034, 0.0, 0.0, 0.0, 10, 1, 49, 0, 456.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (550.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nドラゴンヘッド。\nその加護は邪悪を遠ざけ、\n装備者の潜在能力を高めてくれる。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 346, 10049037, 0.0, 0.0, 0.0, 800, "ドラゴンヘッドＲ", 0.0, 0.0, 0.0, 10049037, 0.0, 0.0, 0.0, 10, 1, 49, 0, 489.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (550.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nフェザーワルツ。\nその加護は邪悪を遠ざけ、\n装備者の潜在能力を高めてくれる。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 355, 10049038, 0.0, 0.0, 0.0, 800, "フェザーワルツＲ", 0.0, 0.0, 0.0, 10049038, 0.0, 0.0, 0.0, 10, 1, 49, 0, 500.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "機械人族の性能を底上げするための\n感覚拡張兵装。他種族も装着可能に\n改修されており、魔力を可視化し\n運用精度を劇的に向上させる。", 0.0, 4.0, 0.0, 0, 44000, 0.0, 0.0, 321, 10052034, 0.0, 475.0, 0.0, 500, "オートマトンフルフェイス", 0.0, 0.0, 0.0, 10052034, 4.0, 0.0, 0.0, 10, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物の\n骨から削り出した冠。飛竜に酷似し\nながらもより速度に特化した骨格が\n風刃結界の加護を装備者に与える。\n", 0.0, 4.0, 0.0, 0, 44000, 0.0, 0.0, 328, 10052035, 0.0, 493.0, 0.0, 500, "翼竜額冠ロンギケプス", 0.0, 0.0, 0.0, 10052035, 4.0, 0.0, 0.0, 10, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n忘哭の冠。\nその加護は邪悪を遠ざけ、\n装備者の潜在能力を高めてくれる。", 0.0, 4.0, 0.0, 0, 44000, 0.0, 0.0, 355, 10052038, 0.0, 527.0, 0.0, 500, "忘哭の冠Ｒ", 0.0, 0.0, 0.0, 10052038, 4.0, 0.0, 0.0, 10, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n白祈の聖冠。\nその加護は邪悪を遠ざけ、\n装備者の潜在能力を高めてくれる。", 0.0, 4.0, 0.0, 0, 44000, 0.0, 0.0, 364, 10052039, 0.0, 565.0, 0.0, 500, "白祈の聖冠Ｒ", 0.0, 0.0, 0.0, 10052039, 4.0, 0.0, 0.0, 10, 1, 52, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天界より遣わされた戦士たちが身に\n付けていた紅玉の指輪。白き双翼の\n加護が邪悪に対するあらゆる攻撃を\n必滅の天の裁きへと昇華させる。", 0.0, 0.0, 0.0, 0, 44000, 9.0, 0.0, 198, 10055032, 0.0, 0.0, 0.0, 500, "リングオブメタトロン", 0.0, 0.0, 0.0, 10055032, 0.0, 0.0, 0.0, 10, 1, 55, 0, 458.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n女神姉妹が身に着けていた耳飾り。\n眷属である蝶は戦場を舞いその翅は\n敵対者の血で赤く染まっている。", 0.0, 0.0, 0.0, 0, 44000, 9.0, 0.0, 258, 10055033, 0.0, 0.0, 0.0, 500, "妖精晶翅ヴァハ", 0.0, 0.0, 0.0, 10055033, 0.0, 0.0, 0.0, 10, 1, 55, 0, 495.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する魔法の\nフルーツから作られた徽章。模様の\nカッティングは魔法陣で、可憐さを\n侮った相手は必ず後悔させられる。", 0.0, 0.0, 0.0, 0, 44000, 9.0, 0.0, 318, 10055034, 0.0, 0.0, 0.0, 500, "紅玉の徽章", 0.0, 0.0, 0.0, 10055034, 0.0, 0.0, 0.0, 10, 1, 55, 0, 514.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "機械人族の性能を底上げするための\n人造魔石。素材として数万を超える\n護符を使用し機能を抽出、装備者の\n身体能力を爆発的に拡張させる。", 0.0, 0.0, 0.0, 0, 44000, 9.0, 0.0, 325, 10055035, 0.0, 0.0, 0.0, 500, "クリムゾンデルタ", 0.0, 0.0, 0.0, 10055035, 0.0, 0.0, 0.0, 10, 1, 55, 0, 533.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物を\nモチーフに作られたペンダント。\n不規則で奇怪な鋭角機動が可能と\nなり死角からの鋭い一撃を与える。", 0.0, 0.0, 0.0, 0, 44000, 9.0, 0.0, 334, 10055036, 0.0, 0.0, 0.0, 500, "紅飾ラディオドンタ", 0.0, 0.0, 0.0, 10055036, 0.0, 0.0, 0.0, 10, 1, 55, 0, 552.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n猫神のペンダント。\n周囲の魔力を取り込み増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 0.0, 0.0, 0, 44000, 9.0, 0.0, 343, 10055037, 0.0, 0.0, 0.0, 500, "猫神のペンダントＲ", 0.0, 0.0, 0.0, 10055037, 0.0, 0.0, 0.0, 10, 1, 55, 0, 570.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n焔帝の指輪。\n周囲の魔力を取り込み増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 0.0, 0.0, 0, 44000, 9.0, 0.0, 352, 10055038, 0.0, 0.0, 0.0, 500, "焔帝の指輪Ｒ", 0.0, 0.0, 0.0, 10055038, 0.0, 0.0, 0.0, 10, 1, 55, 0, 589.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\nミレニアムイヤリング。\n周囲の魔力を取り込み増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 0.0, 0.0, 0, 44000, 9.0, 0.0, 361, 10055039, 0.0, 0.0, 0.0, 500, "ミレニアムイヤリングＲ", 0.0, 0.0, 0.0, 10055039, 0.0, 0.0, 0.0, 10, 1, 55, 0, 608.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (1180.0, 0, 0.0, 0, "天界より遣わされた戦士たちが身に\n付けていた翠玉の指輪。黄金の翼が\n装備者の肉体と魂の双方を包み込み\nあらゆる邪悪を拒絶し、放逐する。", 0.0, 33.0, 0.0, 0, 44000, 0.0, 0.0, 198, 10058032, 0.0, 0.0, 0.0, 500, "リングオブセフィロト", 0.0, 0.0, 0.0, 10058032, 33.0, 0.0, 0.0, 10, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (1420.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n女神姉妹が身に着けていた耳飾り。\n眷属である蝶は老樹に憑りつきその\n生命力を吸い上げ己が力と変える。", 0.0, 34.0, 0.0, 0, 44000, 0.0, 0.0, 258, 10058033, 0.0, 0.0, 0.0, 500, "妖精踊翅ネヴァン", 0.0, 0.0, 0.0, 10058033, 34.0, 0.0, 0.0, 10, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (1590.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する魔法の\nフルーツから作られた徽章。大地に\n満ちる豊穣の力を無限の生命力へ\n変換し、装備者へと与えてくれる。", 0.0, 34.0, 0.0, 0, 44000, 0.0, 0.0, 318, 10058034, 0.0, 0.0, 0.0, 500, "鬼木天蓼の徽章", 0.0, 0.0, 0.0, 10058034, 34.0, 0.0, 0.0, 10, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (1760.0, 0, 0.0, 0, "機械人族の性能を底上げするための\n人造魔石。精製不可能とされた素材\nを数万の工程を経て加工、装備者に\n防壁を張り耐久力を劇的に高める。", 0.0, 34.0, 0.0, 0, 44000, 0.0, 0.0, 325, 10058035, 0.0, 0.0, 0.0, 500, "ヴェルデスクエア", 0.0, 0.0, 0.0, 10058035, 34.0, 0.0, 0.0, 10, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (1835.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物を\nモチーフに作られたペンダント。\n揺蕩う巨影のようにあらゆる障害を\n意に介さず押し通ることができる。", 0.0, 35.0, 0.0, 0, 44000, 0.0, 0.0, 334, 10058036, 0.0, 0.0, 0.0, 500, "碧飾ケロニオイデア", 0.0, 0.0, 0.0, 10058036, 35.0, 0.0, 0.0, 10, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (2000.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n月のブレスレット。\n周囲の魔力を取り込み増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 35.0, 0.0, 0, 44000, 0.0, 0.0, 343, 10058037, 0.0, 0.0, 0.0, 500, "月のブレスレットＲ", 0.0, 0.0, 0.0, 10058037, 35.0, 0.0, 0.0, 10, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (2165.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n聖信徒のペンダント。\n周囲の魔力を取り込み増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 35.0, 0.0, 0, 44000, 0.0, 0.0, 352, 10058038, 0.0, 0.0, 0.0, 500, "聖信徒のペンダントＲ", 0.0, 0.0, 0.0, 10058038, 35.0, 0.0, 0.0, 10, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (2330.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n精霊王の護石。\n周囲の魔力を取り込み増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 35.0, 0.0, 0, 44000, 0.0, 0.0, 361, 10058039, 0.0, 0.0, 0.0, 500, "精霊王の護石Ｒ", 0.0, 0.0, 0.0, 10058039, 35.0, 0.0, 0.0, 10, 1, 58, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "天界より遣わされた戦士たちが身に\n付けていた蒼玉の指輪。白き片翼が\n天界に安置された番の翼と繋がり、\n膨大な魔力を地上へともたらす。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 198, 10061032, 0.0, 455.0, 0.0, 500, "リングオブサンダルフォン", 7.0, 0.0, 0.0, 10061032, 0.0, 0.0, 0.0, 10, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "現世とは異なる次元にある妖精界の\n女神姉妹が身に着けていた耳飾り。\n眷属である蝶は呪術を扱い、悲嘆と\n慟哭を啜り、蒼き翅を震わせる。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 258, 10061033, 0.0, 493.0, 0.0, 500, "妖精環翅モーリアン", 7.0, 0.0, 0.0, 10061033, 0.0, 0.0, 0.0, 10, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・テオゴニアに自生する魔法の\nフルーツから作られた徽章。装備者\nの魔力に特殊な反応を引き起こし、\n極大魔法による破壊の陶酔へ導く。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 318, 10061034, 0.0, 512.0, 0.0, 500, "巨峰の徽章", 7.0, 0.0, 0.0, 10061034, 0.0, 0.0, 0.0, 10, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "機械人族の性能を底上げするための\n人造魔石。結晶化の段階で数万を\n超える魔力回路が集積され装備者の\n魔法能力を飛躍的に向上させる。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 325, 10061035, 0.0, 531.0, 0.0, 500, "アズールサーキュラー", 7.0, 0.0, 0.0, 10061035, 0.0, 0.0, 0.0, 10, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "ジオ・ゲヘナに生息する謎の魔物を\nモチーフに作られたペンダント。\n無限に続く螺旋から巡り続ける魔力\nを引き出し規格外の一撃を与える。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 334, 10061036, 0.0, 549.0, 0.0, 500, "蒼飾フィロセラス", 7.0, 0.0, 0.0, 10061036, 0.0, 0.0, 0.0, 10, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n竜の涙。\n周囲の魔力を取り込み増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 343, 10061037, 0.0, 568.0, 0.0, 500, "竜の涙Ｒ", 7.0, 0.0, 0.0, 10061037, 0.0, 0.0, 0.0, 10, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n大賢者の宝珠。\n周囲の魔力を取り込み増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 352, 10061038, 0.0, 587.0, 0.0, 500, "大賢者の宝珠Ｒ", 7.0, 0.0, 0.0, 10061038, 0.0, 0.0, 0.0, 10, 1, 61, 0, 0.0);
INSERT INTO `v1_07a920aa53485e91c614438924feec17c43c4008294e92b9650ea1c06442bf75` VALUES (0.0, 0, 0.0, 0, "莫大なマナで更なる強化を施された\n海神の耳飾り。\n周囲の魔力を取り込み増幅し、\n装備者の潜在能力を高めてくれる。", 0.0, 0.0, 0.0, 0, 44000, 0.0, 0.0, 361, 10061039, 0.0, 605.0, 0.0, 500, "海神の耳飾りＲ", 7.0, 0.0, 0.0, 10061039, 0.0, 0.0, 0.0, 10, 1, 61, 0, 0.0);
